INSERT INTO `rp_rules` VALUES (1, 'Конституция', '&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Преамбула&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Мы, народ Штата Сан Андреас, в целях образования более совершенного обществаа, утверждения правосудия, обеспечения внутреннего спокойствия, организации совместной обороны, содействия общему благосостоянию и обеспечения нам и нашему потомству благ свободы, учреждаем и принимаем эту Конституцию для штата Сан Андреас.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Раздел I. Общая декларация прав и свобод граждан штата Сан Андреас.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1. В штате Сан Андреас обозначена республиканская форма правления. Суверенитет штата гарантируется и распространяется на всей его территории.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2. Все жители штата имеют неотчуждаемые права по природе своей. Среди этих прав - право на защиту жизни и свободы, на приобретение, владение и защиту имущества, на безопасность и личную жизнь, вне зависимости от социального статуса, расы и других не-гражданственных определений.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3. Право избирать власть и влиять на политику - ключевое право жителей штата Сан Андреас. Правительство на территории штата учреждено для обеспечения безопасности и защиты, а также для социального равенства и общего блага во всех его проявлениях. Народ имеет право путем подачи петиции запросить смены правительства, если на то есть веские основания. Право избирать реализуется путем голосования.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;4. Штат Сан Андреас является неотъемлемой частью США и все нормативные акты, действующие на территории Соединенных Штатов, также относятся к Сан Андреас.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5. Штат Сан Андреас гарантирует презумпцию невиновности гражданам, вина которых в преступлениях против народа не доказана. В случае, если доказательства не очевидны - гражданин может быть отпущен под залог, установленный регламентирующими документами правоохранительных организаций.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;6. Каждый гражданин штата имеет право на своевременное публичное судебное разбирательство. Во время судебного разбирательства Суд обязан оглашать стороне обвинения наличие свидетелей и адвокатов стороны обвинителя, и наоборот.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;7. Любое гражданское лицо не должно быть принуждено по любому уголовному делу быть свидетелем против самого себя. Исключением является добровольная дача показаний во избежания отягощения обвинения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;8. Каждый гражданин штата имеет право на свободу вероисповедания, и не может быть дискриминирован/ущемлен по этому признаку, за исключением радикальных религиозных организаций, оказывающих прямую угрозу суверенитету или безопасности государства в целом.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;9. Неотъемлемое право каждого гражданина штата - право слова. У жителей есть право свободно высказывать в любой форме свое мнение на любую тему (в том числе и политическую, с отсылкой на пункт 2 Декларации правовой свободы), если это не противоречит активному законодательству и не является откровенной клеветой. Средства массовой информации имеют законное право не разглашать свои источники информации.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;10. Народ имеет право свободно собираться для обсуждения общего блага или тревожащих народ вопросов. Акции протеста без радикальных действий (определенных законодательной базой Штата) также являются законным правом граждан. Граждане штата имеют право подавать петиции государственным деятелям на рассмотрение. Данные петиции могут содержать в себе позывы к реформам, инициативы, импичмент и законодательные предложения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;11. Частная собственность любого гражданина Штата не может быть изъята без достойной компенсации. В исключения входит законное изъятие собственности у нарушителей активного законодательства (при нарушениях среднего, тяжкого и особо тяжкого уровня).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;12. Государственные правоохранительные организации созданы для поддержания порядка и обеспечения безопасности граждан, потому должны осознавать факт своего служения народу. Действие правоохранительных органов вопреки интересам граждан (за исключением нарушений правопорядка со стороны этих граждан) уголовно наказуемо.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;13. Любой житель штата (гражданин или приезжий) имеет право на свободу труда. В штате запрещено рабство, принудительный труд. Исключением для принудительного труда является мера наказания при нарушении гражданином активного законодательства.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;14. Любая имеющаяся в распоряжении частного лица материальная или нематериальная собственность не подлежит обыску или изъятию без веской причины. Веской причиной считается обоснованное подозрение в совершении преступления, описанного в активном законодательстве. Граждане штата имеют право на защиту своей собственности.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;15. Государственной изменой как со стороны гражданина, так и со стороны избранного государственного представителя является открытая или скрытая деятельность против интересов Штата, поддерживая врагов штата или оказывая им помощь любого вида.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;16. Положения нынешней подтвержденной Конституции являются обязывающими и запретительными к исполнению всеми физическими или юридическими лицами, находящимися на территории штата. Конституция - это закон прямого действия и рассматривается во всех вариациях/проявлениях, предоставляя общие позиции к исполнению.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;17. Не могут назначаться жестокие или необычные наказания и накладываться чрезмерные штрафы.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;18. Фелонии* преследуются в уголовном порядке, предусмотренным законодательством, либо по обвинительному заключению или после предварительного рассмотрения дела и приказа магистрата о заключении под стражу, а также по информации.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Лицо, обвиняемое в совершении фелонии подлежит рассмотрению, должно быть без необходимых отлагательств препровождено к магистрату данного суда. Магистрат обязан незамедлительно выдать обвиняемому копию жалобу, сообщить обвиняемому о праве на адвоката, предоставить обвиняемому достаточное время для вызова адвоката, а также по просьбе обвиняемого зачитать жалобу. По просьбе обвиняемого магистрат обращается к служащему правопорядка с просьбой направить в пределах судебного округа уведомление адвокату, которого указал обвиняемый.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;18.1. В случае, когда фелония преследуется в уголовном порядке по обвинительному заключению, после такового никакое предварительное расследование не может место быть.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;*По степени опасности по американской материально-правовой классификации преступления делятся на опасные преступления &amp;amp;ndash; фелонии и менее опасные &amp;amp;ndash; мисдиминоры. К мисдиминорам относятся, как правило, те преступления, за которые может быть назначено наказание в виде лишения свободы до 1 года и (или) штраф, а к фелониям &amp;amp;ndash; все остальное.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Раздел II. Исполнительная власть штата.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1. Исполнительные полномочия в штате Сан Андреас по праву переданы действующему Губернатору штата на момент его активного срока руководства.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2. Губернатор штата Сан Андреас (далее - Губернатор) является главнокомандующим силами правоохранительных органов, что устанавливается законом. Губернатор вправе задействовать их для исполнения законов.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3. Лицо избирается на роль Губернатора и/или Вице-губернатора на срок в 14 месяцев за исключением ситуаций, когда кандидатура отклоняется ввиду грубых нарушений законодательства или Конституции.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;4. Лицо, представляющее себя на позицию Губернатора/Вице-губернатора/окружного Мэра/заместителя окружного Мэра должно на момент подачи заявки участия в выборах проживать в Штате не менее двух лет, быть возрастом не менее 21 лет, являться Гражданином США, не владеть бизнесом, не должно быть судимым (в том числе находиться в розыске), иметь удовлетворительное для работы без помех состояние здоровья и идеальное знание государственного языка для представления своего Штата.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5. В случае отстранения действующего Губернатора штата от должности или его смерти, отставки, либо неспособности осуществлять полномочия и обязанности по названной должности таковые переходят к Вице-губернатору. За исключением случаев, когда Вице-Губернатор является причиной снятия Губернатора с должности. В данном случае определяется конфликт интересов, и вместо Вице-Губернатора пост занимает следующий по ранговой ветви представитель правительства.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;6. Когда Губернатор представит Председателю Генерального совете штата свое письменное заявление о том, что он не в состоянии осуществлять полномочия и обязанности по своей должности, такие полномочия и обязанности осуществляются Вице-губернатором как исполняющим обязанности Губернатора до тех пор, пока Губернатор не представит Генеральному совету письменное заявление об обратном или окончание установленного срока.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;7. Вице-губернатор имеет такие же квалификации, что и Губернатор.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;8. Перед вступлением в должность, Губернатор в начале своего срока обязан дать присягу верности штату Сан Андреас в следующей форме: &amp;amp;laquo;Я торжественно клянусь, что буду добросовестно исполнять обязанности Губернатора штата Сан Андреас, служить интересам граждан штата, и всеми своими силами обеспечивать его безопасность и процветание&amp;amp;raquo;.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;9. Являясь представителем исполнительной власти, Губернатор обязан:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Отвечать за сохранение и поддержку прав и свобод граждан штата, их благосостояние и соблюдение государственными организациями их прямого предназначения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Анализировать и регулировать экономику, уровень преступности, социальной активности в штате для обеспечения максимального комфорта жизни граждан и приезжих.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Информировать жителей Штата о любых изменениях в Конституции, нормативных актах и законах Сан Андреас. При необходимости - предоставлять объяснение конкретных пунктов этих изменений для правильной трактовки государственными организациями и гражданами.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Утверждать и регулировать налоговую ставку, утвержденную и представленную Генеральным Советом. Соблюдать адекватность налогообложения и ставить финансовое благополучие граждан на первое место в разумных пределах.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Оказывать в рамках возможностей правительства поддержку как юридическим лицам для проведения социальных, увеселительных мероприятий и других мероприятий.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Оказывать поддержку государственным организациям для обеспечения модернизации и исполнения целевых функций.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Оказывать помощь частным лицам, попавшим в ситуацию непреодолимых обстоятельств по мере возможности. (Непреодолимыми обстоятельствами считается война/военные действия, стихийные бедствия, биологические, экологические и индустриальные катастрофы).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;10. Губернатор, являясь представителем Исполнительной власти штата, имеет право:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Представлять на всеобщее обозрение постановления, обязательные к исполнению всеми жителями штата. (За исключением ситуаций, когда постановление нарушает основные позиции конституции или активного законодательства).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Распоряжаться казной штата на своё усмотрение в разумной мере, руководствуясь имеющимся бюджетом, планируемыми расходами и целевым направлением. -Производить изменения в процедуре работы государственных организаций, занимаемых представителями должностях (не нарушая при этом действующего законодательства и конституции).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Производить изменения в процедуре работы государственных организаций, занимаемых представителями должностях (не нарушая при этом действующего законодательства и конституции).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Принимать единоличные мнения в чрезвычайных ситуациях без подтверждения Генерального совета. (Кворум Генерального Совета не требуется в случае, если произошла национальная угроза желтого или красного уровня, стихийное бедствие, эпидемия, экологическая, биологическая или индустриальная катастрофа).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-На отмену представленных постановлений, если они составлены в противоречии с действующей конституцией или законодательством, в том числе без подтверждения Генерального Совета.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Санкционировать организацию как плановых, так и не плановых проверок по отношению государственных организаций (в том числе и самого правительства) от лица определенной Губернатором доверенной инспекции. (При условии, что такие проверки не замораживают работу подконтрольных Губернатору государственных организаций и не несут за собой негативных последствий для штата).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Официально организовывать общественные мероприятия со средств Штата, если они имеют стратегическое значение для благополучия граждан Сан Андреас.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Представлять к наградам как государственные, так и юридические, частные лица за верное служение Штату, особые достижения, открытия и активное участие в жизни Сан Андреас.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Требовать предоставления информации, относящейся к исполнению им своих обязанностей, от исполнительных служащих и служб.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;11. Как Губернатор, так и любые замещающие его лица, совершая правонарушение против своего штата (включающее в себя предательство государства, взяточничество, явное нарушение конституции или законодательства) - путем импичмента вынуждены покинуть свой пост. Потеря доверия от лица избирателей единожды считается невозвратной.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Раздел III. Законодательная власть штата.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1. В качестве законодательной власти в штате Сан Андреас народ подтверждает и признает Генеральный Совет Штата.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2. В Генеральный Совет входят представители государственных организаций штата Сан Андреас и лица, избранные народом раз в шесть месяцев путём голосования. Лица, представляющее себя на позицию членов Генерального Совета штата Сан Андреас должны к моменту начала выборов проживать в Штате не менее двух лет, быть возрастом не менее 21 года, не должны быть судимы (в том числе находиться в розыске), иметь удовлетворительное для работы без помех состояние здоровья и идеальное знание государственного языка для представления своего Штата.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3. Заполнение незанятой позиции путём выборов для Генерального совета приказом обозначает Губернатор Штата Сан Андреас. Председатель Генерального Совета избирается членами Генерального совета сроком на шесть месяцев. Для выбора председателя Совета необходим кворум в ⅔ присутствующих по принципу &amp;amp;ldquo;Simple majority&amp;amp;rdquo;. Решения и постановления принимаются по тому же принципу.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;4. Генеральный Совет штата имеет приоритетное право на рассмотрение вопросов импичмента первых лиц Штата (Губернатора и/или Вице-Губернатора). Решение генерального совета сопутствуется присягой и должно быть объективно, потому подтверждается только принципом ⅔ &amp;amp;ldquo;Simple Majority&amp;amp;rdquo; без исключений.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5. Импичмент правительственного лица не предусматривает иных наказаний кроме снятия с занимаемой позиции, за исключением явного нарушения конституции или тяжелых нарушений законодательства. В данном случае мера наказания применяется в соотношении с нормативными актами.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;6. Генеральный Совет имеет право представить на рассмотрение изменение процедуры или сроков выборов и решений по принятию законов, но не имеет однозначной возможности принимать такие решения без подтверждения Губернатора и очевидного обоснования. Подобная процедура применяется и к любым другим законопроектам, проходя через Губернатора с его последующим решением отправить законопроект на подтверждение или на пересмотр Генеральным советом.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;7. Правила работы Генерального Совета штата Сан Андреас:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Генеральный Совет обязан собираться для рассмотрения ключевых вопросов не реже чем раз в 2 месяца.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Генеральный Совет должен следить за системой налогообложения и при необходимости предлагать законопроекты об изменении налоговой маржи для стабилизации ситуации или для пополнения бюджета в экстренных случаях.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Генеральный Совет обязан предусматривать ответственность за подделку ценных бумаг, облигаций, официальной документации или валюты США.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Генеральный Совет имеет право учреждать судебные разбирательства, нижестоящие по отношению к Верховному Суду штата.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Генеральный Совет занимается мониторингом регистрирующихся Политических партий, проверяя их достоверность и соответствие политическому устройству Сан Андреас, и после отправляя к Губернатору на усмотрение и занесение в базу данных официальных политических партий.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Генеральный совет при Кворуме в ⅔ имеет право предлагать поправки к действующей Конституции.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Раздел IV. Судебная власть штата.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1. Судебная власть в штате Сан Андреас предоставляется Верховному суду штата и Окружным судам штата.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2. Судебная власть распространяется на все дела, которые рассматриваются по общему праву и праву справедливости, и возникают на основе настоящей Конституции, законов штата Сан Андреас и договоров, заключенных или заключаемых от их имени; на все дела, касающиеся представителей государственных организаций, их заместителей, председателей политический партий, председателя и членов генерального совета.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;По всем делам, касающимся представителей государственных организаций, их заместителей, председателей политический партий, председателя и членов генерального совета, а также по делам, Верховный суд обладает первоначальной юрисдикцией. По всем другим упомянутым выше делам Верховный суд обладает апелляционной юрисдикцией по вопросам как права, так и факта с такими исключениями и в соответствии с теми правилами, которые установлены Генеральным советом.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Разбирательство в судах всех преступлений, за исключением случаев импичмента, производится судом присяжных; и такое разбирательство должно производиться в том штате, где упомянутые преступления совершены; но если преступления совершены за пределами любого из штатов, разбирательство дел в суде производится в том месте или местах, какие Генеральный совет может посредством принятия закона определить.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3. Государственной изменой штату Сан Андреас считается только ведение войны против него или присоединение к его врагам и оказание им помощи и содействия. Ни одно лицо не может быть осуждено за государственную измену, иначе как на основании показаний трёх свидетелей об одном и том же очевидном деянии, либо собственного признания на открытом заседании суда.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Генеральный совет имеет право устанавливать наказание за государственную измену, но признание виновным в измене не влечет лишения всех прав и состояния, либо конфискации имущества иначе как при жизни виновного лица.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;4. Верховный суд штата Сан Андреас состоит из Верховного судьи штата Сан Андреас и 6-ти ассоциированных судей. Верховный судья вправе созывать заседание суда в любое время. Для вынесения судебного решения необходимо согласие 4-х судей, присутствующих в прениях. Исполняющий обязанности Верховного судьи осуществляет все его функции во время отсутствия Верховного судьи или его нетрудоспособности. Верховный судья, а при его неспособности, суд должен избрать ассоциированного судью в качестве исполняющего обязанности Верховного судьи.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5. Законодательное собрание штата Сан Андреас разделяет штат на округа, в каждом из который имеется Окружной суд с одним или более отделениями. Законодательное собрание штата должно установить количество судей и предусмотреть штат служащих и работников окружных судов.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Исполняющий обязанности председательствующего судьи осуществляет все его функции во время его отсутствия или нетрудоспособности. Председательствующий судья, а при его неспособности &amp;amp;ndash; Верховный судья, должен избрать ассоциированного судью такого отделения в качестве исполняющего обязанности председательствующего судьи.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;6. Совет Судей состоит из Верховного судьи, одного судьи Верховного суда, 4-х судей Окружных судов.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Верховный судья способствует скорому ведению судебного делопроизводства и равному распределению работы судей. Судьи отчитывают перед Советом по указанию Верховного судьи о состоянии судебного делопроизводства в их судах. Они должны поддерживать сотрудничество с Советом и вершить суд в надлежащем порядке.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;7. Решения Верховного суда, рассматривающего дела, должны быть в электронно-письменной форме и обоснованными.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;8. Судьи Верховного суда избираются на всеобщих выборах. Сроки их полномочий устанавливаются в 6 лет, начиная 1 октября, следующего за их избранием, за исключением случаев, когда судья, избранный на не истекший срок, остается в должности на остаток срока.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Лицо, представляющее себя на позицию Судьи Верховного суда штата Сан Андреас должно на момент подачи заявки участия в выборах проживать в Штате не менее пяти лет, быть возрастом не менее 24 лет, являться Гражданином США, не должно быть судимым (в том числе находиться в розыске), иметь удовлетворительное для работы без помех состояние здоровья, идеальное знание законодательной базы штата Сан Андреас и государственного языка.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;9. Судьи Окружного суда избираются на выборах среди государственных служащих. Сроки их полномочий устанавливаются в 2 года, начиная 1 октября, следующего за их избранием, за исключением случаев, когда судья, избранный на не истекший срок, остается в должности на остаток срока.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Лицо, представляющее себя на позицию Судьи Окружного суда штата Сан Андреас должно на момент подачи заявки участия в выборах проживать в Штате не менее двух лет, быть возрастом не менее 21 года, являться Гражданином США, не должно быть судимым (в том числе находиться в розыске), иметь удовлетворительное для работы без помех состояние здоровья, идеальное знание законодательной базы штата Сан Андреас и государственного языка.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Раздел V. Штат Сан Андреас.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1. Штат Сан Андреас является субъектом Соединенных Штатов Америки, со столицей в городе Лос Сантос, где располагается Правительство Штата с Губернатором во главе.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2. Штат Сан Андреас делится на два округа:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Округ Блэйн, со столицей в Палето Бэй;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-Округ Лос Сантос, со столицей в Лос Сантосе.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3. Округи имеют общую государственную структуру, но государственные правоохранительные органы обязаны действовать в пределах своего округа (за исключением выданных ордеров на территории другого округа, чрезвычайных ситуаций (код0), всплесков ограблений, преследовании из одного округа в другой).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-На территории округа Лос Сантос действует: S.A.P.D.;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;-На территории округа Блэйн и округа Лос Сантос (исключение: город Лос Сантос) действует: S.A.S.D.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;4. Федеральное Расследовательское Бюро и Армия Национальной Гвардии являются федеральными государственными структурами и действуют на территории всего Штата.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5. Государственная власть штата подразделяется на законодательную, исполнительную и судебную. Лица, осуществляющие полномочия одной власти не могут осуществлять полномочия других властей, за исключением случаев, предусмотренных этой Конституцией.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Раздел VI. Общие позиции, обеспечивающие равноправие и свободу действий.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1. Ввиду вышеописанного права гражданина на самооборону и охрану материальных и нематериальных ценностей - гражданин имеет право на скрытое ношение и использование оружия (в крайних случаях и в разумных рамках). Ношение оружия разрешено только при наличии соответствующей лицензии.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2. Законы, пресекающие исповедание определенных религий, свободу слова и печати или любую другую свободу гражданина исходя из Конституции, являются неправомерными и не могут быть изданы даже с подтверждения Губернатора штата.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3. Расовая, религиозная принадлежности или любые другие социальные ярлыки не могут быть предлогом отказа в принятии на трудоустройство в государственных организациях.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;4. Право народа на хранение и скрытое ношение оружия при соблюдении остальных связанных пунктов законодательства не может быть ограничено.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5. Право частного или юридического лица на гарантию неприкосновенности личности, жилища, ценных бумаг и документов (и других материальных и нематериальных ценностей), обысков и арестов не должно нарушаться ни при каких обстоятельствах. Ордеры и соответствующие внутренним уставам государственных организаций процедуры проверки могут совершаться только в случае явного подозрения в нарушении конституции и/или законодательства. Исключением в праве на гарантию неприкосновенности документов обозначено к государственным организациям. Учитывая наличие Инспектората - внутренние документы должны предоставляться для обеспечения контроля над данными государственным организациями, оценкой их дееспособности и регулировкой их направления движения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;6. Ни одно лицо, привлеченное к ответственности за преступление, не может наказываться смертельным приговором. Максимальный срок заключения при одиночном задокументированном преступлении - 50 лет в колонии Болингброук. Наказания могут быть увеличены за содеянное в чертах тюрьмы, но не предполагают смертельной опасности. Исключение - вынужденное убийство во время прямой угрозы гражданам и/или представителям власти/правоохранительных органов.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;7. Любая налоговая процедура или процедура штрафов за нарушение должна быть прозрачна и находиться в общем доступе. Исходя из этого, налогообложение и штрафы не могут превышать обозначенные законодательством суммы.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;8. Сбор, хранение, использование и распространение информации о частном, юридическом или государственном лице строго запрещено, за исключением случаев, когда лицо находится под подозрением о совершении любого действия, нарушающего действующее законодательство и/или конституцию.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;9. В штате Сан Андреас поддерживается труд и здоровье граждан. Правительство должно следить за соблюдением минимальной оплаты за труд и доступностью медицинских услуг для всех слоев населения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;10. Лица, родившиеся или натурализованные в штате Сан Андреас являются его гражданами.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;11. Законы подлежат официальному опубликованию Губернатором. Любые правовые или нормативные акты, изменения в действующей конституции или активном законодательстве, распоряжения, затрагивающие личную и общественную жизнь граждан - должны исходить в письменной общедоступной форме от Губернатора. В противном случае такие постановления не считаются вступившими в силу.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;12. Право гражданина Сан Андреас в возрасте 21 года участвовать в выборах не должно оспариваться по признакам расовой принадлежности, религии, пола и других социальных ярлыков ни при каких обстоятельствах.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;13. Перечисление в Конституции определенных прав не должно толковаться как отрицание или умаление других прав, сохраняемых за народом.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;14. Отсутствие определенных пунктов прав граждан в Конституции не исключает наличие конкретных свобод и оценивается по этическим соображениям.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n');
INSERT INTO `rp_rules` VALUES (2, 'Гражданский кодекс', '&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;ГРАЖДАНСКИЙ КОДЕКС ШТАТА САН-АНДРЕАС&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Глава I. Гражданское законодательство.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Статья 1. Общая характеристика кодекса.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1.1. Гражданское законодательство основывается на признании равенства участников регулируемых им отношений, неприкосновенности собственности, свободы договора, недопустимости произвольного вмешательства кого-либо в частные дела, необходимости беспрепятственного осуществления гражданских прав, обеспечения восстановления нарушенных прав, их судебной защиты.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1.2. Граждане (физические лица) и юридические лица приобретают и осуществляют свои гражданские права своей волей и в своем интересе. Они свободны в установлении своих прав и обязанностей на основе договора и в определении любых не противоречащих законодательству условий договора.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Гражданские права могут быть ограничены на основании принятых законов, и только в той мере, в какой это необходимо в целях защиты основ конституционного строя, нравственности, здоровья, прав и законных интересов других лиц, обеспечения обороны штата, и страны, и безопасности штата и государства.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1.3. При установлении, осуществлении и защите гражданских прав и при исполнении гражданских обязанностей участники гражданских правоотношений должны действовать правомерно.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Никто не вправе извлекать преимущество из своего незаконного или неправомерного поведения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1.4. Товары, услуги и финансовые средства свободно перемещаются на всей территории Соединенных штатов Америки.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Ограничения перемещения товаров и услуг могут вводиться в соответствии с принятыми законопроектами, если это необходимо для обеспечения безопасности, защиты жизни и здоровья людей, охраны природы и культурных ценностей.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Статья 2. Отношения, регулируемые гражданским законодательством.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2.1. Гражданское законодательство определяет правовое положение участников гражданского оборота, основания возникновения и порядок осуществления права собственности и других вещных прав, прав на результаты интеллектуальной деятельности и приравненные к ним средства индивидуализации (интеллектуальных прав), регулирует отношения, связанные с участием в корпоративных организациях или с управлением ими (корпоративные отношения), договорные и иные обязательства, а также другие имущественные и личные неимущественные отношения, основанные на равенстве, автономии воли и имущественной самостоятельности участников.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Участниками регулируемых гражданским законодательством отношений являются граждане и юридические лица. В регулируемых гражданским законодательством отношениях может участвовать также Штат Сан-Андреас.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2.2. Гражданское законодательство регулирует отношения между лицами, осуществляющими предпринимательскую деятельность, или с их участием, исходя из того, что предпринимательской является самостоятельная, осуществляемая на свой риск деятельность, направленная на систематическое получение прибыли от пользования имуществом, продажи товаров, выполнения работ или оказания услуг. Лица, осуществляющие предпринимательскую деятельность, должны быть зарегистрированы в этом качестве в установленном законом порядке, если иное не предусмотрено настоящим Кодексом.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2.3. К имущественным отношениям, основанным на административном или ином властном подчинении одной стороны другой, в том числе к налоговым и другим финансовым и административным отношениям, гражданское законодательство не применяется, если иное не предусмотрено законодательством.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2.4. Любые сделки и договоры между юридическими лицами, и гражданами(физические лица) должны быть заверены лицензированным нотариусам.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Глава II. Юридические лица.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Статья 3. Правоспособность юридического лица.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3.1. Юридическим лицом признается организация, которая имеет обособленное имущество и отвечает им по своим обязательствам, может от своего имени приобретать и осуществлять гражданские права и нести гражданские обязанности, быть истцом и ответчиком в суде.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3.2. Юридическое лицо должно быть зарегистрировано в едином государственном реестре юридических лиц в одной из организационно-правовых форм, предусмотренных настоящим Кодексом и другими нормативно-правовыми актами.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3.3. Юридическое лицо может иметь гражданские права, соответствующие целям деятельности, предусмотренным в его учредительном документе, и нести связанные с этой деятельностью обязанности.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;В случаях, предусмотренных законом, юридическое лицо может заниматься отдельными видами деятельности только на основании специального разрешения (лицензии), членства в саморегулируемой организации или выданного саморегулируемой организацией свидетельства о допуске к определенному виду работ.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3.4. Юридическое лицо может быть ограничено в правах лишь в случаях и в порядке, предусмотренных законом. Решение об ограничении прав может быть оспорено юридическим лицом в суде.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3.5. Правоспособность юридического лица возникает с момента внесения в единый государственный реестр юридических лиц сведений о его создании и прекращается в момент внесения в указанный реестр сведений о его прекращении.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Право юридического лица осуществлять деятельность, для занятия которой необходимо получение специального разрешения (лицензии), членство в саморегулируемой организации или получение свидетельства саморегулируемой организации о допуске к определенному виду работ, возникает с момента получения такого разрешения (лицензии) или в указанный в нем срок, либо с момента вступления юридического лица в саморегулируемую организацию или выдачи саморегулируемой организацией свидетельства о допуске к определенному виду работ и прекращается при прекращении действия разрешения (лицензии), членства в саморегулируемой организации или выданного саморегулируемой организацией свидетельства о допуске к определенному виду работ.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3.6. Перечень специальных разрешений (лицензии), возможных для получения юридическим лицам:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- введение юридической деятельности;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- лицензия ЧОП(Частное Охранное Предприятие);&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- лицензия ЧВК(Частная Военная Компания);&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- лицензия на бизнес.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Статья 4. Коммерческие и некоммерческие организации.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;4.1. Юридическими лицами могут быть организации, преследующие извлечение прибыли в качестве основной цели своей деятельности (коммерческие организации), либо не имеющие извлечение прибыли в качестве такой цели и не распределяющие полученную прибыль между участниками (некоммерческие организации).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;4.2. Некоммерческие организации могут осуществлять приносящую доход деятельность, если это предусмотрено их уставами, лишь постольку, поскольку это служит достижению целей, ради которых они созданы, и если это соответствует таким целям.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Статья 5. Государственная регистрация юридических лиц.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5.1. Юридическое лицо подлежит государственной регистрации в уполномоченном государственном органе в порядке, предусмотренном Гражданским процессуальным кодексом.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5.2. В случаях и в порядке, которые предусмотрены Гражданским процессуальным кодексом, уполномоченный государственный орган обязан заблаговременно сообщить заинтересованным лицам о предстоящей государственной регистрации изменений устава юридического лица и о предстоящем включении данных в единый государственный реестр юридических лиц.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5.3. Отказ в государственной регистрации юридического лица, а также во включении данных о нем в единый государственный реестр юридических лиц допускается только в случаях, предусмотренных Гражданским процессуальным кодексом.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Отказ в государственной регистрации юридического лица и уклонение от такой регистрации могут быть оспорены в суде.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5.4. Государственная регистрация юридического лица может быть признана судом недействительной в связи с допущенными при его создании грубыми нарушениями закона, если эти нарушения носят неустранимый характер.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Включение в единый государственный реестр юридических лиц данных о юридическом лице может быть оспорено в суде, если такие данные недостоверны или включены в указанный реестр с нарушением закона.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5.5. Убытки, причиненные незаконным отказом в государственной регистрации юридического лица, уклонением от государственной регистрации, включением в единый государственный реестр юридических лиц недостоверных данных о юридическом лице, либо нарушением порядка государственной регистрации, предусмотренного Гражданским процессуальным кодексом, по вине уполномоченного государственного органа, подлежат возмещению за счет бюджета штата Сан-Андреас.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5.6. Юридическое лицо считается созданным, а данные о юридическом лице считаются включенными в единый государственный реестр юридических лиц со дня внесения соответствующей записи в этот реестр.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Статья 6. Учредительные документы юридических лиц.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;6.1. Юридические лица действуют на основании уставов, которые утверждаются их учредителями (участниками) и были приняты министерством юстиций.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;6.2. Устав юридического лица, утвержденный учредителями (участниками) юридического лица, должен содержать сведения о наименовании юридического лица, его организационно-правовой форме, месте его нахождения, порядке управления деятельностью юридического лица, а также другие сведения позволяющие определить направленность их деятельность.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;6.3. В уставах некоммерческих организаций должны быть определены предметы и цели деятельности юридических лиц.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;6.4. Изменения, внесенные в учредительные документы юридических лиц должны быть согласованы с министерством юстиций.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Статья 7. Ответственность юридического лица.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;7.1. Юридическое лицо отвечает по своим обязательствам всем принадлежащим ему имуществом.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;7.2. Учредитель (участник) юридического лица или собственник его имущества не отвечает по обязательствам юридического лица, а юридическое лицо не отвечает по обязательствам учредителя (участника) или собственника, за исключением случаев, предусмотренных настоящим Кодексом или другим законом.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Глава III. Граждане (физические лица)&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Статья 8. Правоспособность гражданина.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;8.1. Способность иметь гражданские права и нести обязанности (гражданская правоспособность) признается в равной мере за всеми гражданами.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;8.2. Правоспособность гражданина возникает в момент его рождения и прекращается смертью.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Статья 9. Содержание правоспособности граждан.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Граждане могут иметь имущество на праве собственности; наследовать и завещать имущество; заниматься предпринимательской и любой иной не запрещенной законом деятельностью; создавать юридические лица самостоятельно или совместно с другими гражданами и юридическими лицами; совершать любые не противоречащие закону сделки и участвовать в обязательствах; избирать место жительства; иметь права авторов произведений науки, литературы и искусства, изобретений и иных охраняемых законом результатов интеллектуальной деятельности; иметь иные имущественные и личные неимущественные права.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Статья 10. Имя гражданина.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;10.1. Гражданин приобретает и осуществляет права и обязанности под своим именем, включающим фамилию и собственно имя.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;10.2. Гражданин вправе переменить свое имя в порядке, установленном законом. Перемена гражданином имени не является основанием для прекращения или изменения его прав и обязанностей, приобретенных под прежним именем.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;10.3. Гражданин, переменивший имя, вправе требовать внесения за свой счет соответствующих изменений в документы, оформленные на его прежнее имя.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;10.4. Имя, полученное гражданином при рождении, а также перемена имени подлежат регистрации в порядке, установленном Гражданским процессуальным кодексом.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;10.5. Приобретение прав и обязанностей под именем другого лица не допускается.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Статья 11. Дееспособность гражданина.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Способность гражданина своими действиями приобретать и осуществлять гражданские права, создавать для себя гражданские обязанности и исполнять их (гражданская дееспособность) возникает в полном объеме с наступлением совершеннолетия, то есть по достижении восемнадцатилетнего возраста.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Статья 12. Недопустимость лишения и ограничения правоспособности и дееспособности гражданина.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;12.1. Никто не может быть ограничен в правоспособности и дееспособности иначе, как в случаях и в порядке, установленных Гражданским процессуальным кодексом.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;12.2. Несоблюдение установленных законом условий и порядка ограничения дееспособности граждан или их права заниматься предпринимательской, либо иной деятельностью влечет недействительность акта государственного или иного органа, устанавливающего соответствующее ограничение.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;12.3. Полный или частичный отказ гражданина от правоспособности или дееспособности и другие сделки, направленные на ограничение правоспособности или дееспособности, ничтожны, за исключением случаев, когда такие сделки допускаются законом.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Статья 13. Предпринимательская деятельность гражданина.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;13.1. Гражданин вправе заниматься предпринимательской деятельностью без образования юридического лица с момента государственной регистрации в качестве индивидуального предпринимателя, за исключением случаев, предусмотренных абзацем вторым настоящего пункта.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;В отношении отдельных видов предпринимательской деятельности законом могут быть предусмотрены условия осуществления гражданами такой деятельности без государственной регистрации в качестве индивидуального предпринимателя.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;13.2. Возможные виды предпринимательской деятельности без государственной регистрации в качестве индивидуального предпринимателя:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- деятельность частного адвоката;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- деятельность телохранителя;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- деятельность нотариуса;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- деятельность юриста.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;На все вышеперечисленные виды деятельности необходимо получить лицензию у государства.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;13.3. К предпринимательской деятельности граждан, осуществляемой без образования юридического лица, соответственно применяются правила настоящего Кодекса, которые регулируют деятельность юридических лиц, являющихся коммерческими организациями, если иное не вытекает из закона, иных правовых актов или существа правоотношения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;13.4. Гражданин, осуществляющий предпринимательскую деятельность без образования юридического лица с нарушением требований пункта 1 настоящей статьи, не вправе ссылаться в отношении заключенных им при этом сделок на то, что он не является предпринимателем. Суд может применить к таким сделкам правила настоящего Кодекса об обязательствах, связанных с осуществлением предпринимательской деятельности.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n');
INSERT INTO `rp_rules` VALUES (3, 'Административный Кодекс', '&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Административный кодекс&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;amp;mdash; кодифицированный нормативный акт, регулирующий общественные отношения по привлечению к административной ответственности, а также устанавливающий общие начала, перечень всех административных правонарушений (может быть дополнен на региональном уровне), органы, рассматривающие дела, порядок привлечения к административной ответственности и порядок исполнения решений по административным делам.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Граждане США (В том числе и жители Сан Андреас) приложили большие усилия для того, чтобы сделать административный процесс открытым, доступным для всех заинтересованных лиц, для широкой общественности, чтобы оградить население от произвола бюрократии. Это делается путем широкого информирования граждан о том, чем администрация занимается, контролем граждан за заведенными на них делами, путем проведения открытых заседаний коллегиальных органов и открытых слушаний в учреждениях судебных дел.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Административные правонарушения отличаются от преступлений (предусмотренных уголовным качеством) своей природой - они не наносят существенного вреда всему обществу и в основе пресекаются финансовыми санкциями.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Примечание 1: Административное правонарушение может быть связано с уголовным или дорожным правонарушением в зависимости от ситуации.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Статья 1. Нанесение лёгких телесных повреждений, не ставящих под угрозу здоровье или жизнь пострадавшего.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;1.1. Нанесение лёгких телесных повреждений, не ставящих под угрозу здоровье или жизнь пострадавшего карается штрафом в размере $900 на каждое участвующее в происшествии лицо.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Статья 2. Нарочная порча чужого имущества (как материального, так и интеллектуального).&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;2.1. Нарочная порча чужого имущества (как материального, так и интеллектуального), сильно не влияющая на финансовое состояние пострадавшего - наказывается штрафом в $950 и полным возмещением ущерба пострадавшему.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Статья 3. Оскорбление.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;3.1. Оскорбление (унижение чести или достоинства другого лица), выраженное в неприличной форме или являющееся открытой критикой без основания - наказывается штрафом в размере $2.000.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Статья 4. Дискриминация.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;4.1. Дискриминация, то есть нарушение прав, свобод и законных интересов человека и гражданина в зависимости от его пола, расы, национальности, языка, происхождения, имущественного и должностного положения, места жительства, отношения к религии, убеждений, принадлежности к общественным объединениям или каким-либо социальным группам, состоянию здоровья, совершенное лицом с использованием своего служебного положения влечет за собой возмещение морального ущерба потерпевшему лицу в размере $3.000.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Статья 5. Предоставление ложной информации от лица свидетеля.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;5.1. Дача ложной информации свидетелем влечет за собой штраф в размере $10.000 и привлечение свидетеля к делу как соучастника. (Последующая отсылка к Уголовному кодексу).&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Статья 6. Ложный вызов сотрудников правоохранительных органов или служб спасения.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;6.1. Ложный вызов сотрудников правоохранительных органов влечет за собой штраф в размере $5.000.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;6.2. Ложный вызов представителей служб спасения карается штрафом в размере $5.000 и компенсацией оказания первой помощи/лечения лиц, пострадавших от ложного вызова.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Статья 7. Ношение масок, пакетов или иных предметов, закрывающих лицо в общественном месте.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;7.1. Ношение масок, пакетов или иных предметов, закрывающих лицо в общественном месте влечет за собой штраф в размере $10.000 и предоставляет право офицеру правоохранительных органов допрашивать и обыскивать подозреваемого без любого другого веского доказательства.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;7.2. Сотрудники правоохранительных органов имеют право задержать лицо, находящееся в маске/пакете или ином предмете закрывающее лицо в общественном месте до выяснения личности лица.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Примечание 1: Сотрудникам штурмовых групп со специальным вооружением разрешается ношение масок во время подготовки/проведения тренировок/специальных операций/чрезвычайной ситуации.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Статья 8. Несанкционированное проведение манифестации.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;8.1. Организация несанкционированной манифестации (если она противоречит конституции), не согласованной с правительством Штата - влечет собой штраф в размере $10.000.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;8.2. Отказ от прекращения манифестации и/или ее продолжение влечет за собой лишение свободы сроком до двух лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Примечание 1: В случае отказа от прекращения несанкционированной манифестации правительство имеет право подавить манифестацию, оказав сопротивление протестующим и использовать для этого специальные средства.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Статья 9. Воспрепятствование законной деятельности должностного лица органа государственного контроля.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;9.1. Воспрепятствование законной деятельности должностного лица органа государственного контроля (инспекции штата/прокуратуры штата), органа государственного финансового контроля - наказывается штрафом в размере $10.000 с каждого участника создания препятствия.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Статья 10. Разглашение сведений.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;10.1. Незаконные получение и разглашение сведений, составляющих коммерческую, налоговую или банковскую тайну влечет за собой штраф от $6.000 до $10.000.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;10.2. Незаконный сбор, хранение, использование и распространение конфиденциальной информации о любом лице без его письменного или устного согласия влечет за собой штраф $10.000, а также возмещение морального ущерба&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;потерпевшему лицу в размере, определяемым последним, но не более $15.000.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Статья 11. Передача либо попытка передачи заключенному под стражу.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;11.1. Передача либо попытка передачи любым способом лицам, содержащимся в учреждениях уголовно-исполнительной системы или изоляторах временного содержания и иных местах содержания под стражей, предметов, веществ или продуктов питания, приобретение, хранение или использование которых запрещено законом влечет за собой штраф в размере $8.000.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Статья 12. Неуважение к суду.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;12.1. Уклонение от явки в суд свидетеля, потерпевшего, истца, ответчика или в неподчинении указанных лиц и других граждан распоряжению председательствующего, либо в нарушении порядка во время судебного заседания, а также совершение кем-либо действий, которые свидетельствуют о явном пренебрежении к суду или установленным в суде правилам влечет за собой штраф в размере $10.000.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Статья 13. Нарушение тишины и покоя.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Совершение действий, нарушающих тишину и покой граждан с 11 p.m. и до 6 a.m. на установленных законодательством штата Сан Андреас, защищаемых территориях и в защищаемых помещениях, а конкретно совершение действий, нарушающих тишину и покой граждан, при проведении различных ремонтных работ, прослушивания громкой музыки, криков и других посторонних шумов, за исключением действий, направленных на предотвращение правонарушений, ликвидацию последствий аварий, стихийных бедствий или иных чрезвычайных ситуаций, проведение неотложных работ, связанных с обеспечением общественной безопасности граждан в соответствии с законодательством штата Сан Андреас, - влечет за собой штраф в размере $4.000.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Статья 14. Курение в общественном месте.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Курение в общественном месте наказывается штрафом в размере $5.000.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Статья 15. Распитие спиртных напитков.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;Распитие спиртных напитков в общественном месте наказывается штрафом в размере $6.000.&amp;lt;/p&amp;gt;\r\n');
INSERT INTO `rp_rules` VALUES (4, 'Уголовный Кодекс ч.1', '&amp;lt;p&amp;gt;Уголовный кодекс &amp;amp;mdash; единый законодательный акт штата Сан Андреас, целиком привязанный к действующей утвержденной Конституции, регулирующий перечень правонарушений, совершенный любым гражданским или приезжим лицом, а так-же определяет объём уголовной ответственности за совершенное уголовное преступление.&amp;lt;br /&amp;gt;\r\nЮридическая сила данного кодекса подтверждается его законным принятием, ссылаясь на действующую конституцию.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Раздел I. Общие цели положений.&amp;lt;br /&amp;gt;\r\nОбщие цели положений, регулирующих определение посягательств, состоят в том, чтобы:&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;a) запретить и предупредить поведение, неоправданно и не извинительно причиняющее существенный вред интересам личности или общества или угрожающее причинением такого вреда;&amp;lt;br /&amp;gt;\r\nb) подвергнуть публичному контролю лиц, поведение которых указывает на их склонность к совершению преступлений;&amp;lt;br /&amp;gt;\r\nc) предотвратить объявление преступным безупречного поведения;&amp;lt;br /&amp;gt;\r\nd) должным образом предупредить о характере поведения, объявленного посягательством;&amp;lt;br /&amp;gt;\r\ne) дифференцировать на разумном основании серьезные и малозначительные посягательства.&amp;lt;br /&amp;gt;\r\nОбщие цели положений, регулирующих вынесение приговоров правонарушителям и воздействие на них, состоят в том, чтобы:&amp;lt;br /&amp;gt;\r\na) предупредить совершение посягательств;&amp;lt;br /&amp;gt;\r\nb) содействовать исправлению и социальному восстановлению личности правонарушителей;&amp;lt;br /&amp;gt;\r\nc) предотвратить назначение правонарушителям чрезмерных, несоразмерных или произвольных наказаний;&amp;lt;br /&amp;gt;\r\nd) должным образом предупредить о характере наказаний, которые могут быть назначены по осуждении за посягательство;&amp;lt;br /&amp;gt;\r\ne) дифференцировать правонарушителей с точки зрения справедливой индивидуализации воздействия на них;&amp;lt;br /&amp;gt;\r\nf) определить, координировать и согласовывать правомочия, обязанности и функции судов и должностных лиц и органов администрации, ответственных за воздействие на правонарушителей;&amp;lt;br /&amp;gt;\r\ng) содействовать применению общепринятых научных методов и знаний при назначении наказаний и воздействии на правонарушителей;&amp;lt;br /&amp;gt;\r\nh) сосредоточить ответственность за функционирование исправительной системы в ведомстве исправительных учреждений штата.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Раздел II. Понятие преступления и покушение на преступление.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 1.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Преступлением признается виновно совершенное общественно опасное деяние (противоправное, осознанное, волевое, действие или бездействие, нарушающее или создавшее реальную угрозу нарушения общественных отношений, охраняемых Уголовным законодательством), запрещенное настоящим Кодексом под угрозой наказания.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 2.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Не является преступлением действие (бездействие), хотя формально и содержащее признаки преступления, но в силу малозначительности не представляющее общественной опасности.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 3.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Совокупностью преступлений признается совершение двух или более преступлений. При совокупности преступлений лицо несет уголовную ответственность за каждое совершенное преступление по соответствующей статье или части статьи настоящего Кодекса.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 4.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Покушением на преступление признаются умышленные действия (бездействие) лица, непосредственно направленные на совершение преступления, если при этом преступление не было доведено до конца по не зависящим от этого лица обстоятельствам.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 5.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Никакое поведение не составляет посягательства, если оно не является преступлением или нарушением по настоящему кодексу или иному статуту этого штата.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Раздел III. Основные определения.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;1) &amp;amp;laquo;житель штата&amp;amp;raquo; означает лицо, родившееся и живущее в штате, или приезжее лицо, как физическое, так и юридическое, без разделения на признаки.&amp;lt;br /&amp;gt;\r\n2) &amp;amp;laquo;телесное повреждение&amp;amp;raquo; означает физическую боль, болезнь или любое ухудшение физического состояния;&amp;lt;br /&amp;gt;\r\n3) &amp;amp;laquo;тяжкое телесное повреждение&amp;amp;raquo; означает телесное повреждение, создающее значительный риск наступления смерти или причиняющее тяжкое, постоянное уродство или длительную утрату или ухудшение функции какой-либо части или какого-либо органа тела;&amp;lt;br /&amp;gt;\r\n4) &amp;amp;laquo;смертоносное оружие&amp;amp;raquo; означает любое огнестрельное или иное оружие, приспособление, орудие, материал или вещество, одушевленное или неодушевленное, которые по способу их фактического или предполагаемого применения заведомо способны причинить смерть или тяжкое телесное повреждение.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Раздел IV. Основные юридические понятия и термины.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 1. Основная задача уголовного кодекса.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Уголовный кодекс штата Сан Андреас имеет основную задачу - обеспечение прав и свобод граждан, их материальной и нематериальной собственности и в целом - общественной безопасности путем создания рамок нормативного поведения.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 2. Принцип законности.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Факт преступности того или иного деяния и наказание, предназначенное за него, так-же как и последствие соответствующих деяний - определяется только настоящим кодексом (и косвенно - Конституцией штата, если кодекс не распространяется на аморальное поведение вне установленных рамок).&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 3. Принцип равенства граждан перед законом.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Лица, совершившие преступления, равны перед законом и подлежат уголовной ответственности вне зависимости от пола, расы, национальности, языка, происхождения, имущественного и должностного положения, места жительства, отношения к к религии, убеждений, принадлежности к общественным объединениям, а также других обстоятельств.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 4. Принцип справедливости.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Наказание и иные меры уголовно-правового характера, применяемые к лицу, совершившему преступление, должны быть справедливыми, то есть обязаны соответствовать характеру и степени общественной опасности преступления, обстоятельствам его совершения и личности виновного. (Вопрос личности не исключает закон о равенстве).&amp;lt;br /&amp;gt;\r\n-Ни один гражданин/приезжий не имеет право быть задержан дважды за одно преступление до подтверждения факта преступления. (Данная трактовка не относится к повторному совершению преступления лицом, а лишь описывает единичное нарушение).&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 5. Принцип гуманизма.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Наказание и иные меры уголовно-правового характера, применяемые к лицу, совершившему преступление, не могут иметь своей целью причинение физических страданий или унижение человеческого достоинства. Физические увечья обвиняемому лицу могут наноситься в крайнем случае только в момент активного открытого сопротивления и по возможности должны избегаться.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 6. Основание уголовной ответственности.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Основанием уголовной ответственности является совершения деяния, содержащего все признаки состава преступления, предусмотренного настоящим кодексом.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 7. Уровни тяжести преступлений.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Преступления по уровню тяжести делятся на 4 основных уровня:&amp;lt;br /&amp;gt;\r\n1) Преступления легкой тяжести (до 10 лет лишения свободы);&amp;lt;br /&amp;gt;\r\n2) Преступления средней тяжести (до 30 лет лишения свободы);&amp;lt;br /&amp;gt;\r\n3) Тяжкие преступления (до 40 лет лишения свободы);&amp;lt;br /&amp;gt;\r\n4) Особо тяжкие преступления (до 50 лет лишения свободы).&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 8. Возраст наступления уголовной ответственности.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Возраст, с которого в соответствии с уголовным кодексом может наступить уголовная ответственность - 18 лет. Лица младше 18 лет могут привлекаться только к административным правонарушениям.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 9. Понятие соучастия.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Соучастием в преступлении является умышленное совместное участие двух или более лиц в совершении умышленного преступления. Соучастием также являются ситуации, не предполагающие физического присутствия. (К примеру - передача запрещенной информации, передача ложной информации силовым органам и пр.)&amp;lt;br /&amp;gt;\r\n-Лицу, являющимся соучастниками (подельниками) вменяется такое же обвинение, как и остальным лицам, задействованным в совершении преступления.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 10. Необходимая оборона.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Самооборона или самозащита - ответные действия лица, предпринимаемые для обеспечения гражданских прав, нарушенных посягательством другого лица. Необходимой обороной считаются действия, направленные на пресечение противоправных действий иных лиц. Ни одно действие не может быть принято как необходимая оборона, если оно намеренно было сокрыто от представителей исполнительной власти штата лицом, его совершившим. Также нарушителя правопорядка не оправдывают ответные оборонительные действия, производимые до, после или во время совершаемого преступления любой тяжести.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 11. Во исполнение незаконных приказов или распоряжения.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Не является преступлением лицом, действующим во исполнение приказов и решений, обязательных к выполнению. Уголовную ответственность за причинение такого вреда несет лицо, отдавшее незаконный приказ или распоряжение.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 12. Виды наказаний.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-К лицам, признанным виновными в совершении преступления - следствием могут быть применены следующие виды наказаний:&amp;lt;br /&amp;gt;\r\n1) Освобождение от занимаемой должности;&amp;lt;br /&amp;gt;\r\n2) Лишение права занимать определенные должности;&amp;lt;br /&amp;gt;\r\n3) Исправительные работы;&amp;lt;br /&amp;gt;\r\n4) Конфискация имущества;&amp;lt;br /&amp;gt;\r\n5) Арест или лишение свободы;&amp;lt;br /&amp;gt;\r\n6) Штраф;&amp;lt;br /&amp;gt;\r\n7) Изъятие лицензий в связи с наказанием. (Пропорционально наказанию)&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 13. Чистосердечное признание.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Лицо (как физическое, так и юридическое), совершившее преступление легкой тяжести либо по неосторожности - в случае, если оно признаёт свою вину, понимает содеянное и документально подтверждает мотивы совершенного им преступления со всеми подробностями - получает право на смягчение меры пресечения (только в случае, если предоставленная лицом информация достоверна и полезна).&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 14. Освобождение под залог.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Лицо, совершившее преступление легкой тяжести, может в качестве меры пресечения избрать освобождение под залог денежных средств в размере $5.000 за каждый год присвоенного ареста. Будучи освобожденным под залог - лицо, совершившее преступление, должно выдержать назначенный срок без повторного нарушения. В обратном случае изначальный срок подозреваемому будет изменен.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 15. Защита.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Любое физическое или юридическое лицо имеет право на юридическую защиту своих прав в ходе следствия. В случае, если лицо, обвиняемое в преступлении, не может самостоятельно обеспечить защиту своих прав - оно имеет право на вызов адвоката и свидетелей. Если же лицо не может оплатить услуги частного адвоката - правительство предоставляет ему государственного адвоката.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 16. Ознакомление с материалами дела.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Лицо, как и выбранный данным лицом/предоставленный правительством адвокат имеют право получить доступ к материалам дел, в которых фигурируют как обвиняемый или потерпевший.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 17. Презумпция невиновности.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Обвиняемый считается невиновным, пока его виновность в совершении преступления не доказана.&amp;lt;br /&amp;gt;\r\n-Обвиняемый не должен доказывать свою невиновность. Бремя предоставления информации о виновности лица ложится на обвинителя.&amp;lt;br /&amp;gt;\r\n-Все сомнения в виновности обвиняемого, которые не могут быть устранены в соответствии с кодексом или активной конституцией - толкуются в пользу обвиняемого.&amp;lt;br /&amp;gt;\r\n-Обвинительный приговор не должен быть основан на предположениях.&amp;lt;br /&amp;gt;\r\n-Имеющий достаточное количество доказательств обвинитель имеет право задерживать подозреваемого, оповещая о совершенном преступлении, но обязан предоставить материалы в соответствии с пунктом 15 сразу после перемещения подозреваемого в место временного содержания.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 18. Контрабанда.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Контрабанда &amp;amp;ndash; это предмет запрещенный в ввозу/вывозу в/из Штата и массовому распространению на территории штата без необходимых зарегистрированных документах на данный предмет.&amp;lt;br /&amp;gt;\r\nК контрабанде относятся следующие виды предметов: оружие, патроны, антиквариат, химикаты, контрафактные товары, медикаменты, алкоголь, табак, трофеи браконьеров, ювелирные украшения, запрещенные наркотические вещества.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 19. Экстремистская деятельность.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;-Экстремистская деятельность &amp;amp;ndash; это приверженность к крайним мерам и взглядам, радикально отрицающим существующие в обществе нормы и правила через совокупность насильственных проявлений, совершаемых отдельными лицами и специально организованными группами и сообществами. Среди таких проявлений можно отметить провокацию беспорядков, гражданское неповиновение, террористические акции, методы партизанской войны.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Раздел V. Обстоятельства смягчающие и отягчающие наказание.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 1. Смягчающими обстоятельствами признаются:&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;a) совершение впервые преступления лёгкой или средней тяжести вследствие случайного стечения обстоятельств;&amp;lt;br /&amp;gt;\r\nb) совершение преступления в силу стечения тяжелых жизненных обстоятельств, либо по мотиву сострадания;&amp;lt;br /&amp;gt;\r\nc) совершение преступления в результате физического или психического принуждения, либо в силу материальной, служебной или иной зависимости;&amp;lt;br /&amp;gt;\r\nd) совершение преступления при нарушении условий правомерности необходимой обороны, задержания лица, совершившего преступление, крайней необходимости, обоснованного риска, исполнения приказа или распоряжения;&amp;lt;br /&amp;gt;\r\ne) противоправность или аморальность поведения потерпевшего, явившегося поводом для преступления;&amp;lt;br /&amp;gt;\r\nf) явка с повинной, активное способствование раскрытию и расследованию преступления, изобличению и уголовному преследованию других соучастников преступления, розыску имущества, добытого в результате преступления;&amp;lt;br /&amp;gt;\r\ng) оказание медицинской и иной помощи потерпевшему непосредственно после совершения преступления, добровольное возмещение имущественного ущерба и морального вреда, причиненных в результате преступления, иные действия, направленные на заглаживание вреда, причиненного потерпевшему.&amp;lt;br /&amp;gt;\r\n1.1. При назначении наказания могут учитываться в качестве смягчающих и обстоятельства, не предусмотренные частью первой настоящей статьи.&amp;lt;br /&amp;gt;\r\n1.2. Особенной части настоящего Кодекса, в качестве признака преступления, оно само по себе не может повторно учитываться при назначении наказания.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 2. Отягчающими обстоятельствами признаются:&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;a) рецидив преступлений;&amp;lt;br /&amp;gt;\r\nb) наступление тяжких последствий в результате совершения преступления;&amp;lt;br /&amp;gt;\r\nc) совершение преступления в составе группы лиц, группы лиц по предварительному сговору, организованной группы или преступного сообщества (преступной организации);&amp;lt;br /&amp;gt;\r\nd) особо активная роль в совершении преступления;&amp;lt;br /&amp;gt;\r\ne) совершение преступления по мотивам политической, идеологической, расовой, национальной или религиозной ненависти или вражды, либо по мотивам ненависти или вражды в отношении какой-либо социальной группы;&amp;lt;br /&amp;gt;\r\ne) совершение преступления из мести за правомерные действия других лиц, а также с целью скрыть другое преступление или облегчить его совершение;&amp;lt;br /&amp;gt;\r\nf) совершение преступления в отношении лица или его близких в связи с осуществлением данным лицом служебной деятельности или выполнением общественного долга;&amp;lt;br /&amp;gt;\r\ng) совершение преступления с особой жестокостью, садизмом, издевательством, а также мучениями для потерпевшего;&amp;lt;br /&amp;gt;\r\nh) совершение преступления с использованием оружия, боевых припасов, взрывчатых веществ, взрывных или имитирующих их устройств, специально изготовленных технических средств, наркотических средств, психотропных, сильнодействующих, ядовитых и радиоактивных веществ, лекарственных и иных химико-фармакологических препаратов, а также с применением физического или психического принуждения;&amp;lt;br /&amp;gt;\r\ni) совершение преступления в условиях чрезвычайного положения, стихийного или иного общественного бедствия, а также при массовых беспорядках, в условиях вооруженного конфликта или военных действий;&amp;lt;br /&amp;gt;\r\nj) совершение преступления с использованием доверия, оказанного виновному в силу его служебного положения или договора;&amp;lt;br /&amp;gt;\r\nk) совершение преступления с использованием форменной одежды или документов представителя власти;&amp;lt;br /&amp;gt;\r\nl) совершение умышленного преступления сотрудником силовых структур&amp;lt;br /&amp;gt;\r\nm) совершение преступления в целях пропаганды, оправдания и поддержки терроризма.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n2.1. Судья (суд), назначающий наказание, в зависимости от характера и степени общественной опасности преступления, обстоятельств его совершения и личности виновного может признать отягчающим обстоятельством совершение преступления в состоянии опьянения, вызванном употреблением алкоголя, наркотических средств, психотропных веществ или их аналогов, новых потенциально опасных психоактивных веществ либо других одурманивающих веществ.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Раздел VI. Преступления легкой тяжести.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 1. Уход с места дорожно-транспортного происшествия.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;1.1. Уход с места совершения дорожно-транспортного происшествия любого из участников происшествия наказывается лишением свободы сроком на 1 год и штрафом в $500.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 2. Хулиганство.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;2.1. Хулиганство, а именно - грубое нарушение общественного порядка, выражающее неуважение к обществу в любых проявлениях (включает в себя использование нецензурной лексики, вандализм по отношению к государственной или частной собственности в малых размерах, открыто негативное отношение по мотивам политической, идеологической, расовой, религиозной или национальной принадлежности). Наказывается сроком лишения свободы до 2 лет и возмещением ущерба в случае вандализма.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 3. Неуплата штрафа.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;3.1. Неуплата штрафа за нарушение уголовного/административного/дорожного кодекса за установленный представителем правопорядка срок (базовый срок - 1 неделя) - влечет за собой лишение свободы сроком до 2 лет и штраф в двойном размере от неуплаченной суммы.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 4. Неповиновение сотруднику правоохранительных органов при исполнении обязанностей.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;4.1. Оказание гражданином сопротивления сотруднику правоохранительных органов и/или игнорирование его законных требований влечет за собой лишение свободы сроком до 2 лет.&amp;lt;br /&amp;gt;\r\n4.2. Префикс - не распространяется на требование, противоречащее действующей конституции и/или законодательству.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 5. Клевета.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;5.1. Клевета на гражданина Сан Андреас и любое находящееся в штате (в том числе на временное проживание) лицо - наказывается лишением свободы сроком в 1 год.&amp;lt;br /&amp;gt;\r\n5.2. Клевета, создающая негативное отношение народа Сан Андреас к государственной организации или представляющему её лицу - карается лишением свободы сроком до 2 лет и обязательным публичным опровержением ложной информации.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 6. Попытка скрыться.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;6.1. Попытка скрыться от другого гражданского лица (при этом нарушив закон по отношению к данному лицу, исключая дорожно-транспортные происшествия), карается лишением свободы сроком до 3 лет.&amp;lt;br /&amp;gt;\r\n6.2. Попытка скрыться от правоохранительных органов во время/после совершения преступления карается лишением свободы сроком до 4 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 7. Помеха в задержании.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;7.1. Помеха в задержании подозреваемого/преступника представителем правоохранительных органов влечет за собой лишение свободы сроком до 4 лет. (Считается соучастием в совершении преступления при достаточных основаниях и прикрепляет к делу лицо, создавшее помеху).&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 8. Организация занятия проституцией, занятие проституцией.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;8.1. Половое сношение с иным лицом с целью получения материальной выгоды карается лишением свободы сроком до 1 года.&amp;lt;br /&amp;gt;\r\n8.2. Вовлечение лица/лиц в занятие проституцией (на платной основе) или принуждение к занятию проституцией с использованием обмана, шантажа или уязвимого состояния привлекаемого лица, с применением или угрозой применения насилия - предполагает лишение свободы сроком до 3 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 9. Угроза убийством или причинением тяжкого вреда здоровью.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;9.1. Угроза убийством или причинением тяжкого вреда здоровью при наличии реальных оснований опасаться исполнения данной угрозы карается лишением свободы сроком от 3 до 8 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 10. Умышленное нанесение телесных повреждений легкой тяжести.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;10.1. Причинение телесных повреждений, не ставящими жизнь пострадавшего в опасность - наказываются лишением свободы до 3 лет и полным возмещением расходов на лечение обвиняемого.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 11. Употребление запрещенных наркотических веществ.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;11.1. Употребление запрещенных наркотических веществ и/или нахождение в состоянии наркотического опьянения влечет за собой заключение под стражу сроком до 3 лет с изъятием соответствующих наркотических средств.&amp;lt;br /&amp;gt;\r\nПримечание 1: Запрещенными наркотическими средствами являются: LSD, DMT, Кетамин, Кокаин, Ксанекс, Мефедрон, Амфетамин.&amp;lt;br /&amp;gt;\r\nПримечание 2: Лечебная марихуана не является запрещенным наркотическим средством, однако для её употребления необходим рецепт. В ином случае её использование приравнивается к употреблению наркотических веществ.&amp;lt;br /&amp;gt;\r\nПримечание 3: Лечебная марихуана в наличии обвиняемого (даже при наличии лицензии) в объеме более 50 грамм также считается нелегальной.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 12. Кража.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;12.1. Присвоение или попытка незаконного присвоения чужого имущества (как материального, так и интеллектуального) наказывается лишением свободы сроком до 3 лет и возмещением ущерба пострадавшему.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 13. Незаконное предпринимательство.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;13.1. Осуществление предпринимательской деятельности без регистрации и наличия лицензии, в случаях, когда лицензия обязательна (если это деяние причинило вред гражданам, лицензированным предприятием или государству в целом) - наказывается лишением свободы сроком до 2 лет и штрафом от $10.000 до $25.000 в зависимости от нанесенного ущерба.&amp;lt;br /&amp;gt;\r\n13.2. Незаконная организация азартных игр (игорного бизнеса), равно как их проведение и (или) участие в деятельности такой организации наказывается лишением свободы сроком от 2 до 5 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 14. Монополия.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;14.1. Недопущение, ограничение или устранение конкуренции путем установления или поддержания монопольно высоких или монопольно низких цен, раздела рынка, ограничения доступа на рынок, устранения с него других субъектов экономической деятельности, установления или поддержания единых цен наказывается лишением свободы сроком от 2 до 4 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 15. Разглашение сведений.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;15.1. Умышленное или непредумышленное разглашение сведений, составляющих государственную тайну, лицом, которому она была доверена или стала известна по службе, работе, учебе или в иных случаях наказывается лишением свободы сроком от 8 до 10 лет, а также возмещением морального ущерба в зависимости от значимости разглашенной информации.&amp;lt;br /&amp;gt;\r\nПримечание 1: Максимальная сумма за моральный ущерб - $20.000.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 16. Преднамеренное банкротство.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;16.1. Совершение управленческим составом юридического лица действий (бездействия), влекущих к потере платежеспособности юридического лица и невозможности производить расчеты по долгам наказывается лишением свободы сроком от 2 до 5 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 17. Уклонения от налогов.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;17.1. Уклонение от уплаты налогов путем предоставления заведомо ложной информации и (или) отчетности соответствующему контрольному органу исполнительной власти, равно как уклонение от уплаты налогов путем бездействия - наказывается лишением свободы сроком от 4 до 10 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 18. Провокация.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;18.1. Умышленная провокация лица на совершение противозаконных действий или неправомерных деяний, а также вызов у лица агрессии - наказывается сроком лишения свободы до 3 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 19. Браконьерство.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;19.1. Браконьерство, а именно - охота и/или рыбалка, совершаемая в месте, не предназначенном для данных действий (место, обозначенное государственным запретом любой степени) - наказывается штрафом в размере $15.000 и лишением свободы сроком до 3 лет, а также обязательным изъятием всего добытого улова/туши.&amp;lt;br /&amp;gt;\r\n19.2. Охота и/или рыбалка, совершаемая без соответствующей лицензии - наказывается штрафом в $10.000 и лишением свободы сроком до 2 лет и обязательным изъятием всего добытого улова/туши.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 20. Жестокое обращение с животными.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;20.1. Жестокое обращение с животными с целью причинения им боли, а равно из хулиганских или корыстных побуждений, повлекшее его гибель или увечье - наказывается лишением свободы сроком до 3 лет.&amp;lt;br /&amp;gt;\r\n20.2. Жестокое обращение с животными с применением садистских методов, публичной демонстрацией, публикацией в С.М.И. - наказывается лишением свободы сроком до 4 лет.&amp;lt;br /&amp;gt;\r\nПримечание 1: Разделка туши животного для принятия в пищу/готовки не является жестоким обращением и считается природной необходимостью.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 21. Отказ предоставлять помощь пострадавшему.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;21.1. Заведомый отказ предоставлять помощь пострадавшему находящемуся в опасном для жизни состоянии или имеющим тяжелое физическое повреждение (в случае, если лицо не имеет возможности самостоятельно предпринять действия к самосохранению по причине старости, болезни, беспомощности/бессилия) - наказывается лишением свободы сроком до 2 лет.&amp;lt;br /&amp;gt;\r\nПримечание 1: Под отказ предоставлять помощь пострадавшему не заносится ситуация, в которой лицо, совершившее данное деяние, некомпетентно оказать помощь пострадавшему или не может сделать это в виду физических увечий или фобий.&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n');
INSERT INTO `rp_rules` VALUES (5, 'Уголовный Кодекс ч.2', '&amp;lt;p&amp;gt;Раздел VII. Преступления средней тяжести.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 22. Мошенничество.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;22.1. Завладение денежными средствами, чужим имуществом или приобретение права на имущество (как материальное, так и интеллектуальное) или злоупотребление доверием лица - наказывается лишением свободы сроком на 10 лет и возмещением ущерба пострадавшему.&amp;lt;br /&amp;gt;\r\n22.2. Во время процесса торговли с лицом предоставить заведомо ложную информацию о продукте/услуге, влекущее за собой дополнительные расходы со стороны покупателя - наказывается лишением свободы сроком на 8 лет и возмещением ущерба пострадавшему от мошенничества в полном размере.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 23. Неправомерное завладение транспортным средством.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;23.1. Неправомерное завладение личным, коммерческим или арендованным транспортом карается лишением свободы сроком на 15 лет и возмещением ущерба (потраченное топливо, затраты на ремонт).&amp;lt;br /&amp;gt;\r\n23.2. Неправомерное завладение воздушным транспортным средством наказывается лишением свободы сроком на 20 лет и возмещением ущерба. (Потраченное топливо, затраты на ремонт).&amp;lt;br /&amp;gt;\r\n23.3. Неправомерное завладение служебным транспортным средством (как воздушным, так водным и наземным) карается лишением свободы сроком от 20 до 30 лет.&amp;lt;br /&amp;gt;\r\nПримечание 1: Служебным транспортом считается транспорт: F.I.B.,U.S.M.C., S.A.P.D., S.A.S.D., S.D.P.A., E.M.S., LifeInvader Правительства.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 24. Хищение.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;24.1. Попытка тайного, незаконного присвоения чужого материального или интеллектуального имущества в средних или крупных объемах (без применения холодного или огнестрельного оружия / военной техники для воздействия на владельца собственности) - карается лишением свободы сроком на 25 лет и возмещением ущерба пострадавшему в полной мере.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 25. Разбой.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;25.1. Вооруженное нападение (с использованием как холодного, так и огнестрельного оружия / военной техники) с целью завладения чужим имуществом (грабежа) соединенное с насилием, опасным для жизни или здоровья лица, подвергшегося нападению (также и с угрозой насилия/расправы) - наказывается сроком лишения свободы на 30 лет и полным возмещением ущерба пострадавшему (в том числе медицинские расходы, если таковые имеются).&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 26. Проникновение.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;26.1. Проникновение на государственную или другую охраняемую территорию (территория вооруженных сил США, Федеральная тюрьма, Полицейские департаменты, Федеральное Бюро Расследований, Здания Правительства, Шерифские Департаменты, тренировочная база силовых структур, National Office of Security Enforcement, Merryweather Security Consulting, Fort Zancudo, USS Luxington (ATT-16)) наказывается лишением свободы сроком от 25 до 30 лет.&amp;lt;br /&amp;gt;\r\n26.2. Проникновение на подконтрольную территорию частного или юридического лица против воли владеющего/проживающего в ней лица наказывается лишением свободы сроком до 10 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 27. Изнасилование и сексуальное домогательство.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;27.1. Изнасилование, то есть действия, направленные на половое сношение с применением физического насилия, угрозы его применения или пользуясь беспомощным состоянием лица - лишение свободы сроком на 30 лет.&amp;lt;br /&amp;gt;\r\n27.2 Сексуальное домогательство - запугивание, издевательство или принуждение сексуального характера, также нежелательное или ненадлежащее обещание вознаграждения в обмен на сексуальные услуги, иные устные или физические (объятия, прикосновения, нападение с целью изнасилования) преследования сексуального характера - лишение свободы сроком от 5 до 15 лет.&amp;lt;br /&amp;gt;\r\nПримечание 1: Не запрещено простое поддразнивание, пренебрежительные комментарии или незначительные инциденты во время беседы до первого замечания со стороны потерпевшего.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 28. Принуждение.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;28.1. Принуждение к совершению деяния или к отказу от его совершения под угрозой применения физического насилия, уничтожения или повреждения имущества, распространения частной информации, которые могут причинить вред потерпевшему или его близким, при отсутствии признаков вымогательства - карается заключением под стражу сроком на 25 лет.&amp;lt;br /&amp;gt;\r\n28.2. Принуждение с целью сподвигнуть лицо на дачу ложных показаний или передача взятки для дачи ложных показаний - наказывается штрафом в размере $50.000 и лишением свободы сроком на 30 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 29. Дача взятки/подкуп.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;29.1. Предложение, предоставление или передача лицу взятки (денежных средств или иного материального блага, как легально, так и нелегально полученных) в любом виде - наказывается штрафом в размере $50.000 и лишением свободы сроком на 25 лет.&amp;lt;br /&amp;gt;\r\nПримечание 1: Передачей взятки считается как наличный, так и безналичный расчет, дарственная собственности/имущества из корыстных побуждений.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\nРаздел VIII. Тяжкие и особо тяжкие преступления.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 30. Умышленное нанесение тяжких телесных повреждений.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;30.1. Умышленное причинение телесных повреждений, являющихся опасными для жизни или здоровья лица - наказывается лишением свободы сроком от 30 до 45 лет и полным возмещением медицинских издержек по отношению к пострадавшему.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 31. Незаконное лишение свободы или похищение человека.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;31.1. Незаконное лишение свободы (задержание без обстоятельства или не взяв во внимание презумпцию невиновности, насильственное удержание после обозначенного срока), а также похищение - наказываются лишением свободы сроком на 40 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 32. Получение взятки.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;32.1. Получение лицом, проживающим в штате (как должностным лицом правительственной организации, так и частным/юридическим лицом, способным за полученную взятку совершить нелегальные или аморальные действия) взятки в виде денежной суммы (как наличным, так и безналичным расчетом), также как и любой другой материальной ценности - карается штрафом в $50.000, возмещением ущерба пострадавшей стороне, лишением свободы сроком на 40 лет и запретом на занятие определенных должностей в исполнительном аппарате (включая подконтрольные правительству организации).&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 33. Пытка.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;33.1. Нанесения сильных телесных повреждений лицу (или попытка воздействовать на него морально) с целью получения средств или информации, или из удовольствия - наказывается лишением свободы сроком от 35 до 45 лет, а также оценкой психического состояния лица и его возможности оставаться в обществе.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 34. Покупка, продажа, фальсификация и распространение фиктивных бюллетеней.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;34.1. Покупка, продажа, фальсификация и распространение неофициальных бюллетеней - наказывается лишением свободы сроком на 40 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 35. Подделка и/или использование документов, печатей, штампов или ценных бумаг.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;35.1. Изготовление в целях сбыта или сбыт поддельных денег банка США, металлической монеты, государственных ценных бумаг или других ценных бумаг в валюте США, либо иностранной валюты или ценных бумаг в иностранной валюте - наказывается штрафом в размере $30.000, возмещением финансового ущерба правительству и лишением свободы сроком на 40 лет.&amp;lt;br /&amp;gt;\r\n35.2. Использование официальных государственных документов (добытых только нелегальным путем), таких как офицерские жетоны, удостоверения, коды доступа и пр. - карается изъятием данных документов и сроком заключения на 35 лет.&amp;lt;br /&amp;gt;\r\n35.3. Создание поддельной документации и/или использование её для корыстных целей карается изъятием данной документации, штрафом в $10.000 и заключением под стражу сроком на 40 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 36. Нарушение воздушного пространства.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;36.1. Управление воздушными транспортными средствами ниже 1.050 футов (316 метров (высота Maze Bank Tower)), а также посадка и высадка пассажиров в местах, не предназначенных для этого (искл.: вертолеты F.I.B., Правительства, U.S.M.C., S.A.P.D., S.A.S.D., S.D.P.A.), - наказывается лишением свободы сроком от 30 до 45 лет и лишением права последующего управления воздушным транспортом.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 37. Создание преступного сообщества или участие в его действии.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;37.1. Создание организованного сообщества/группировки/синдиката с целью совершения преступления, а также руководство такой организацией - наказывается лишением свободы сроком на 30 лет.&amp;lt;br /&amp;gt;\r\n37.2. Участие в деятельности преступной организации - наказывается лишением свободы сроком на 25 лет.&amp;lt;br /&amp;gt;\r\n37.3. Соучастие в действии преступной организации (без прямого участия в преступном процессе), предполагающее передачу информации преступной организации или снабжение её наказывается лишением свободы сроком на 20 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья. 38. Перевозка/хранение/приём/использование/сбыт/дарственная передача/передача/приобретение контрабанды.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;38.1. Перевозка/хранение контрабанды наказывается лишением свободы группы лиц/лица, находящихся на месте преступления, на срок от 20 до 30 лет с предварительным изъятием контрабанды.&amp;lt;br /&amp;gt;\r\n38.2. Приём контрабанды наказывается лишением свободы группы лиц/лица, совершивших оплату/обмен товара на контрабанду, на срок от 20 до 35 лет.&amp;lt;br /&amp;gt;\r\n38.3. Использование контрабанды наказывается лишением свободы группы лиц/лица, использующих/использующего контрабанды, на срок от 30 до 50 лет с предварительным изъятием контрабанды.&amp;lt;br /&amp;gt;\r\n38.4. Сбыт/дарственная передача контрабанды наказывается лишением свободы группы лиц/лица, продающего/передающего запрещённые вещества/контрабандное оружие, на срок от 25 до 30 лет с предварительным изъятием контрабанды.&amp;lt;br /&amp;gt;\r\n38.5. Приобретение контрабанды наказывается лишением свободы группы лиц/лица, производившего покупку/попытку покупки запрещённых веществ/контрабандного оружия, на срок от 10 до 20 лет с предварительным изъятием контрабанды.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 39. Использование крупнокалиберного и автоматического оружия.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;39.1. Использование крупнокалиберного и автоматического оружия непрерывного огня в Лос Сантосе влечет за собой лишение свободы сроком на 25 лет и обязательное изъятие всего оружия.&amp;lt;br /&amp;gt;\r\nПримечание 1: Крупнокалиберным оружием считается оружие, которое использует патроны 5.56мм калибра или выше.&amp;lt;br /&amp;gt;\r\nПримечание 2: К крупнокалиберному оружию также относится оружие, которое использует боеприпасы типа картечь и дробь.&amp;lt;br /&amp;gt;\r\nПримечание 3: Автоматическим оружием непрерывного огня считается оружие, в котором все операции по перезаряжанию выполняются автоматически за счёт энергии пороховых газов, которая выделилась при выстреле и способное к непрерывной стрельбе очередями без повторных нажатий на спусковой крючок.&amp;lt;br /&amp;gt;\r\nПримечание 4: Правоохранительным органам разрешается использование крупнокалиберного и автоматического оружия непрерывного огня в Лос Сантосе в критических ситуациях.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 40. Хранение/ношение оружия без лицензии.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;40.1. Хранение/ношение оружия без лицензии на оружие влечет за собой лишение свободы сроком на 25 лет и обязательное изъятие всего оружия.&amp;lt;br /&amp;gt;\r\n40.2. Открытое ношение оружие с лицензией влечет за собой лишение свободы сроком на 15 лет и обязательное изъятие всего оружия.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 41. Хранение/ношение/транспортировка нелегального или незаконно приобретенного/ввезенного оружия и спецсредств, их составляющих и боеприпасов.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;41.1. Хранение/ношение/транспортировка нелегального или незаконно приобретенного/ввезенного оружия и спецсредств, их составляющих и боеприпасов влечет за собой лишение свободы сроком от 10 до 30 лет лишения свободы (Оружие F.I.B., Правительства, S.A.P.D., S.A.S.D., S.D.P.A., U.S.M.C.).&amp;lt;br /&amp;gt;\r\nПримечание 1: Нелегальным оружием считается оружие, которое не находится в продаже в магазинах оружия.&amp;lt;br /&amp;gt;\r\nПримечание 2: К спецсредствам относятся: электрошокер, наручники.&amp;lt;br /&amp;gt;\r\nПримечание 3: Допускается ношение, применение, транспортировка оружия и спецсредств из арсенала государственных организаций только самими представителями организаций.&amp;lt;br /&amp;gt;\r\nПримечание 4: Сотрудниками специальных подразделений силовых структур (Tactical Division S.A.P.D./S.A.S.D. и Special Force U.S.M.C.) допускается ношение нелегального оружия, а также его применение в случае нахождения при исполнении.&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nПримечание 5: Задержанный во время совершения преступления при хранении любого вида огнестрельного оружия, спецсредств или взрывчатки - лишается прав на ношение оружия и соответствующей лицензии. Лицо имеет право повторно получить лицензию на оружие два месяца после окончания срока задержания.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 42. Сбыт/передача/приобретение/дарственный/использование/приём огнестрельного оружия, взрывчатки и спецсредств, их составляющих и боеприпасов.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;42.1. Сбыт/передача/приобретение/дарственный приём огнестрельного оружия и спецсредств, их составляющих и боеприпасов (вне территории магазина, обходя кассовые аппараты или нелегально) наказывается лишением свободы сроком на 30 лет.&amp;lt;br /&amp;gt;\r\n42.2 Использование любого вида оружия, взрывчатки или спецсредств, выявленное в ситуации нарушения правопорядка и/или относящееся к нему - предполагает изъятие всего оружия/боеприпасов/взрывчатки и спецсредств и лишение соответствующей лицензии.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 43. Убийство, доведение до самоубийства.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;43.1. Убийство или покушение на убийство любого проживающего в штате лица - карается лишением свободы сроком от 30 до 50 лет.&amp;lt;br /&amp;gt;\r\n43.2. Доведение лица до самоубийства или до попытки самоубийства путем угроз, запугивания, морального давления, внушения, жестокого обращения и физического насилия, систематического унижения человеческого достоинства потерпевшего или другими способами - карается лишением свободы сроком от 40 до 50 лет и санкциями, выплачиваемыми семье пострадавшего в размере $10.000.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 44. Террористический акт.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;44.1. Совершение взрыва, поджога или любых других действий, устрашающих население и создающих угрозу жизни или здоровью лиц, проживающих в штате, наносящих значимый ущерб имуществу (как государственному, так и имуществу частных и юридических лиц, природным ресурсам) или создающих явные негативные последствия для благосостояния штата ( а также угроза совершения таких действий) наказывается лишением свободы сроком в 50 лет и возмещением ущерба, причиненного лицу или государству.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 45. Захват заложников.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;45.1. Захват или удержание лица или группы лиц в качестве заложников в целях принуждения государственного или любого учреждения, а также родственников или близких лиц заложников на совершение или отказ от совершения конкретного действия (в том числе из финансовых мотивов) наказывается лишением свободы сроком от 45 до 50 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 46. Экстремистская деятельность.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;46.1. Публичные призывы к осуществлению экстремистской деятельности -&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;наказываются лишением свободы до 30 лет, запретом занимать определенные государственные должности или заниматься государственной деятельностью.&amp;lt;br /&amp;gt;\r\n46.2. Те же деяния, совершенные с использованием средств массовой информации либо информационно-телекоммуникационных сетей, в том числе сети &amp;amp;quot;Интернет&amp;amp;quot;, наказываются лишением свободы до 30 лет с лишением права занимать государственные должности или заниматься государственной деятельностью на срок до 1 года.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Раздел IX. Госслужащие&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 47. Злоупотребление служебным положением.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;47.1. Умышленное (из корыстных побуждений либо в личных интересах) использование служебного положения должностным лицом (в том числе во время несения службы) вопреки интересам службы (вне зависимости от объема нанесенного государству или лицу вреда) наказывается отстранением от занимаемой должности с последующим запретом на занятие должностей в гос. структурах, возмещением ущерба штату или лицу, и заключением под стражу сроком на 50 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 48. Наличие бизнеса.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;48.1. Заместителю мэра, Мэру, Вице-Губернатору, Губернатору запрещено иметь бизнес, исключением может быть офис для фонда или партии, - наказывается лишением свободы сроком на 30 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 49. За рубежом.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;49.1. Заместителю мэра, Мэру, Вице-Губернатору, Губернатору запрещено иметь: гражданство другого государства, иностранные счета, иностранные облигации, иностранные ценные бумаги, иностранные дорожные чеки, - наказывается лишением свободы сроком на 35 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 50. Госимущество.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;50.1. Госслужащим запрещено использовать в неслужебных целях: средства материально-технического, финансового и информационного обеспечения, служебные автотранспортные средства, другое государственное имущество, служебную информацию, - наказывается лишением свободы сроком от 30 до 50 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 51. Подарки и вознаграждения.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;51.1. При исполнении служебных полномочий госслужащие не могут получать подарки дороже $50.000, - наказывается лишением свободы сроком от 25 до 50 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Раздел X. Киберпреступления.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 52. Взлом информации.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;52.1. Взлом личной информации персоны наказывается лишением свободы сроком на 35 лет.&amp;lt;br /&amp;gt;\r\n52.2. Взлом закрытой правительственной или корпоративной информации наказывается лишением свободы сроком на 50 лет и штрафом в $30.000.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 53. Проникновение из корыстных побуждений.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;53.1. Проникновение на государственные сервера (71.17.71.17, 11.11.11.11, 111.111.111.111, 77.77.77.77,55.55.55.55, 47.24.39.182) и сервера корпораций/предприятий с целью нарушить работу этих серверов или использовать полученные на серверах данные для корыстных целей - наказывается лишением свободы сроком на 50 лет и штрафом в $30.000.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 54. Кибератака.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;54.1. Кибератака на любые носители данных частных лиц или корпораций (сотовые телефоны, банкоматы, компьютеры, электронные часы и т.д.) - наказывается лишением свободы сроком на 30 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Раздел XI. Преступления против правосудия.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 55. Воспрепятствование осуществлению правосудия.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;55.1. Вмешательство в какой бы то ни было форме в деятельность суда в целях воспрепятствования осуществлению правосудия - наказывается штрафом в размере $20.000, либо лишением свободы на срок до 2 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 56. Привлечение заведомо невиновного к уголовной ответственности.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;56.1. Привлечение заведомо невиновного к уголовной ответственности - наказывается лишением свободы на срок до 5 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 57. Фальсификация доказательств.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;57.1. Фальсификация доказательств по гражданскому, уголовному делу наказывается - лишением свобод на срок до 5 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 58. Отказ свидетеля или потерпевшего от дачи показаний.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;58.1. Отказ свидетеля или потерпевшего от дачи показаний либо уклонение потерпевшего от дачи показаний - наказывается штрафом $5.000.&amp;lt;br /&amp;gt;\r\nПримечание 1: Лицо не подлежит уголовной ответственности за отказ от дачи показаний против себя самого, своего супруга или своих близких родственников.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 59. Принуждение к даче показаний.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;59.1. Принуждение обвиняемого, потерпевшего, свидетеля к даче показаний, путем применения угроз, шантажа или иных незаконных действий со стороны прокурора, судьи и других лиц проводивших дознание - наказывается лишением свободы на срок до 3 лет.&amp;lt;br /&amp;gt;\r\n59.2. То же деяние, соединенное с применением насилия, издевательств или пытки - наказывается лишением свободы на срок от 2 до 8 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 60. Заведомо ложные показания.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;60.1. Заведомо ложные показания свидетеля, потерпевшего - наказываются штрафом в размере от $10.000 до $15.000.&amp;lt;br /&amp;gt;\r\n60.2. Те же деяния, соединенные с обвинением лица в совершении тяжкого или особо тяжкого преступления - наказываются лишением свободы на срок до 5 лет.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 61. Подкуп за дачу ложных показаний.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;61.1. Подкуп за дачу ложных показаний - подкуп свидетеля, потерпевшего в целях дачи ими ложных показаний - наказывается штрафом от $20.000 до $30.000.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 62. Неисполнение приговора суда, решения суда или иного судебного акта.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;62.1. Злостное неисполнение вступивших в законную силу приговора суда, решения суда или иного судебного акта, а равно воспрепятствование их исполнению лицом, подвергнутым административному наказанию за деяние - наказывается штрафом от $10.000 до $20.000.&amp;lt;br /&amp;gt;\r\n62.2. Злостное неисполнение представителем власти, государственным служащим, вступивших в законную силу приговора суда, решения суда или иного судебного акта, а равно воспрепятствование их исполнению - наказываются штрафом в размере $30.000.&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n');
INSERT INTO `rp_rules` VALUES (6, 'Процессуальный Кодекс', '&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел I. Принципы процессуального кодекса.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;1. Презумпция невиновности (см. Уголовный кодекс, раздел 4, пункт 16).&amp;lt;br /&amp;gt;\r\n2. Недопустимые доказательства:&amp;lt;br /&amp;gt;\r\n2.1. Улики, которые были добыты незаконным путем, не являются доказательством и не имеют юридической силы&amp;lt;br /&amp;gt;\r\n2.2. К недопустимым доказательствам относятся:&amp;lt;br /&amp;gt;\r\na) Показания данные обвиняемым в ходе следствия, без присутствия его адвоката, включая случаи отказа от адвоката или его отсутствии в штате. Даже если имеется звуко или видеозапись где обвиняемый дает показания против себя, так как обвиняемый в этот момент мог не знать свои права, так как рядом не было адвоката, а также на обвиняемого могли давить сотрудники проводившие допрос. Если есть доказательства отказа обвиняемого от услуг адвоката, (и частного, и государственного), данный пункт отменяется.&amp;lt;br /&amp;gt;\r\nb) Показания потерпевшего, свидетеля, основанные на догадке, предположении, слухе, а также показания свидетеля, который не может указать источник своей осведомленности;&amp;lt;br /&amp;gt;\r\nc) Улики добытые незаконным путем, когда были нарушены положения действующих нормативно-правовых актов выпущенных Правительством штата Сан Андреас.&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nКроме следующих улик:&amp;lt;br /&amp;gt;\r\n-Которые служили орудиями, оборудованием или иными средствами совершения конкретного преступления и сохранили на себе следы преступления.&amp;lt;br /&amp;gt;\r\n-Деньги, ценности и иное имущество, полученные в результате совершения преступления, произошедшего прямо на глазах и добытые по горячим следам.&amp;lt;br /&amp;gt;\r\n-Иные предметы и документы, которые могут служить средствами для обнаружения преступления и установления обстоятельств уголовного дела.&amp;lt;br /&amp;gt;\r\n3. Неприкосновенность жилища:&amp;lt;br /&amp;gt;\r\n3.1. Обыск жилища производится только с согласия проживающих в нем лиц или на основании ордера выданного Окружным мэром.&amp;lt;br /&amp;gt;\r\n3.2. Обыск и выемка в жилище могут производиться на основании ордера выданного Окружным мэром.&amp;lt;br /&amp;gt;\r\n3.3. В случае угрозы человеческой жизни, когда производство обыска жилища и обыска не терпит отлагательства, указанные следственные действия могут быть произведены на основании решения сотрудника правоохранительных органов без ордера. В этом случае, сотрудник правоохранительной службы не позднее 7 часов с момента начала производства следственного действия уведомляет Окружной суд о производстве следственного действия.&amp;lt;br /&amp;gt;\r\n4. Тайна переписки, телефонных и иных переговоров:&amp;lt;br /&amp;gt;\r\n4.1 Ограничение права гражданина на тайну переписки, телефонных и иных переговоров допускается только на основании ордера выданного Окружным судьей.&amp;lt;br /&amp;gt;\r\n4.2. Ограничение права высокопоставленных должностных лиц на тайну переписки, телефонных и иных переговоров допускается только на основании ордера выданного Губернатором.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Раздел II. Профилактика правонарушений.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;1. Правомерным признается сопротивление, оказываемое стороной, потенциально значащееся пострадавшей, если оно сделано для предотвращения правонарушения в отношении его личности, его семьи и (или) предотвращении незаконной попытки силой завладеть имуществом, находящемся в его законном владении, равно как стороной, оказывающей помощь или защитившее сторону, потенциально значащееся пострадавшей.&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\n2. Публичные правонарушения могут быть предотвращены вмешательством должностных лиц правоохранительных органов, путем обеспечения безопасности и мира, их присутствия в общественных местах и (или) подавлением беспорядков.&amp;lt;br /&amp;gt;\r\n2.1. Лица, оказывающие помощь и действующие под командованием должностных лиц правоохранительных органов, оправдываются в совершенных деяниях.&amp;lt;br /&amp;gt;\r\n3. Должностные лица инспекции или прокуратуры вправе привлекать гражданское лицо в качестве информатора (свидетеля), при этом такое лицо должно быть допрошено, а информация, должна быть оформлена в письменной или устной форме и зафиксирована.&amp;lt;br /&amp;gt;\r\n3.1. Если из условия соглашения информатора (свидетеля) и должностного лица уполномоченного представителя правоохранительных органов следует обязательство освобождения от ответственности, предусмотренное при предоставлении достоверной информации (показаний), то такое лицо освобождается от ответственности. Информатор (свидетель) обязан дать правдивые показания (предъявления обвинений) о правонарушении (преступлении) задержанного/обвиняемого. При отказе от выполнения обязательства в предоставлении информации (показаний) возбуждается уголовное дело.&amp;lt;br /&amp;gt;\r\n4. При оказании сопротивления задержанию и (или) аресту сотрудник правоохранительных органов при исполнении обязанностей может призвать граждан помочь в осуществлении задержания и (или) ареста и преодолении сопротивления.&amp;lt;br /&amp;gt;\r\n5. Сотрудник правоохранительных органов при исполнении обязанностей имеет право потребовать отойти от государственного служащего на расстояние в 21 фут (6 метров).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Раздел III. Юрисдикция и компетенция в отношении государственных правонарушений.&amp;lt;br /&amp;gt;\r\n1. Уголовное преследование за правонарушением возбуждается в том случае, если происходит хотя бы одно из следующих действий:&amp;lt;br /&amp;gt;\r\na) предъявлено обвинительное заключение или представлена такая информация;&amp;lt;br /&amp;gt;\r\nb) подана жалоба на проступок или преступление (с фото/видеофиксацией);&amp;lt;br /&amp;gt;\r\nc) обвиняемый привлекается к ответственности по судебному решению, в котором обвиняется в совершении уголовного преступления.&amp;lt;br /&amp;gt;\r\nОрдер на арест или судебный ордер выдаются с указанием имен, и описания обвиняемого и с необходимой спецификой, которая требуется для обвинительного заключения, информации или жалобы.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Раздел IV. Задержание.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1. Задержание &amp;amp;mdash; кратковременное лишение свободы лица, подозреваемого в совершении преступления или административного правонарушения, арест личности.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2. Сотрудник правоохранительных органов вправе задержать лицо по подозрению в совершении преступления, за которое может быть назначено наказание в виде лишения свободы, при наличии одного из следующих оснований:&amp;lt;br /&amp;gt;\r\na) когда гражданским(и) лицом(ами), подозреваемое лицо застигнуто при совершении преступления или непосредственно после его совершения;&amp;lt;br /&amp;gt;\r\nb) когда на этом лице или его одежде, при нем или в его жилище будут обнаружены явные следы преступления.&amp;lt;br /&amp;gt;\r\n3. Сотрудники правоохранительных органов в праве при задержании ограничивать конституционные права гражданина на свободу перемещения на срок не более 7 часов без предъявления обвинения, по нарушению действующего законодательства.&amp;lt;br /&amp;gt;\r\n4. Порядок задержания:&amp;lt;br /&amp;gt;\r\na) Гражданину должно быть сообщено, что он подвергается процедуре задержания.&amp;lt;br /&amp;gt;\r\nb) Сотрудник правоохранительных органов имеет право попросить человека сесть в служебный транспорт или проследовать за ним в место предварительного задержания (окружной департамент).&amp;lt;br /&amp;gt;\r\nc) При отказе гражданина от законных требований сотрудника правоохранительных органов, гражданин может быть арестован в рамках действующего законодательства.&amp;lt;br /&amp;gt;\r\nd) По прибытию в место предварительного заключения сотрудники обязаны произвести следственные мероприятия относительно задержанного.&amp;lt;br /&amp;gt;\r\ne) По итогам следственных мероприятий должны последовать либо заключение подозреваемого под стражу, либо прекращение ограничения конституционного права на передвижение задержанного.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел V. Арест.&amp;lt;br /&amp;gt;\r\nСтатья 1. Государственный служащий, уполномоченный в выполнении процессуальных действий, вправе искать нелегальное оружие у любого лица, и производить арест, когда у него есть основания полагать, что это лицо обладает нелегальное оружием.&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\n1.1. Если у сотрудника есть основания полагать, что какое-либо лицо имеет при себе нелегальное оружие, сотрудник вправе задержать это лицо для определения того, было ли совершено преступление, связанное с нелегальным оружием.&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\n1.2. Сотрудник вправе проводить ограниченный обыск лица на предмет наличия оружия, если есть основания полагать о том, что лицо может быть вооружено и представлять опасность для сотрудника.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Статья 2. Арест &amp;amp;ndash; это взятие лица под стражу в случае и в порядке, разрешенным законом. Арест может быть произведен следующими лицами.&amp;lt;br /&amp;gt;\r\n2.1. Государственными служащими, уполномоченными в выполнении процессуальных действий, а именно офицерами Полицейских Департаментов, сотрудниками Департаментов Шерифа, представители федеральных и правоохранительных ведомств.&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\n2.2. Если человек знает о том, что он арестован сотрудником правоохранительных структур, то обязанностью такого лица является необходимость воздержаться от применения силы или любого оружия, чтобы противостоять такому аресту.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Статья 3. Арест производится путем фактического удержания лица или путем передачи его под стражу.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Статья 4. Сотрудник, который имеет основания полагать, что лицо, подлежащее аресту, совершило преступление, может использовать разумную силу для осуществления ареста, в рамках стадий применений силы.&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nСотрудник, который совершает арест, не должен отступать или воздерживаться от своих усилий по причине сопротивления или угрозы сопротивления со стороны арестовывемого лица; он не считается агрессором и не утрачивает свое право на самооборону путем применения разумной силы, в рамках стадий применений силы.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Статья 5. Сотрудник правоохранительных структур вправе арестовать какое-либо лицо на основании ордера или в случае возникновения любого из следующих обстоятельств:&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\na) у сотрудника есть основания полагать, что лицо совершило преступление в присутствии сотрудника;&amp;lt;br /&amp;gt;\r\nb) лицо совершило уголовное преступление, хоть и не в присутствии сотрудника (согласно разделу 4, статье 1 Процессуального кодекса);&amp;lt;br /&amp;gt;\r\nc) в случае, когда сотрудник отвечает на вызов, в котором утверждается о совершении публичного или уголовного преступления;&amp;lt;br /&amp;gt;\r\nd) в случае, когда лицо не выполняет охранного или запретительного приказа сотрудника;&amp;lt;br /&amp;gt;\r\ne) в случае побега или попытке сбежать от сотрудника, равно как побега из места заключения.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Статья 6. Порядок ареста.&amp;lt;br /&amp;gt;\r\n6.1. Если есть достаточные основания полагать, что подозреваемый совершил преступление, то сотрудник правоохранительных органов обязан произвести арест лица в следующей последовательности:&amp;lt;br /&amp;gt;\r\na) Надеть наручники на гражданина подозреваемого в совершении преступления.&amp;lt;br /&amp;gt;\r\nb) Зачитать подозреваемому его Конституционные права (Правило Миранды).&amp;lt;br /&amp;gt;\r\nc) Провести первичный обыск (В случаях, если первичный обыск невозможен по обстоятельствам не зависящим от сотрудников правоохранительных органов, и когда угрожает опасность сотрудникам правоохранительных органов, его можно опустить).&amp;lt;br /&amp;gt;\r\nd) Посадить закованного в наручники гражданина на пассажирское сиденье служебного автомобиля.&amp;lt;br /&amp;gt;\r\nПункты a), b), d) можно провести в любом порядке при угрозе жизни.&amp;lt;br /&amp;gt;\r\ne) Доставить подозреваемого в место дознания.&amp;lt;br /&amp;gt;\r\nf) Произвести вторичный обыск.&amp;lt;br /&amp;gt;\r\ng) Произвести допрос подозреваемого с видео и аудио фиксацией.&amp;lt;br /&amp;gt;\r\nh) Если в ходе разбирательства дела выявлено, что подозреваемый виновен, вызвать конвой для дальнейшей транспортировки закованного в наручники в федеральную тюрьму Болингброук на тот срок заключения, которое предусмотрено действующим законодательством.&amp;lt;br /&amp;gt;\r\ni) Заполнить Базу данных, в которую входит форма ареста и фото (в течении 7 часов с момента конвоирования).&amp;lt;br /&amp;gt;\r\n6.2. Представлять интересы граждан может только лицензированный адвокат.&amp;lt;br /&amp;gt;\r\n6.3. Во время процесса задержания адвокат может присутствовать, но не может никак препятствовать и мешать действиям сотрудника правоохранительных органов, либо отвлекать их.&amp;lt;br /&amp;gt;\r\n6.4. Адвокат может вместе со своим подзащитным проехать на допрос в органы дознания. Адвокат может вместе со своим подзащитным остаться наедине, сроком до 2 часов, будучи закованными в наручниках.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Статья 7. Личный обыск.&amp;lt;br /&amp;gt;\r\n7.1. Если есть основания полагать, что у какого-либо лица могут находиться орудия, оборудование или иные средства совершения преступления, предметы, документы и ценности, которые могут иметь значение для дела, при задержании лица или заключении его под стражу, личный обыск может быть произведен без соответствующего ордера.&amp;lt;br /&amp;gt;\r\n7.2. Обыск в жилище и в частной собственности производится только при наличии ордера.&amp;lt;br /&amp;gt;\r\n7.3. Обыск личного автомобиля может производится без ордера:&amp;lt;br /&amp;gt;\r\na) При непосредственном преследовании подозреваемого (Если подозреваемый оказал сопротивление - отказ при приказе остановиться от уполномоченного государственного служащего).&amp;lt;br /&amp;gt;\r\nb) При проведении специальной операции.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 8. Лицо, производящее арест, должно сообщить лицу, подлежащему аресту, о своем намерении арестовать его, о причине ареста и полномочии произвести его.&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nЛицо, производящее арест, должно, по просьбе арестованного, информировать (не показывать видеодоказательства) последнего о преступлении, за которое он арестован.&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\n8.1. Ни один сотрудник правоохранительных органов не должен раскрывать информацию любому арестованному: адрес, номер телефона и иную информацию о лице, которое является жертвой или свидетелем предполагаемого преступления.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Статья 9. Если после получении информации о намерении произвести арест, если лицо, подлежащее аресту, бежит, либо оказывает сопротивление, то сотрудник вправе использовать все необходимые средства для осуществления ареста.&amp;lt;br /&amp;gt;\r\n9.1. Чтобы произвести арест сотрудник может открыть любые двери или окна после игнорирования или отказа от допуска в помещения, где предполагаемо располагается лицо, подлежащее аресту.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Статья 10. Сразу же после вторичного обыска и, за исключением случаев, когда это физически невозможно, арестованное лицо имеет право сделать один звонок, трем из следующих номеров:&amp;lt;br /&amp;gt;\r\na) адвокат по своему выбору или, если у него нет средств, государственный адвокат для оказания юридической помощи. Этот разговор не может быть прослушан, записан или применен в суде как доказательство вины;&amp;lt;br /&amp;gt;\r\nb) поручитель под залог;&amp;lt;br /&amp;gt;\r\nc) родственник или другое лицо.&amp;lt;br /&amp;gt;\r\nПримечание: если задержанный нарушил хотя бы одну статью уголовного кодекса, то звонок можно совершить исключительно после завершения процедуры ареста.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Глава VI. Применение силы.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Стадии применения силы:&amp;lt;br /&amp;gt;\r\n1. Присутствие сотрудника полиции &amp;amp;mdash; этот уровень состоит только из присутствия сотрудника полиции в штатной униформе.&amp;lt;br /&amp;gt;\r\n2. Устные требования &amp;amp;mdash; ясные и понятные устные распоряжения от сотрудника полиции при исполнении обязанностей к объекту применения силы.&amp;lt;br /&amp;gt;\r\n3. Физическое воздействие &amp;amp;mdash; к этой ступени относятся заламывание рук, нажатия на болевые точки, удары руками и ногами.&amp;lt;br /&amp;gt;\r\n4. Применение спецсредств &amp;amp;mdash; к этой ступени относится применение наручников, дубинки, слезоточивых газов.&amp;lt;br /&amp;gt;\r\n5. Применение электрошоковых устройств &amp;amp;mdash; к этой ступени относится применение тайзера.&amp;lt;br /&amp;gt;\r\n6. Убойная сила &amp;amp;mdash; под этой ступенью воздействия понимают огнестрельное оружие. Однако в этом качестве может выступать, и автомобиль, и любое подручное оружие, обладающее необходимыми свойствами. На этой ступени воздействия очень вероятно причинение смерти или нанесение тяжкого вреда здоровью объекта применения силы.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Политика правоохранительных органов заключается в том, что персонал может использовать только силу, которая является &amp;amp;laquo;объективно разумной&amp;amp;raquo; для:&amp;lt;br /&amp;gt;\r\na) защиты себя;&amp;lt;br /&amp;gt;\r\nb) защиты других;&amp;lt;br /&amp;gt;\r\nc) ареста или задержания;&amp;lt;br /&amp;gt;\r\nd) предотвращения побега; или же,&amp;lt;br /&amp;gt;\r\ne) предотвращения сопротивления.&amp;lt;br /&amp;gt;\r\nСотрудники правоохранительных органов имеют право применять убойную силу для:&amp;lt;br /&amp;gt;\r\n1. Защиты себя или других от того, что, по разумным причинам, считается непосредственной угрозой смерти или серьезным телесным повреждениям; или же,&amp;lt;br /&amp;gt;\r\n2. Предотвращения преступления, когда действия подозреваемого ставят лиц(а) под угрозу смерти или серьезных телесных повреждений; или же,&amp;lt;br /&amp;gt;\r\n3. Предотвращения побега насильственного бегущего преступника, если есть вероятная причина полагать, что побег представляет серьезную угрозу смерти, или серьезного телесного повреждения для офицера или других лиц, если задержание производиться. При таких обстоятельствах сотрудники правоохранительных органов должны, насколько это практически возможно, избегать применения убойной силы, которая может привести к гибели или травмам невинных свидетелей или заложников.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;При определении соответствующего уровня силы сотрудники должны оценивать каждую ситуацию в свете фактов и обстоятельств каждого конкретного случая.&amp;lt;br /&amp;gt;\r\nЭти факторы могут включать, но не ограничиваются:&amp;lt;br /&amp;gt;\r\na) серьезность преступления или предполагаемого преступления;&amp;lt;br /&amp;gt;\r\nb) уровень угрозы или сопротивления, представленный субъектом;&amp;lt;br /&amp;gt;\r\nc) представлял ли субъект непосредственную угрозу для офицеров или представлял опасность для сообщества;&amp;lt;br /&amp;gt;\r\nd) возможность причинения вреда гражданам, должностным лицам или субъектам;&amp;lt;br /&amp;gt;\r\ne) риск или очевидная попытка субъекта сбежать;&amp;lt;br /&amp;gt;\r\nf) поведение субъекта, с которым сталкиваются (как разумно воспринималось сотрудником в то время);&amp;lt;br /&amp;gt;\r\ng) время, которое офицер может принять решение;&amp;lt;br /&amp;gt;\r\nh) наличие других ресурсов;&amp;lt;br /&amp;gt;\r\ni) обучение и опыт офицера;&amp;lt;br /&amp;gt;\r\nj) близость или доступ оружия к предмету;&amp;lt;br /&amp;gt;\r\nk) Офицер против предметных факторов, таких как возраст, размер, относительная сила, уровень квалификации, травма / истощение и количество офицеров против предметов; и,&amp;lt;br /&amp;gt;\r\nl) факторы окружающей среды и/или другие неотложные обстоятельства.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n');
INSERT INTO `rp_rules` VALUES (7, 'Судебный Кодекс', '&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Судебный Кодекс&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Раздел I. Общие положения и определения&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1. Судебный Кодекс является основополагающим законодательным актом во время проведения любых судебных заседаний в Окружном и Верховном судах.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2. Окружной суд - суд, рассматривающий все иски, поданные физическими или юридическими лицами.﻿ Является судом низшей инстанции.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3. Верховный суд - суд, рассматривающий только дела особой государственной важности, а также апелляционные иски. Является судом высшей инстанции.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;4. Судья - уполномоченное лицо, проводящее судебный процесс.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5. Истец - сторона обвинения. Лицо, подавшее иск в суд.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;6. Ответчик - сторона защиты. Лицо, на которое подали в суд.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;7. Прокурор - уполномоченное лицо, выступающее только на стороне государственного обвинения(представитель).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;8. Адвокат - уполномоченное лицо, представляющее интересы исца или ответчика(представитель).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;9. Свидетель - лицо, привлеченное сторонами обвинения или защиты для дачи показаний с целью детального изучения дела.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;10. Присяжный - лицо, не имеющее никаких связей со сторонами обвинения или защиты, уполномоченное вынести собственное решение по делу.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;11. Судебный пристав - уполномоченное лицо, ответственное за соблюдение порядка во время судебного заседания.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Раздел II. Досудебное разбирательство&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1. Обе стороны должны самостоятельно найти себе представителей. Представителем может быть только - Адвокат (частный или государственный). Прокурор представляет только обвинение от государственных структур. Только сторона защиты имеет право отказаться от представителя и защищать себя самостоятельно, сторона обвинения так сделать не может.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2. Судебный пристав или судья обязаны лично вручить устные или письменные повестки в суд обеим сторонам.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3. До назначенного судебного заседания стороны вправе урегулировать конфликт самостоятельно - заключить мировое соглашение.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;4. Мировое соглашение должно быть заключено максимум за два часа до назначенного судебного заседания, в противном случае соглашение может быть аннулировано судьей.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5. Сразу после заключения соглашения представители обеих сторон обязаны уведомить о результате судью.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;6. В случае заключения мирового соглашения судебное заседание отменяется, решением судьи является заключенное мировое соглашение между сторонами.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Раздел III. Правила поведения на суде&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1. Во время всего судебного заседания, присутствующим лицам запрещено разговаривать, издавать звуки, вести фото, аудио и видео фиксацию, перемещаться по залу суда без разрешения судьи. Нарушение правила может быть расценено судьей, как неуважение к суду.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2. Лица, присутствующие на суде обязаны относится к друг другу с уважением, запрещено сквернословить, рукоприкладствовать, повышать голос, перебивать. Обращение к друг другу строго на &amp;amp;quot;Вы&amp;amp;quot;.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3. К судье все присутствующие обязаны обращаться &amp;amp;quot;Ваша Честь&amp;amp;quot;, не называя при этом личных данных судьи. Нарушение правила может быть расценено судьей, как неуважение к суду.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;4. Нарушители могут быть удалены из зала суда судебным приставом по решению судьи. В случае нарушений поведения с одной из сторон судья в праве привлечь нарушителя к административной или уголовной ответственности. В таком случае заседание может быть отменено.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5. В начале судебного заседания судья обязан произнести следующую фразу &amp;amp;quot;Всем встать, суд идет. Сегодня, (дата, время) Окружной/Верховный суд рассматривает иск номер (номер иска): (имя фамилия исца) против (имя фамилия ответчика)&amp;amp;quot;. Далее судья должен представить исковые требования, представить представителей исца и ответчика и разрешить сесть всем присутствующим.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;6. Запрещено опаздывать на судебное заседание. Нарушение правила может быть расценено судьей, как неуважение к суду.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;7. Запрещено использование мобильных телефонов и иных технических приборов любым лицом, присутствующим в зале, без одобрения судьи.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Раздел IV. Порядок проведения суда&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1. Обе стороны обязаны подготовиться к судебному заседанию. Заранее, максимум за пять часов до заседания, стороны должны предоставить свои пронумерованные списки свидетелей и списки прилагаемых материалов. В случае отсутствие вовремя списков, судья в праве отказать стороне в вызове свидетелей или приобщения к делу материалов.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2. Во время проведения заседания судья по очереди предоставляет слово одной и другой стороне. Сам порядок таков:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;nbsp;2.1. Вступительное слово стороны обвинения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;nbsp;2.2. Вступительное слово стороны защиты.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;nbsp;2.3. Вызов свидетелей из списка, сначала со стороны обвинения, затем со стороны защиты.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;nbsp;&amp;amp;nbsp;2.3.1. Сторона обвинения задает вопросы свидетелю. Во время этого можно акцентировать внимание на прилагаемых материалах, которые укрепляют позицию стороны обвинения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;nbsp;&amp;amp;nbsp;2.3.2. Сторона защиты задает вопросы свидетелю. Во время этого можно акцентировать внимание на прилагаемых материалах, которые укрепляют позицию стороны защиты.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;nbsp;&amp;amp;nbsp;2.3.3. Судья в праве задать свои вопросы к свидетелю.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;nbsp;2.4. Во время всего заседания обе стороны имеют право возразить или подать ходатайство. Для этого представитель стороны должен встать и сказать &amp;amp;quot;Возражаю, Ваша Честь&amp;amp;quot;, при этом&amp;amp;nbsp; по минимуму перебивая другую сторону. После разрешения судьи объяснить суть возражения. Судья имеет право принять возражение или отклонить его. Ходатайство подается в&amp;amp;nbsp; письменной форме судье, с его разрешения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;nbsp;2.5. После вызова свидетелей у обеих сторон есть возможность для высказывания заключительного слова.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;nbsp;2.6. Судья объявляет перерыв и удаляется для принятия решения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3. Во время всего заседания судья имеет право делать перерывы, если по его мнению заседание сильно затянуто или если того требует ситуация.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;4. После оглашения решения судья делает публикацию о своем решении в соответствующем разделе. Решение вступает в силу мгновенно, после оглашения решения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5. За исполнением решения суда следит судебный пристав и соответствующие государственные органы.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Раздел V. Виды судов&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1. Открытый суд - суд, на котором могут присутствовать все желающие. Может вестись (фото-)(видео-) фиксация процесса суда со стороны СМИ, с разрешения судьи. Отказ в посещении такого судебного заседания может быть только в случае нарушения лицом действующего законодательства Штата или нехватки мест в зале заседания. Решение о слушании дела в открытом судебном заседании может быть принято либо при назначении судебного заседания, либо непосредственно в ходе судебного разбирательства.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2. Закрытый суд - суд, на котором могут присутствовать только судья, ведущий заседание, истец, ответчик, их представители, свидетели(по вызову в зал), судебный пристав.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3. Суд присяжных - открытый суд, на котором присяжные являются совещательным органом для судьи. Присяжные - случайно отобранные граждане Штата, не имеющие никакого отношения ни к одной из сторон судебного процесса. Решение о слушании дела в суде присяжных может быть принято при назначении судебного заседания.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;4. Количество присяжных на суде присяжных - шесть человек. Присяжные могут получить за участие в заседании денежное или иное вознаграждение от судьи.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5. Присяжные между собой выбирают Председателя. Председатель в конце судебного заседания оглашает совместное решение всех присяжных. Решение Председателя является решающим. Если количество голосов оказалось равным, то решение принимается непосредственно Председателем. Выбор председателя должен быть произведен до начала заседания.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;6. Присяжные не имеют права задавать вопросы свидетелям и контактировать с любой из сторон.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;7. На суде присяжных судья обязан прислушаться к мнению и решению присяжных, но оставляет за собой право самостоятельно выносить окончательное решение, которое не должно в корне отличаться от решения присяжных.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;﻿&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Раздел VI. Судебная система.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Судебная система Штата состоит из двух судов: Окружного суда и Верховного суда. Согласно иерархии судебной системы Штата, решения Верховного суда главнее, чем решения Окружного суда.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Верховный суд&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Верховный суд рассматривает только дела особой государственной важности, а также апелляционные иски. Апелляционные иски подаются только после прохождения Окружного суда Штата. Верховный суд может отменить решение Окружного суда. Решение Верховного суда отменить невозможно. Суд может быть закрытым или открытым.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Судьей является Верховный судья.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Окружной суд&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Окружной суд рассматривает все иски, поданные физическими или юридическими лицами. Решение Окружного суда может быть обжаловано в сроки, установленные Судебным Кодексом в Верховном суде. Окружной суд может быть закрытым, открытым, судом с присяжными.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Судьей является Окружной судья.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Закрытый суд&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Такой суд не позволяет гражданам, представителям СМИ и иным лицам, никак не относящимся к делу, присутствовать в процессе.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Основаниями для проведения закрытого судебного разбирательства являются факты составляющие государственную или иную охраняемую законом тайну, в том числе сведения, относящиеся к коммерческой, банковской, врачебной, иной профессиональной, а также личной и семейной тайне.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Решение о слушании дела в закрытом судебном заседании может быть принято либо при назначении судебного заседания, либо непосредственно в ходе судебного разбирательства.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Открытый суд&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Суд, на котором могут присутствовать все желающие, может вестись (фото/видео-) фиксация процесса суда со стороны СМИ. Отказ в посещении такого судебного заседания может быть только в случае нарушения лицом действующего законодательства Штата или нехватки мест в зале заседания. Решение о слушании дела в открытом судебном заседании может быть принято либо при назначении судебного заседания, либо непосредственно в ходе судебного разбирательства.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Суд присяжных&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Открытый суд, на котором присяжные являются совещательным органом для судьи. Присяжные - случайно отобранные граждане Штата, не имеющие никакого отношения ни к одной из сторон судебного процесса. Количество присяжных на суде - 6 человек. Среди присяжных выбирается Председатель, который будет оглашать решение присяжных. Решение Председателя является решающим (т.е. если трое присяжных &amp;amp;quot;за&amp;amp;quot; и трое, включая Председателя &amp;amp;quot;против&amp;amp;quot;, то общее решение присяжных будет &amp;amp;quot;против&amp;amp;quot;). Судья обязан прислушаться к мнению и решению присяжных, но оставляет за собой право самостоятельно выносить окончательное решение суда, которое не должно в корне отличаться от решения присяжных. Решение о слушании дела в суде присяжных может быть принято при назначении судебного заседания.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Раздел VII. Иски и апелляции.﻿&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;В данном разделе любое физическое или юридическое лицо, зарегистрированное в Штате может подать исковое заявление в суд.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Иски, подающиеся впервые направляются в Окружной суд, апелляционные иски направляются в Верховный суд. Все иски должны быть составлены строго по форме, которая указана ниже. Перед подачей иска необходимо ознакомится с судебной системой штата и Судебным Кодексом. Рассмотрение иска происходит в течении 1-3 дней, в зависимости от нагруженности суда и сложности дела.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Важно! Отредактированные, обрезанные фото/видео/аудио материалы судом не рассматриваются, такие иски будут отклонены. Если в иске отсутствуют прилагаемые материалы, то в данной графе необходимо написать: &amp;amp;quot;Не имеются&amp;amp;quot;. Если ответчиком является Правительство Штата, то в качестве ответчика необходимо записать: &amp;amp;quot;Штат Сан-Андреас&amp;amp;quot;. Если ответчиком являются юридические лица или государственные организации(кроме Правительства), то необходимо указать полное наименование организации.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;(( Иски видны только судьям. Любое использование информации в IC из чужих исков будет приравниваться к MG. ))&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Форма подачи иска в Окружной суд:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Номер иска №__ (присваивается в порядке очереди)&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1.Имя заявителя:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2. Фамилия заявителя:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3. Время проживания в Штате заявителя:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;4. Род занятий на момент подачи иска заявителя:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;5. Наличие судимостей заявителя:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;6. Место проживания заявителя(округ, город, номер дома):&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;7. Контактные данные заявителя(номер телефона, спецсвязь):&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;8. Ответчик(все возможные известные сведения):&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;9. Претензии к ответчику:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;10. Прилагаемые материалы(фото, видео, аудио):&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;11. Исковые требования к ответчику:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;12. Ознакомлен(-а) с Судебным Кодексом(да/нет):&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;13. Подтверждаю, что вся вышеизложенная информация правдива и является актуальной(да/нет):&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;14. Дата и время составления(час:минута, день.месяц.год):&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Форма подачи апелляционного иска в Верховный суд:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;1. Номер искового заявления, к которому подается апелляция:&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;2. Код судебного решения(номер судебного решения в разделе &amp;amp;quot;Решения судей | Ордера&amp;amp;quot;):&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;3. Претензии к решению суда:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;4. Прилагаемые материалы(фото, видео,аудио):&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Раздел VIII. Адвокатская коллегия&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Коллегия адвокатов &amp;amp;ndash; публичная компания, занимающаяся предоставлением услуг по оказанию юридической, правовой помощи, а также для консультирования граждан Штата и членов государственных (федеральных) структур в вопросах применения Законов.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Устав членов коллегии адвокатов.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Член Коллегии имеющий лицензию адвоката - далее именуемый &amp;amp;quot;Адвокат&amp;amp;quot; (вне зависимости от должности в правительстве).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Права членов Коллегии:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Собирать сведения, необходимые для оказания юридической помощи, в том числе запрашивать справки, характеристики и иные документы от органов власти, общественных объединений и иных организаций. Указанные органы и организации в установленном порядке обязаны выдать адвокату запрошенные им документы или их копии. Отказ в предоставлении запрошенных сведений может быть в случае: субъект, получивший адвокатский запрос, не располагает запрошенными сведениями. запрошенные сведения отнесены законом к информации с ограниченным доступом;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Опрашивать с их согласия лиц, предположительно владеющих информацией, относящейся к делу, по которому адвокат оказывает юридическую помощь.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Собирать и представлять предметы и документы, которые могут быть признаны вещественными и иными доказательствами, в порядке, установленном законодательством.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Привлекать на договорной основе специалистов для разъяснения вопросов, связанных с оказанием юридической помощи.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Беспрепятственно встречаться со своим доверителем наедине, в условиях, обеспечивающих конфиденциальность (в том числе в период его содержания под стражей), без ограничения числа свиданий и их продолжительности.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Фиксировать (в том числе с помощью технических средств) информацию, содержащуюся в материалах дела, по которому адвокат оказывает юридическую помощь, соблюдая при этом государственную и иную охраняемую законом тайну;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Совершать иные действия, не противоречащие законодательству.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Обязанности члена Коллегии:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Честно, разумно и добросовестно отстаивать права и законные интересы доверителя всеми не запрещенными законодательством средствами.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Представляет доверителя на основании доверенности.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;Запреты для члена Коллегии:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Принимать от лица, обратившегося к нему за оказанием юридической помощи, поручение в случае, если оно имеет заведомо незаконный характер.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Занимать по делу позицию вопреки воле доверителя, за исключением случаев, когда адвокат убежден в наличии самооговора доверителя.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Делать публичные заявления о доказанности вины доверителя, если тот ее отрицает.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Разглашать сведения, сообщенные ему доверителем в связи с оказанием последнему юридической помощи, без согласия доверителя.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p dir=&amp;quot;ltr&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;- Отказаться от принятой на себя защиты.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n');
INSERT INTO `rp_rules` VALUES (8, 'Дорожный Кодекс', '&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Дорожный кодекс штата Сан Андреас - документ, описывающий и регулирующий правильное поведение жителей штата во время использование любого вида транспортного средства. Цель этого закона - обеспечение безопасности дорожного движения и организация доступности движения в разумных пределах. Дорожный кодекс подчиняется не только существующим основным правилам, но и любым формальным положениям правил дорожного движения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Раздел I. Порядок дорожного движения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1. Движение транспортных средств является правосторонним.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2. Все участники дорожного движения, организаторы дорожного движения и другие лица должны соблюдать требования правовых актов по дорожному движению, быть внимательными и осмотрительными в дорожном движении, и обеспечивать ритмичность движения с целью предотвращения возникновения опасности и причинения вреда.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;3. В случаях, когда значения дорожных знаков и дорожной разметки противоречат друг другу, следует руководствоваться дорожными знаками.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;4. Запрещается создавать действиями или бездействием угрозу или помехи в дорожном движении. Лица, создавшие опасную ситуацию, должны принять все доступные им меры для устранения угрозы или уменьшения ее вредных последствий. При необходимости следует сообщить об опасной ситуации в полицию.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел II. Скоростной режим.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1. Максимальная разрешенная скорость движения составляет:&amp;lt;br /&amp;gt;\r\n1.1. В населенных пунктах разрешенная скорость - 50 mp/h (80 km/h);&amp;lt;br /&amp;gt;\r\n1.2. За пределами населенных пунктов (за исключением трасс) разрешенная скорость - 70 mp/h (115 km/h);&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.3. На шоссе/трассе разрешенная скорость - 110 mp/h (180 km/h);&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.4. На парковках или территориях частных/государственных организаций разрешенная скорость - 20 mp/h (32 km/h).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Раздел III. Обязанности участников дорожного движения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1. Участники дорожного движения должны быть взаимовежливыми и учитывающими интересы других участников дорожного движения и воздерживаться от любых действий, которые могут создавать помехи в дорожном движении, создавать опасность или причинять ущерб людям, имуществу или окружающей среде.Участники дорожного движения обязаны руководствоваться сигналами регулировщика, выполнять иные распоряжения регулировщиков и проверяющих, касающиеся организации дорожного движения, а также соблюдать требования средств организации дорожного движения и порядок применения опознавательных знаков.Участники дорожного движения должны следовать указаниям регулировщика даже в том случае, если они противоречат требованиям настоящего Закона или средств организации дорожного движения, за исключением случаев, когда это представляет угрозу для жизни, здоровья и имущества людей либо для окружающей среды.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел IV. Общая обязанность уступить дорогу.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1. Участники дорожного движения обязаны уступить дорогу транспортным средствам с включенным проблесковым маячком синего цвета или синим сигнальным огнем и включенным или не включенным специальным звуковым сигналом и сопровождаемым ими транспортным средствам, а также транспортным средствам с включенным проблесковым маячком желтого цвета при выполнении ими работ на дороге и сопровождаемым ими транспортным средствам. В случае необходимости для того, чтобы уступить дорогу, участник дорожного движения обязан остановиться.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2. При выезде на дорогу с места парковки, специальной площадки для стоянки, из жилой зоны или с прилегающей к дороге территории, либо с подъездных путей к ним водитель обязан уступить дорогу всем находящимся на дороге участникам дорожного движения, если средствами организации дорожного движения обязанность уступить дорогу не регулируется иначе.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел V. Остановка и стоянка транспортных средств.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1. Водителям запрещается останавливать или парковать транспортные средства таким образом, чтобы это могло перекрыть движение других транспортных средств на въездах во дворы, гаражи, жилые зоны и на прилегающие к дороге территории и на выездах с них, а также препятствовать движению пешеходов на пешеходных переходах и перекрестках по линии тротуаров.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2. В населенных пунктах остановка или стоянка транспортных средств на дорогах разрешается у правого края проезжей части или на правой обочине таким образом, чтобы для движения пешеходов на обочине оставалась свободной полоса шириной не менее 1 метра. Таким же образом разрешается в населенных пунктах остановка или стоянка транспортных средств на левой стороне дороги с односторонним движением и на таких дорогах с двусторонним движением, посередине которых нет трамвайных путей и которые в обоих направлениях имеют по одной полосе движения, разделяемые прерывистой линией, а при ее отсутствии &amp;amp;ndash; ширину проезжей части менее 9 метров, без учета места парковки, сооруженного в виде уширения проезжей части.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;3. Водителям разрешается останавливать транспортные средства на тротуаре также для загрузки или разгрузки груза на расстоянии не менее 15 метров от остановок транспортных средств общего пользования, при этом должна быть оставлена для прохода пешеходов свободная полоса шириной не менее 1,5 метра.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;4. За пределами населенных пунктов остановка или стоянка транспортных средств на дорогах разрешается на правой обочине дороги. Если выполнение этого требования представляется невозможным, то транспортное средство должно располагаться по возможности ближе к правому краю дороги. Остановка и стоянка транспортных средств разрешается только в один ряд, продольная ось транспортного средства должна быть параллельна краю проезжей части.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Раздел VI. Запрет на остановку и стоянку транспортных средств.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1. Запрещается остановка транспортных средств:&amp;lt;br /&amp;gt;\r\n1.1 в местах, где расположены красные бордюры;&amp;lt;br /&amp;gt;\r\n1.2 на железнодорожных переездах;&amp;lt;br /&amp;gt;\r\n1.3 на трамвайных путях или на расстоянии менее 5 футов (1.5 метра) от них;&amp;lt;br /&amp;gt;\r\n1.4 в местах, где остановившееся транспортное средство исключает возможность движения других транспортных средств или создает помехи в движении пешеходов;&amp;lt;br /&amp;gt;\r\n1.5 в зеленых зонах без разрешения их собственника или владельца.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2. Стоянка запрещается:&amp;lt;br /&amp;gt;\r\n2.1 в местах, где запрещена остановка транспортных средств;&amp;lt;br /&amp;gt;\r\n2.2 в местах, где это запрещается средствами организации дорожного движения;&amp;lt;br /&amp;gt;\r\n2.3 рядом с местами стоянки, обозначенными дорожной разметкой;&amp;lt;br /&amp;gt;\r\n2.4 на полосах торможения и разгона;&amp;lt;br /&amp;gt;\r\n2.5 в местах, где это создает помехи другим транспортным средствам при въезде на место стоянки или выезде с него.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел VII. Правила обгона.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1. Перед началом обгона водитель должен убедиться в том, что:&amp;lt;br /&amp;gt;\r\n1.1 ни один из водителей транспортных средств, которые движутся за ним и которым может быть создано препятствие, не начал обгона;&amp;lt;br /&amp;gt;\r\n1.2 водитель транспортного средства, которое двигается впереди по той самой полосе, не подал сигнал о намерении поворота (перестраивание) налево;&amp;lt;br /&amp;gt;\r\n1.3 полоса встречного движения, на которую он будет выезжать, свободна от транспортных средств на достаточном для обгона расстоянии;&amp;lt;br /&amp;gt;\r\n1.4 после обгона сможет, не создавая препятствий обгоняемому им транспортному средству, вернуться на занимаемую полосу.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2. Водителю обгоняемого транспортного средства запрещается препятствовать обгону путем повышения скорости движения или иными действиями.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;3. Обгон запрещен:&amp;lt;br /&amp;gt;\r\n1.1 на мостах;&amp;lt;br /&amp;gt;\r\n1.2 на крутых поворотах;&amp;lt;br /&amp;gt;\r\n1.3 на участках дороги с ограниченным обзором или видимостью.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел VIII. Сигналы светофора.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.1. Немигающий красный.&amp;lt;br /&amp;gt;\r\nКрасный сигнал светофора означает &amp;amp;laquo;СТОП&amp;amp;raquo;. Вы можете проехать на красный свет светофора после того, как остановитесь и уступите дорогу пешеходам, велосипедистам и транспортным средствам, которые находятся в достаточной близости для того, чтобы представлять угрозу. Совершайте проезд только тогда, когда это безопасно.&amp;lt;br /&amp;gt;\r\n1.2. Красная стрелка.&amp;lt;br /&amp;gt;\r\nКрасная стрелка означает &amp;amp;laquo;СТОП&amp;amp;raquo;. Не начинайте двигаться до тех пор, пока не появится зеленый сигнал в виде стрелки.Совершать поворот при горящей красной стрелке запрещено. Мигающий красный.&amp;lt;br /&amp;gt;\r\n1.3. Мигающий красный.&amp;lt;br /&amp;gt;\r\nМигающий красный сигнал означает &amp;amp;laquo;СТОП&amp;amp;raquo;. После остановки продолжайте движение, если это безопасно. Соблюдайте правила преимущественного проезда.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.1. Немигающий желтый.&amp;lt;br /&amp;gt;\r\nЖелтый сигнал светофора означает &amp;amp;laquo;ВНИМАНИЕ&amp;amp;raquo;.Сейчас загорится красный сигнал. Если вы видите желтый сигнал, вы должны остановиться, если это не создаст опасную ситуацию. Если вы не можете остановиться, не создавая опасной ситуации, осторожно выезжайте на перекресток.&amp;lt;br /&amp;gt;\r\n2.2. Желтая стрелка.&amp;lt;br /&amp;gt;\r\nЖелтая стрелка означает, что время &amp;amp;laquo;разрешенного&amp;amp;raquo; поворота заканчивается. Будьте готовы выполнить действие согласно следующему сигналу, который может быть зеленым или красным сигналом, либо красной стрелкой.&amp;lt;br /&amp;gt;\r\n2.3. Мигающий желтый.&amp;lt;br /&amp;gt;\r\nМигающий желтый сигнал предупреждает вас о необходимости соблюдать осторожность. Вам не нужно останавливаться на желтый сигнал светофора, но вы должны снизить скорость и быть особенно внимательны перед въездом на перекресток.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;3.1. Немигающий зеленый.&amp;lt;br /&amp;gt;\r\nЗеленый сигнал означает &amp;amp;laquo;ПРОЕЗД РАЗРЕШЕН&amp;amp;raquo;, но, прежде чем продолжать движение, вам следует пропустить другие транспортные средства, велосипедистов или пешеходов, остающихся на перекрестке. Если вы поворачиваете налево, совершайте поворот только в том случае, когда у вас есть достаточно пространства для безопасного завершения маневра перед встречными транспортными средствами, велосипедистами или пешеходами. Не выезжайте на перекресток, если вы не успеете пересечь его, прежде чем сигнал светофора переключится на красный. Если вы заблокируете перекресток, вы можете быть привлечены к ответственности.&amp;lt;br /&amp;gt;\r\n3.2. Зеленая стрелка.&amp;lt;br /&amp;gt;\r\nЗеленая стрелка означает &amp;amp;laquo;ПРОЕЗД РАЗРЕШЕН&amp;amp;raquo;. Поворачивайте в направлении, указанном стрелкой, но, прежде чем продолжать движение, пропустите транспортные средства, велосипедистов и прохожих, остающихся на перекрестке.&amp;lt;br /&amp;gt;\r\nЗеленая стрелка позволяет вам выполнить &amp;amp;laquo;разрешенный&amp;amp;raquo; поворот. Пока горит зеленая стрелка, встречные транспортные средства, велосипедисты и пешеходы не движутся, остановленные красным сигналом.&amp;lt;br /&amp;gt;\r\n4. Выключенный сигнал светофора.&amp;lt;br /&amp;gt;\r\nЕсли светофор не работает, действуйте точно так же, как в том случае, когда перекресток регулируется знаками обязательной остановки во всех направлениях.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел IX. Полосы движения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1. Цвета линий разметки:&amp;lt;br /&amp;gt;\r\n1.1. Сплошные желтые линии отмечают среднюю линию дороги с двусторонним движением;&amp;lt;br /&amp;gt;\r\n1.2. Прерывистые желтые линии означают, что обгон разрешен, если линия расположена со стороны вашей полосы движения;&amp;lt;br /&amp;gt;\r\n1.3. Двойные сплошные желтые линии означают, что обгон запрещен;&amp;lt;br /&amp;gt;\r\n1.4. Сплошные белые линии означают движение потока транспорта в одном направлении, как на улицах с односторонним движением;&amp;lt;br /&amp;gt;\r\n1.5. Прерывистые белые линии разделяют полосы движения на дорогах с двумя или более полосами движения в одном направлении.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2. Никогда не заезжайте за расположенные слева двойные сплошные желтые линии, кроме случаев когда:&amp;lt;br /&amp;gt;\r\n- вы поворачиваете налево на перекрестке;&amp;lt;br /&amp;gt;\r\n- вы въезжаете на частную дорогу или подъездную дорожку или выезжаете с частной дороги или подъездной дорожки;&amp;lt;br /&amp;gt;\r\n- вы едете по полосам для транспорта с пассажирами, размеченные въезды на которые расположены слева;&amp;lt;br /&amp;gt;\r\n- вы получили указание от офицера проезжать по противоположной стороне дороги, так как ваша сторона закрыта или заблокирована.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;3. Две сплошные двойные желтые линии, расположенные на расстоянии двух или более футов (0,6 м) друг от друга, считаются барьером. Запрещается проезжать по барьеру или переезжать через барьер, либо выполнять поворот налево или разворот через барьер, кроме как в предназначенных для этого разрывах.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;4. Перестраивание из полосы в полосу.&amp;lt;br /&amp;gt;\r\n4.1. Перестраивание из полосы в полосу включает в себя:&amp;lt;br /&amp;gt;\r\n- перемещение между полосами;&amp;lt;br /&amp;gt;\r\n- въезд на автомагистраль с эстакады;&amp;lt;br /&amp;gt;\r\n- въезд на дорогу с бордюра или обочины.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;4.2. Перед перестраиванием из одной полосы в другую посмотрите в зеркала заднего вида и:&amp;lt;br /&amp;gt;\r\n- проверьте, как движется транспорт позади и рядом с вами;&amp;lt;br /&amp;gt;\r\n- посмотрите назад через левое или правое плечо, чтобы убедиться в том, что полоса, на которую вы собираетесь перестроиться, свободна;&amp;lt;br /&amp;gt;\r\n- убедитесь в отсутствии транспортных средств и мотоциклистов в мертвых зонах вашего обзора;&amp;lt;br /&amp;gt;\r\n- убедитесь в том, что на соседней полосе имеется достаточно пространства для вашего транспортного средства.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел X. Полосы обгона.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.1. Перед выполнением обгона обратите внимание на дорожную обстановку и транспортный поток впереди вас, так как возможно, что впереди идущие транспортные средства будут вынуждены перестраиваться в вашу полосу.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.2. Во время обгона никогда не выезжайте за пределы дорожного покрытия или проезжей части дороги или на обочину. Край проезжей части дороги обозначен белой линией, нанесенной на дорожное покрытие. На перекрестках, железнодорожных переездах и въездах на территорию торговых центров совершать обгон транспортных средств опасно.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.3. Обгон следует совершать слева. Обгон справа разрешен только в следующих случаях:&amp;lt;br /&amp;gt;\r\n- если открытая магистраль четко размечена на две или более полосы для движения транспорта в вашем направлении;&amp;lt;br /&amp;gt;\r\n- если водитель движущегося впереди транспортного средства совершает левый поворот и вы не съезжаете с проезжей части.&amp;lt;br /&amp;gt;\r\nНикогда не обгоняйте слева, если водитель подает сигнал левого поворота.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел XI. Система штрафов.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 1. Управление транспортным средством без водительской лицензии соответствующей категории.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф в размере $250 с вызовом эвакуатора.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 2. Управление транспортным средством с тяжелыми повреждениями.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф в размере $300 с вызовом эвакуатора.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 3. Управление транспортным средством с выключенными фарами в ночное время.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф в размере $100 и препятствие движению до наступления утра и/или эвакуация.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 4. Переход в неположенном месте.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф в размере $100.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 5. Создание помех в движении транспортных средств.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф в размере $500.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 6. Передача транспортного средства лицу, не имеющему лицензии на его управление.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф в размере $2.000 с изъятием водительской лицензии у фигуранта дела и возмещение любого нанесенного водителем без лицензии ущерба.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 7. Выезд на встречную полосу и/или пересечение двойной сплошной линии. (В том числе задним ходом)&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф в размере $500 и возмещение любого ущерба пострадавших от халатности лица водителей других транспортных средств.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 8. Движение в неположенном месте (тротуары, бордюры, парки, газоны, пляжи).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф в размере $500.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Примечание 1: Если движение в неположенном месте вызывает ДТП - виновный обязан оплатить расходы на ремонт транспортного средства пострадавшего.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 9. Превышение скоростного режима.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;9.1. Превышение скорости от 1 mp/h (1 km/h) до 20 mp/h (32 km/h).&amp;lt;br /&amp;gt;\r\n- Штраф в размере $1.500.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;9.2. Превышение скорости от 21 mp/h (34 km/h) до 60 mp/h (96 km/h).&amp;lt;br /&amp;gt;\r\n- Штраф в размере $5.000.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;9.3. Превышение скорости от 61 mp/h (98 km/h) и выше.&amp;lt;br /&amp;gt;\r\n- Штраф в размере $10.000.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 10. Участие в ДТП (в роли виновника).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф в размере $300 и с полной оплатой ущерба пострадавшему лицу.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 11. Парковка или остановка в неположенном месте.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф в размере $400 и эвакуация транспортного средства.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Примечание 1: Неположенным местом считается красная/желтая линия вдоль бордюра, желтые пометки с запретом на асфальте, и/или частная территория/территория государственных организаций и/или тротуары, бордюры, парки, газоны, пляжи, пешеходные переходы.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 12. Игнорирование стробоскопов и сирен автомобилей правопорядка и службы спасения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф в размере $250.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 13. Управление транспортным средством в алкогольном или наркотическом опьянении.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф в размере $1.000, изъятие водительской лицензии.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 14. Проезд на запрещающий (красный) свет светофора.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф в размере $350.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Примечание 1: В случае, если проезд на красный свет создал угрозу другому транспортному средству - дополнительно виновный покрывает расходы на ремонт транспортного средства пострадавшего и лечение.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 15. Нарушение движения организованной транспортной колонны.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф в размере $5.000 с изъятием водительской лицензии.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Примечание 1: Нарушение, включающее в себя использование оружия или агрессию также принимает на себя уголовный характер.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 16. Опасное вождение.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф от $500 до $2.000 с изъятием водительской лицензии.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Примечание 1: Запрещается водителю опасное вождение, выражающееся в неоднократном совершении одного или нескольких следующих друг за другом действий, если эти действия повлекли создание водителем в процессе дорожного движения ситуации, при котором его движение и (или) движение других водителей в том же направлении и с той же скоростью создаёт угрозу гибели или ранения людей, уничтожении или порчи имущества.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 17. Осознанное блокирование дороги и/или создание задержки движения других транспортных средств.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф до $2.000 с изъятием водительской лицензии.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Примечание 1: Штраф относится в том числе к водному транспорту, если тот закрывает торговые пути или любые въезды/выезды в каналы или причалы лодочных станций.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 18. Посадка в неположенном месте.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф до $7.000 с изъятием лицензии на полеты.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Примечание 1: Посадкой в неположенном месте считается посадка частного лица или негосударственной организации на воздушном транспортном средстве на территориях государственных организаций, в местах проведения боевых действий любого вида или на дорогах (и других местах, где посадка может совершить препятствие), а также крышах частной собственности без согласия частных лиц).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Примечание 2: Экстренная посадка в неположенном месте разрешена представителям правоохранительных органов или служб спасения исключительно в служебных целях.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 19. Запрещено ездить на не-предусмотренных для того производителем авто местах, даже если физически нахождение в транспорте вне водительского/пассажирских сидений возможно.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Примечание 1: Кроме случаев перевозки людей в кузове грузового автомобиля с бортовой платформой или в кузове-фургоне.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;- Штраф до $5.000 с изъятием водительской лицензии у водителя.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n');
INSERT INTO `rp_rules` VALUES (9, 'Кодекс Этики', '&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Кодекс этики&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Статья 1. Общие положения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.1. Кодекс этики и служебного поведения государственных служащих&amp;amp;nbsp;&amp;amp;nbsp;разработан в соответствии с Конституцией штата San Andreas и законами штата San Andreas.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.2. Кодекс представляет собой свод общих принципов профессиональной служебной этики и основных правил служебного поведения, которыми должны руководствоваться государственные служащие, независимо от занимаемой ими должности.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.3. Гражданин Соединённых Штатов, поступающий на государственную службу, обязан ознакомиться с положениями Кодекса и соблюдать их в процессе своей служебной деятельности.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.4. Каждый государственный служащий должен принимать все необходимые меры для соблюдения положений Кодекса, а каждый гражданин США вправе ожидать от государственного служащего поведения в отношениях с ним в соответствии с положениями Кодекса.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.5. Целью Кодекса является установление этических норм и правил служебного поведения государственных служащих для достойного выполнения ими своей профессиональной деятельности, а также содействие укреплению авторитета государственных служащих, доверия граждан к государственным органам и обеспечение единых норм поведения государственных служащих.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.6. Кодекс призван повысить эффективность выполнения государственными служащими своих должностных обязанностей.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.7. Кодекс служит основой для формирования должной морали в сфере государственной службы, уважительного отношения к государственной службе в общественном сознании, а также выступает как институт общественного сознания и нравственности государственных служащих, их самоконтроля.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.8. Знание и соблюдение государственными служащими положений Кодекса является одним из критериев оценки качества их профессиональной деятельности и служебного поведения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 2. Основные принципы и правила служебного поведения государственных служащих.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.1. Государственные служащие, сознавая ответственность перед государством, обществом и гражданами, призваны:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Исполнять должностные обязанности добросовестно и на высоком профессиональном уровне в целях обеспечения эффективной работы государственного аппарата США.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Исходить из того, что признание, соблюдение и защита прав и свобод человека и гражданина определяют основной смысл и содержание деятельности как государственных органов, так и государственных служащих.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Осуществлять свою деятельность в пределах своих полномочий.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Не оказывать предпочтения каким-либо профессиональным или социальным группам и организациям, быть независимыми от влияния отдельных граждан, профессиональных или социальных групп и организаций.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Исключать действия, связанные с влиянием каких-либо личных, имущественных (финансовых) и иных интересов, препятствующих добросовестному исполнению ими должностных обязанностей.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Уведомлять органы инспектората или другие государственные органы обо всех случаях обращения к государственному служащему каких-либо лиц в целях склонения к совершению коррупционных правонарушений.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Соблюдать установленные федеральными законами ограничения и запреты, исполнять обязанности, связанные с прохождением государственной службы.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Соблюдать беспристрастность, исключающую возможность влияния на их служебную деятельность решений политических партий и общественных объединений.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Соблюдать нормы служебной, профессиональной этики и правила делового поведения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Проявлять корректность и внимательность в обращении с гражданами и должностными лицами.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Проявлять терпимость и уважение к обычаям и традициям различных этнических, социальных групп, учитывать культурные и иные особенности различных этнических, социальных групп и конфессий, способствовать межнациональному и межконфессиональному согласию.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Воздерживаться от поведения, которое могло бы вызвать сомнение в добросовестном исполнении государственными служащими должностных обязанностей, а также избегать конфликтных ситуаций, способных нанести ущерб их репутации или авторитету Государственного аппарата США.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Принимать предусмотренные законодательством штата меры по недопущению возникновения конфликтов интересов и урегулированию возникших конфликтов интересов.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Не использовать служебное положение для оказания влияния на деятельность государственных органов и органов местного самоуправления, организаций, должностных лиц, федеральных государственных служащих и граждан при решении вопросов личного характера.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Воздерживаться от публичных высказываний, суждений и оценок в отношении деятельности Государственного аппарата США, если это не входит в должностные обязанности государственного служащего.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Соблюдать установленные в системе Государственного аппарата правила публичных выступлений и предоставления служебной информации.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Уважительно относиться к деятельности представителей средств массовой информации по информированию общества о работе Государственного аппарата США, а также оказывать содействие в получении достоверной информации в установленном порядке.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.2. Государственные служащие обязаны соблюдать Конституцию США, федеральные конституционные законы, федеральные законы, иные нормативные правовые акты Соединённых Штатов Америки и штата Сан-Андреас.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.3. Государственные служащие в своей деятельности не должны допускать нарушения законов и иных нормативных правовых актов исходя из политической, экономической целесообразности либо по иным мотивам.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.4. Государственные служащие обязаны противодействовать проявлениям коррупции и предпринимать меры по ее профилактике в порядке, установленном законодательством Соединённых Штатов Америки.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.5. Государственные служащие при исполнении ими должностных обязанностей не должны допускать личной заинтересованности, которая приводит или может привести к конфликту интересов.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;При назначении на должность государственной службы и исполнении должностных обязанностей Государственным служащий обязан заявить о наличии или возможности наличия у него личной заинтересованности, которая влияет или может повлиять на надлежащее исполнение им должностных обязанностей.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.6. Государственный служащий обязан представлять сведения о доходах, об имуществе и обязательствах имущественного характера своих и членов своей семьи в соответствии с законодательством Соединённых Штатов Америки&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.7. Государственный служащий обязан уведомлять органы инспектората США или другие государственные органы обо всех случаях обращения к нему каких-либо лиц в целях склонения его к совершению коррупционных правонарушений.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Уведомление о фактах обращения в целях склонения к совершению коррупционных правонарушений, за исключением случаев, когда по данным фактам проведена или проводится проверка, является должностной обязанностью&amp;amp;nbsp;&amp;amp;nbsp;государственного служащего.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.8. Государственному служащему запрещается получать в связи с исполнением им должностных обязанностей вознаграждения от физических и юридических лиц (подарки, денежное вознаграждение, ссуды, услуги материального характера, оплату за развлечения, отдых, за пользование транспортом и иные вознаграждения). Подарки, полученные государственными служащим в связи с протокольными мероприятиями, со служебными командировками и с другими официальными мероприятиями, признаются соответственно федеральной собственностью и передаются государственным служащим по акту в Государственный аппарат, за исключением случаев, установленных законодательством США.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.9. Государственный служащий может обрабатывать и передавать служебную информацию при соблюдении действующих в Государственном аппарате норм и требований, принятых в соответствии с законодательством США.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.10. Государственный служащий обязан принимать соответствующие меры для обеспечения безопасности и конфиденциальности информации, за несанкционированное разглашение которой он несет ответственность или (и) которая стала известна ему в связи с исполнением должностных обязанностей.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.11. Государственный служащий, наделенный организационно-распорядительными полномочиями по отношению к другим федеральным государственным служащим, должен быть для них образцом профессионализма, безупречной репутации, способствовать формированию в органах правопорядка благоприятного для эффективной работы морально-психологического климата.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.12. Государственный служащий, наделенный организационно-распорядительными полномочиями по отношению к другим федеральным государственным служащим, призван:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Принимать меры по предотвращению и урегулированию конфликтов интересов.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Принимать меры по предупреждению коррупции.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Не допускать случаев принуждения государственных служащих к участию в деятельности политических партий, иных общественных объединений.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.13. Государственный служащий, наделенный организационно-распорядительными полномочиями по отношению к другим федеральным государственным служащим, должен принимать меры к тому, чтобы подчиненные ему сотрудники не допускали коррупционно-опасного поведения, своим личным поведением подавать пример честности, беспристрастности и справедливости.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.14. Государственный служащий, наделенный организационно-распорядительными полномочиями по отношению к другим федеральным государственным служащим, несет ответственность в соответствии с законодательством США за действия или бездействия подчиненных сотрудников, нарушающих принципы этики и правила служебного поведения, если он не принял мер, чтобы не допустить таких действий или бездействий.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 3. Рекомендательные этические правила служебного поведения Государственных служащих.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;3.1. В служебном поведении государственному служащему необходимо исходить из конституционных положений о том, что человек, его права и свободы являются высшей ценностью и каждый гражданин имеет право на неприкосновенность частной жизни, личную и семейную тайну, защиту чести, достоинства, своего доброго имени.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;3.2. В служебном поведении государственный служащий обязан воздерживаться от:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;o&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;любого вида высказываний и действий дискриминационного характера по признакам пола, возраста, расы, национальности, языка, гражданства, социального, имущественного или семейного положения, политических или религиозных предпочтений;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Грубости, проявлений пренебрежительного тона, заносчивости, предвзятых замечаний, предъявления неправомерных, незаслуженных обвинений.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Угроз, оскорбительных выражений или реплик, действий, препятствующих нормальному общению или провоцирующих противоправное поведение.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;bull;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;Курения во время служебных совещаний, бесед, иного служебного общения с гражданами.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;3.3. Государственные служащие призваны способствовать своим служебным поведением установлению в коллективе деловых взаимоотношений и конструктивного сотрудничества друг с другом.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Государственные служащие должны быть вежливыми, доброжелательными, корректными, внимательными и проявлять терпимость в общении с гражданами и коллегами.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;3.4. Внешний вид государственного служащего при исполнении им должностных обязанностей в зависимости от условий службы и формата служебного мероприятия должен способствовать уважительному отношению граждан к федеральным органам исполнительной власти, соответствовать общепринятому деловому стилю, который отличают официальность, сдержанность, традиционность, аккуратность.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 4. Ответственность за нарушение Кодекса&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;4.1. Нарушение государственный служащим положений Кодекса подлежит моральному осуждению на заседании комиссии по соблюдению требований к служебному поведению федеральных государственных служащих и урегулированию конфликта интересов, а в случаях, предусмотренных федеральными законами, нарушение положений Кодекса влечет применение к государственному служащему мер юридической ответственности.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n');
INSERT INTO `rp_rules` VALUES (10, 'Трудовой Кодекс', '&amp;lt;p&amp;gt;Трудовой кодекс является специфическим юридическим документом, который посвящен взаимоотношениям двух субъектов - работника и работодателя. Это означает, что данный кодекс посвящён реализации только одного конституционного права граждан - права на труд.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Раздел I. Основные положения.&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nПункт 1. Статус трудового кодекса.&amp;lt;br /&amp;gt;\r\nТак же, как и все кодифицированные документы, Трудовой кодекс Сан Андреас имеет статус федерального закона, обязательного для выполнения на всей территории штата Сан Андреас. Все остальные нормативные акты, которые, так или иначе, затрагивают тему взаимоотношений работодателей и работников, могут развивать и дополнять Трудовой кодекс. Однако, они не должны противоречить любым его положениям. Кроме того, существует приоритет данного кодекса перед всеми остальными нормативными актами федерального уровня, которые затрагивают трудовые взаимоотношения разных субъектов права. Если сходные положения существуют, например, в гражданском и трудовом кодексах, то руководствоваться следует последним. Обычно в нормативных актах одного иерархического уровня таких противоречий не встречается. Они просто друг друга дополняют и развивают.&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nПункт 2. Основные принципы.&amp;lt;br /&amp;gt;\r\nТрудовая деятельность каждым человеком осуществляется в двух вариантах &amp;amp;ndash; по заказу другого лица с договорной оплатой или по собственной инициативе и без оплаты труда. Несмотря на то, что в результате &amp;amp;laquo;работы на себя&amp;amp;raquo; человек получает выгоду и прибыль, это нельзя назвать оплатой труда. Трудовые отношения возникают только в том случае, если один человек выполняет работу для работодателя за плату. Именно такой труд, а точнее сопровождающие его отношения, и отражены в Трудовом кодексе Сан Андреас.&amp;lt;br /&amp;gt;\r\nДанный нормативный документ построен по следующим параметрам:&amp;lt;br /&amp;gt;\r\na) равенства всех работников;&amp;lt;br /&amp;gt;\r\nb) свободного выбора характера профессиональной деятельности;&amp;lt;br /&amp;gt;\r\nc) запрета на труд по принуждению, то есть против воли человека и без соответствующей оплаты;&amp;lt;br /&amp;gt;\r\nd) обеспечения безопасности условий труда;&amp;lt;br /&amp;gt;\r\ne) предоставления сторонам трудовых отношений возможности организовывать объединения для защиты своих прав;&amp;lt;br /&amp;gt;\r\nf) обеспечения возможности участия сотрудников в процессе управления учреждением;&amp;lt;br /&amp;gt;\r\ng) сочетания двух форм регулирования трудовых отношений &amp;amp;ndash; договорных и государственных;&amp;lt;br /&amp;gt;\r\nh) осуществления государственного контроля в области трудовых отношений;&amp;lt;br /&amp;gt;\r\ni) возмещения вреда, причиненного человеку во время исполнения им своих обязанностей;&amp;lt;br /&amp;gt;\r\nj) обеспечения возможности по защите интересов всех сторон.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 3. Цели и задачи.&amp;lt;br /&amp;gt;\r\nЦели трудового законодательства штата Сан Андреас, выражены в следующем:&amp;lt;br /&amp;gt;\r\na) установление государственных гарантий трудовых прав и свобод граждан;&amp;lt;br /&amp;gt;\r\nb) создание благоприятных условий труда;&amp;lt;br /&amp;gt;\r\nc) защита прав и интересов работников и работодателей.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 4. Государственной организацией признается та организация, которая финансируется правительством на постоянной основе.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Раздел II. Статьи трудового кодекса.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 1. Принудительный труд.&amp;lt;br /&amp;gt;\r\nШтат Сан Андреас гарантирует свободу труда, включая право на труд, который каждый свободно выбирает или на который свободно соглашается, право распоряжаться своими способностями к труду, выбирать профессию и род деятельности. Запрещен принудительный труд и дискриминации в сфере труда.&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nСтатья 2. Равенство прав и возможностей работников.&amp;lt;br /&amp;gt;\r\n2.1. Запрещено необоснованно и бездоказательно увольнять работника.&amp;lt;br /&amp;gt;\r\n2.2. Запрещено необоснованно и бездоказательно штрафовать работника.&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nСтатья 3. Трудовой договор и должностные инструкции.&amp;lt;br /&amp;gt;\r\nСтороны трудового договора обязаны соблюдать условия заключенного договора, включая право работодателя требовать от работников исполнения ими трудовых обязанностей, бережного отношения к имуществу работодателя, право работников требовать от работодателя соблюдения его обязанностей по отношению к работникам, трудового законодательства и иных актов, содержащих нормы трудового права. Работодатель обязан иметь и хранить трудовой договор с каждым работником, локальные нормативные акты о принципах повышения, а также иметь должностные инструкции, которые регулируют обязанности работника и его заработную плату.&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nСтатья 4. Юридическая защита.&amp;lt;br /&amp;gt;\r\nОбеспечение права каждого на защиту государством его трудовых прав и свобод, включая судебную защиту. В случае возникновения трудовых споров гражданин штата вправе запросить государственного или частного адвоката для защиты прав и интересов работника.&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nСтатья 5. Забастовки.&amp;lt;br /&amp;gt;\r\nРаботники имеют право на разрешение индивидуальных и коллективных трудовых споров, а также право на забастовку. Сотрудникам государственных организаций запрещается проводить забастовки в ночное время, с 22:00 до 06:00.&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nСтатья 6. Контроль.&amp;lt;br /&amp;gt;\r\nПредставители государственной инспекции имеют право при наличии веских оснований осуществлять контроль за соблюдением трудового законодательства и иных актов, содержащих нормы трудового права.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Статья 7. Дисциплинарные наказания.&amp;lt;br /&amp;gt;\r\n7.1. При наложении дисциплинарного взыскания должны учитываться тяжесть совершенного проступка и обстоятельства, при которых он был совершен.&amp;lt;br /&amp;gt;\r\n7.2. За совершение дисциплинарного проступка, то есть неисполнение или ненадлежащее исполнение работником по его вине возложенных на него трудовых обязанностей, работодатель имеет право применить следующие дисциплинарные взыскания:&amp;lt;br /&amp;gt;\r\n-Замечание.&amp;lt;br /&amp;gt;\r\n-Выговор.&amp;lt;br /&amp;gt;\r\n-Увольнение по соответствующим основаниям.&amp;lt;br /&amp;gt;\r\n7.3. Виды нарушений:&amp;lt;br /&amp;gt;\r\n-Несоблюдение обязанностей.&amp;lt;br /&amp;gt;\r\n-Неподчинение.&amp;lt;br /&amp;gt;\r\n-Систематический прогулы.&amp;lt;br /&amp;gt;\r\n7.4. Процессуальные процедуры дисциплинарных взысканий:&amp;lt;br /&amp;gt;\r\n-При слабом нарушении выдается замечание. Два замечания приравнивается к выговору.&amp;lt;br /&amp;gt;\r\n-При строгом нарушении выдается выговор. При получении 3 выговоров работодатель имеет право уволить сотрудника.&amp;lt;br /&amp;gt;\r\n-При нарушении законодательства штата или большими систематическими прогулами, работодатель имеет право уволить сотрудника в связи с утратой доверия.&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nСтатья 8. Штрафы.&amp;lt;br /&amp;gt;\r\n8.1. При необоснованном увольнении сотрудника работодатель обязан выполнить следующие пункты:&amp;lt;br /&amp;gt;\r\n-Восстановить в должности работника.&amp;lt;br /&amp;gt;\r\n-Выплатить моральную компенсацию работнику в размере $25.000.&amp;lt;br /&amp;gt;\r\n-Выплатить штраф в размере $100.000 в пользу государства.&amp;lt;br /&amp;gt;\r\n8.2. При отсутствии нормативных документов: трудовые договора, должностные инструкции, локального акта о порядке повышения сотрудников:&amp;lt;br /&amp;gt;\r\n-При первичном нарушении устранить в 4-х недельный срок допущенные нарушения.&amp;lt;br /&amp;gt;\r\n-При вторичном и последующих злостных нарушениях работодатель обязан выплатить штраф в пользу государства в размере $50.000, и устранить в течении 2-х недельного срока по окончании, которого может последовать повторная проверка.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Раздел III. Черный список государственных организаций.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 1. Правила внесения в черный список государственных организаций.&amp;lt;br /&amp;gt;\r\n1.1. Данная мера, как внесение в черный список государственных организаций назначается в качестве основного или дополнительного вида наказания с учетом характера и степени общественной опасности совершенного преступления.&amp;lt;br /&amp;gt;\r\n1.2. Решение о внесении в черный список государственных структур принимается главой государственной организации, в которой состоит гражданин.&amp;lt;br /&amp;gt;\r\n1.3. После внесения в черный список государственных организаций гражданина увольняют из неё.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 2. Сроки нахождения в черном списке государственной организации.&amp;lt;br /&amp;gt;\r\nСроки нахождения в черном списке государственной организации могут быть установлены:&amp;lt;br /&amp;gt;\r\n2.1. В случаях, когда ограничение является основным видом наказания, назначается на срок от 1 месяца до 6 месяцев.&amp;lt;br /&amp;gt;\r\n2.2. В случаях, когда ограничение является дополнительным видом наказания, на срок от 3 месяцев до 9 месяцев.&amp;lt;br /&amp;gt;\r\n2.3. В случаях, когда совершенное преступления является общественно опасным или нанесло непоправимый ущерб государству, на срок от 5 лет до 10 лет.&amp;lt;br /&amp;gt;\r\n2.4. Срок нахождения в черном списке государственной организации начинается с момента внесения в черный список государственной организации.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Пункт 3. Правила исключения из черного списка государственной организации.&amp;lt;br /&amp;gt;\r\n3.1. Окончание установленного срока нахождения в черном списке государственной организации.&amp;lt;br /&amp;gt;\r\n3.2. Вынесение оправдательного приговора по судебному производству, в результате которого было принято решение о занесении в черный список государственной организации.&amp;lt;br /&amp;gt;\r\n3.3. В случае уплаты штрафа в бюджет организации, которая внесла в черный список, исходя из расчета 1 месяц = $100.000. Решение о предоставлении возможности частичного или полного снятия наказания, путем оплаты штрафа принимается главой государственной организации, от которой и был занесен в черный список.&amp;lt;/p&amp;gt;\r\n');
INSERT INTO `rp_rules` VALUES (11, 'Тюремный Закон', '&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Тюремный закон&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;br /&amp;gt;\r\n&amp;lt;strong&amp;gt;Статья 1. Основные положения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.1. Описание места тюремного заключения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Тюрьма Болингброук (англ. Bolingbroke Penitentiary) &amp;amp;mdash; федеральная тюрьма штата Сан-Андреас, расположенная в округе Лос-Сантос. Тюрьма находится недалеко от Шоссе 68, справа от Хармони. Территория тюрьмы имеет шестиугольную форму.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Периметр тюрьмы патрулируется&amp;amp;nbsp;&amp;amp;nbsp;шерифским департаментом округа Блэйн. У входа в тюрьму стоят вооруженные охранники, чтобы никто не пытался войти на территорию объекта. Эта тюрьма служит исправительной территорией для самых разных видов преступников штата, начиная от банальных воров и аферистов до убийц и террористов.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Особенно в тюрьме, в месте, где к порядку призывают отошедших от стандартов законопослушного населения, сами офицеры должны придерживаться максимальной субординации.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.2. Цель закона.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Тюремный закон создан для регулирования процедуры работы мест содержания заключенных штата Сан-Андреас, соблюдения работниками тюрьмы строгих принципов обращения с заключенными.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Тюремная система предполагает содержание заключенных в жестоких условиях, целиком ограничивая их от остального мира. Такие условия направлены на переучивание заключенных и приучение их к порядку под строгим надзором.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Примечание 1: К заключенным не применяется Конституция и Кодексы, учитывая, что нарушивший закон гражданин (или приезжий) самовольно отказывается от общедоступных общественных норм.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Примечание 2: Отмена применения к гражданам или приезжим конституционных прав не дает тюремного офицеру права на неадекватные и чрезмерно жестокие действия по отношению к заключенным. Степени наказания и ограничения указаны в представленном законе.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 2. Ранговая система тюрьмы Болингброук.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.1. Ранговая система тремного персонала.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Надзиратель - Начальник тюрьмы, имеющий полную власть над подвластными ему сотрудниками и всеми процессами, проходящими на территории тюрьмы.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Командующий офицер - представитель старшего офицерского состава. Напрямую отвечает за координацию действий службы охраны тюрьмы, организует смены и помогает реагировать на внеплановые происшествия. Имеет право назначать дополнительные наказания провинившимся, если те продолжают нарушать порядок в чертах тюрьмы.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Тюремный офицер - Обычный офицер, занимающийся охраной тюрьмы. Имеет немного больше полномочий, чем присылаемые на стажировку кадеты.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Кадет - основной юнит охраны, отправленный на обеспечение безопасности во время стажировки в Полицейской Академии.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.2. Субординация и соответствие занимаемой должности.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Общение со старшими по званию должно проходить в строгой и официальной форме. Офицер не имеет право употреблять нецензурные выражения или переходить на оскорбления. Офицер не имеет права перебивать своё начальство и идти наперекор прямым приказам руководства. Офицер обязан соблюдать максимально тактичный тип ведения диалога, вне зависимости от его социального статуса и личных связей с непосредственным начальником. В случае нарушения морально-этических кодексов, при общении с начальством, офицер может получить дисциплинарное взыскание в виде отстранения или увольнения. Помните это, при общении с вашим руководством.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 3. Обязательные требования по форме и снаряжению офицеров тюрьмы.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;3.1. Униформа тюремного офицера.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Униформа офицерам и служащим Тюрьмы предусматривается в таком-же формате, как и у остальных представителей Шерифского департамента округа Блэйн. Это сделано затем, чтобы на службу (кроме Смотрителя) могли передвигаться по необходимости любые юниты, работающие в департаменте.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;3.2. Снаряжение тюремного офицера.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Каждый офицер во время смены в тюрьме должен иметь при себе следующий инвентарь:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Полицейская дубинка с поперечной рукояткой;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Фонарик;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Tazer;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Пистолет Beretta (В том числе для кадетов);&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Дробовик (Начиная от офицеров);&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Карабин HK416 (Только в случае известной предполагаемой угрозы или для старших офицеров/Надзирателя)&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Винтовка L115A3 (Для офицеров-дозорных, в случае побега или явной угрозы жизни другому офицеру).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 4. Правила доступа к тюрьме.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;4.1. Правила доступа к тюрьме.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;К тюрьме непосредственно имеют доступ только представители Шерифского департаменты округа Блэйн. Другие государственные организации имеют право получить доступ к определенному участку Тюрьмы или всей тюрьме только с позволение Надзирателя (как в устной, так и в письменной форме). В случае отсутствия надзирателя -&amp;amp;nbsp;&amp;amp;nbsp;принимать решение о допуске может командующий офицер. Государственный инспекторат имеет доступ к тюрьме без разрешения руководства Тюрьмы, но с обязательным преждевременным оповещением (минимум 30 минут до визита). В случае визита инспектор должен обязательно сопровождаться тюремным офицером. При желании посетить внутренний двор тюрьмы инспектор сопровождается группой из трех тюремных офицеров. Частные лица или представители негосударственных организаций не имеют доступ к тюрьме не при каких обстоятельствах.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;4.2. Исключения в запрете доступа.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Адвокаты сторон (с позволения Надзирателя, сроком не более 1 часа в сутки или при наличии новых фактов в деле заключенного).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Члены семьи заключенных (После согласования с Надзирателем или Командующим офицером, сроком не более 30 минут).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Офицеры полицейского департамента при оказании поддержки в задержании преступников (срок не ограничен, до завершения операции).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 5. Права и обязанности персонала тюрьмы.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;5.1. Обязанности тюремного офицера.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Задача Надзирателя и любого его подчиненного на территории тюрьмы Болингброук - обеспечивать изолированность заключенных от остального мира и максимальное соблюдение внутренней дисциплины. В любое время суток на территории федеральной тюрьмы должно находиться не менее 1 офицера-капрала (или представителя более высокого ранга) и трех кадетов.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Надзиратель и офицеры должны следить за тем, чтобы заключенные находились в заключении, не предпринимали попыток побега, не создавали конфликтных или опасных для жизни ситуаций внутри тюрьмы (в том числе в камерах между друг другом).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Доклад о ситуации в федеральной тюрьме Болингброук должен передаваться по рации диспетчеру минимум раз в час, если нет происшествий. В случае происшествий доклад и запрос подкрепления подается немедленно. Случай бунта или побега расценивается как Код-3. В случае угрозы жизни любому из офицеров - как Код-3.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Офицер обязан сообщать другим силовым структурам о необходимости оказать поддержку, в случае, если Надзиратель или Командующий офицер не может силами своих подчиненных урегулировать ситуацию.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Офицеры обязаны обеспечивать периметр тюрьмы, соблюдать правила доступа и контролировать полную изолированность заключенных.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Примечание 1: Другие не указанные в процедуре правила регламентируются Конституцией и Кодексами Штата, за исключением человеческих прав, которые к заключенным не применяются.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;5.2. Права тюремного офицера.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Отдавать любые обоснованные приказы заключенным, в соответствии с регламентом департамента коррекции и конституцией США.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Потребовать покинуть территорию или держаться от себя в 5 метрах без объяснения причин.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Обыскивать заключенных и их камеры при любом подозрении на хранение последними любых запрещенных предметов.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Правомерно, в соответствии с регламентом и конституцией, применять все доступные и регламентированные меры принуждения к выполнению приказов заключённых и гражданских лиц.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-В целях сохранения жизни или здоровья другого тюремного офицера, а также при необходимости принимать дисциплинарные меры - применять силу (в том числе используя оружие) против заключенных. Летальное оружие используется только в крайнем случае, если неизбежна угроза жизни офицеру или предпринята попытка к бегству/проникновению.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Вызывать на поддержку представителей всех силовых структур штата при возникновении реальной угрозы (Код 3, Код 0).&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;5.3. Правила применения силы.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Стадии применения силы - это четкие рамки, выходить за которые можно лишь в самых крайних ситуациях.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;gt;Первая стадия - присутствие и устные команды. Команды должны быть четкими, понятными, грубыми.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;gt;Вторая стадия - физическое воздействие. До неё доходит лишь тогда, когда подозреваемый уже совершил или совершает преступление. Эта стадия включает в себя различного рода заломы, удушения и так далее. Главное - не покалечить подозреваемого и себя самого.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;gt;Третья стадия - средства личной самообороны. До неё доходит лишь тогда, когда подозреваемый начинает представлять угрозу работникам тюрьмы (Tazer, дубинка, перцовый спрей).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;amp;gt;Четвертая стадия - огнестрельное оружие. До неё доходит исключительно в крайних случаях.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;5.4. Правила обыска.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;При подозрении заключённого в хранении запрещенных предметов, офицер коррекции имеет права обыскивать заключенного без объяснения причин. Обыск может быть проведёт на месте. Заключённого следует прислонить лицом к стене, командой или физическим принуждением и в перчатках прохлопать всю робу от ног до шеи, а также дополнительно обыскать обувь, так как в именно в ней заключенные чаще всего хранят контрабанду.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 6. Права и обязанности заключенных.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;6.1. Обязанности заключенных.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Заключенный обязан целиком и полностью подчиняться тюремным офицерам и без вопросов и противодействия выполнять все задачи, приказы и поручения.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Заключенный обязан содержаться в обозначенной для него территории не нарушая ее границ.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Заключенный обязан при попадании в тюрьму сдать все нелегальные вещества или вооружение на утилизацию.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Заключенный обязан выполнять принудительные работы, если такое распоряжение поступает от командующего офицера или надзирателя.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Заключенный обязан уважительно относиться к тюремным офицерам.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;6.2. Права заключенного.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Заключенный имеет право после окончания заключения получить назад личные вещи за исключением нелегальных веществ и вооружения.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Заключенный имеет право на преждевременное освобождение, если может предоставить надзирателю или командующему офицеру важную для расследований информацию, которая может помочь в раскрытии более важных преступлений.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Заключенный имеет право на адвоката, уже находясь в тюрьме. Визиты адвоката описаны в соответствующем разделе.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Заключенный имеет право на прогулку во дворе тюрьмы.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;-Заключенный имеет право подавать иски в устной или письменной форме против тюремных офицеров надзирателю, если поведение тюремного офицера не обосновано и доказуемо.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n');
INSERT INTO `rp_rules` VALUES (12, 'Закон об оружии', '&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел I. Общие положения.&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nСтатья 1. Право на ношение оружия.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.1. Вторая поправка к Конституции позволяет гражданам США или приезжим в штате Сан Андреас иметь и носить оружие. Так как конституционные права граждан не могут быть нарушены, был утвержден настоящий Закон о контроле владения, хранения, ношения, применения оружия в штате Сан Андреас.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 2. Правила использования оружия для самообороны.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;2.1. Использование легального оружия гражданскими лицами в штате Сан Андреас разрешено только в целях самообороны и во время лицензионной охоты на животных в отведенных на то зонах.&amp;lt;br /&amp;gt;\r\n2.2. В случаях использования оружия в целях самообороны, гражданин обязан сразу после совершения данного действия информировать и вызвать на место происшествия правоохранительные органы, а также скорую помощь EMS, если в ходе самообороны нападающий, защищающийся либо любое третье лицо были ранены.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 3. Правила получения и аннулирования лицензии.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;3.1. Только граждане, которые успешно сдали экзамен на получение лицензии на владение и ношение оружия в S.A.P.D.* или S.A.S.D., могут хранить, носить и использовать в рамках закона оружие на территории штата Сан Андреас.&amp;lt;br /&amp;gt;\r\n3.2. Лицензия на оружие может быть аннулирована и изъята при задержании сотрудниками правоохранительных органов только в случае нарушения статей данного закона.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 4. Легальное оружие.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;4.1. Легальным оружием является только то, которое можно приобрести в лицензированных магазинах.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 5. Нелегальное оружие.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;5.1. Нелегальным оружием является то, которое нельзя приобрести в лицензированных магазинах. (Оружие спецслужб, правоохранительных департаментов, правительственных агентов и силовых структур)&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел II. Положение о самообороне.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 6. Защита своей жизни.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;6.1. Согласно Декларации Независимости США от 4 июля 1776 года, жизнь это важнейшее, чем наделен человек и государство обязано предоставлять гражданам иметь право на самооборону. Человек посягнувший на жизнь другого человека является преступником, поэтому граждане вправе защищать свою жизнь своим оружием и имеют право убить такого преступника без каких-либо дальнейших уголовных последствий. (Данная формулировка, тем не менее, должна быть доказуема со стороны персоны, применяющей оружие. Право на самооборону не распространяется на случаи нарушения стрелком конституции и кодексов/постановлений нынешнего штата. В таком случае открытие огня считается открытой агрессией).&amp;lt;br /&amp;gt;\r\n6.2. Правоохранительные органы обязаны проводить расследование по факту лишения человека жизни.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 7. Необходимая оборона.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;7.1. Самооборона и/или самозащита - ответные действия лица, предпринимаемые для обеспечения гражданских прав, нарушенных посягательством другого лица. Необходимой обороной считаются действия, направленные на пресечение противоправных действий иных лиц. Ни одно действие не может быть принято как необходимая оборона, если оно намеренно было сокрыто от представителей исполнительной власти штата лицом, его совершившим.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 8. Защита частной собственности.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;8.1. Граждане вправе защищать свое жилище от незаконных проникновений, и вправе использовать свое оружие для этого. Граждане убившие человека незаконно проникшего на территорию частной собственности, или угрожающего смертью на территории жилища, не несут уголовной ответственности.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 9. Разрешенное оружие.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;9.1. Гражданам разрешено использовать только неавтоматическое оружие в пределах города Лос Сантос.&amp;lt;br /&amp;gt;\r\n9.2. Крупнокалиберное и автоматическое оружие разрешено использовать только за пределами города Лос Сантос.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 10. Обнажение оружия.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;10.1. Гражданам запрещено обнажать и использовать оружие в общественных местах, кроме случаев самообороны, когда против гражданина совершается вооруженное нападение, либо когда гражданину угрожает безоружный человек имеющий физиологическую комплекцию позволяющую искалечить, или убить гражданина.&amp;lt;br /&amp;gt;\r\n10.2. Оружие обнажается только при явном наличии угрозы, предположение наличия угрозы не считается прямой угрозой. (Исключение - обнажение офицерами оружия во время рейдов и желтых/красных кодов).&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел III. Хранение оружия.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 11. Правила хранения оружия.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;11.1. Хранение оружия производится в сейфе, в заряженном состоянии и на предохранителе.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 12. Правила ношения оружия сотрудниками правоохранительных служб.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;12.1. Сотрудники правоохранительных служб при исполнении могут не ставить на предохранитель оружие во время ношения его в кобуре.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел IV. Положения для правоохранительных органов.&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nСтатья 13. Хранение нелегального оружия.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;13.1. Сотрудникам правоохранительных органов запрещено хранение, использование и коллекционирование любого нелегального оружия, вне зависимости от способа завладения таким вооружением.&amp;lt;br /&amp;gt;\r\n13.2. Нелегальное оружие сотрудник правоохранительных органов обязан сдать на хранение в камеру вещдоков.&amp;lt;br /&amp;gt;\r\n13.3. Сотрудникам правоохранительных органов запрещена продажа или дарение любого оружия. Продажа, попытка продажи, дарение влечет уголовную ответственность.&amp;lt;br /&amp;gt;\r\n13.4. Командир подразделения, зафиксировавший подобное преступление должен немедленно уволить такого сотрудника и занести в &amp;amp;ldquo;Черный список&amp;amp;rdquo; организации.&amp;lt;br /&amp;gt;\r\nПримечание 1: Сотрудниками специальных подразделений силовых структур (Tactical Division S.A.P.D./S.A.S.D. и Special Force U.S.M.C.) допускается ношение нелегального оружия, а также его применение в случае нахождения при исполнении.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел V. Спецвооружение.&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nСтатья 14. Использование спецвооружения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;14.1. Гражданским лицам запрещено использование, хранение и передача любого спецвооружения. (При нахождении такого вооружения гражданское лицо должно сообщать об этом в силовые структуры, но не забирать данное вооружение. В данном случае процесс будет считаться присвоением).&amp;lt;br /&amp;gt;\r\n14.2. Только сотрудникам правоохранительных органов разрешено использование спецвооружения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 15. Список спецвооружения.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;15.1. Специальным вооружением являются следующие предметы: тайзер (электрошокер), наручники, светошумовая граната, слезоточивый газ.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Раздел VI. Условия проведения экзамена.&amp;lt;br /&amp;gt;\r\n&amp;amp;nbsp;&amp;lt;br /&amp;gt;\r\nСтатья 16. Вопросы экзамена.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;16.1. Экзамен содержит вопросы из текущего Закона об Оружии.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Статья 17. Требования к получению лицензии.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;17.1. Для получения лицензии, сотрудник правоохранительной службы, принимающий экзамен, должен убедиться, что гражданин, сдающий тест, имеет при себе документ удостоверяющий его личность.&amp;lt;br /&amp;gt;\r\n17.2. Для получения лицензии, возраст гражданина должен быть старше восемнадцати полных лет и шести месяцев.&amp;lt;br /&amp;gt;\r\n17.3. Для получения лицензии, гражданин должен не иметь судимостей в течение последних десяти недель.&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;*SAPD - Департамент полиции города Лос Сантос&amp;lt;br /&amp;gt;\r\n*SASD - Департамент шерифа Округа Блейн&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\r\n');
INSERT INTO `rules` VALUES (1, 'Термины', '&lt;h5&gt;Основы игрового процесса:&lt;/h5&gt;\n&lt;span class=&quot;grey-text&quot;&gt;•&lt;/span&gt; RolePlay &lt;span class=&quot;green-text&quot;&gt;(сокр. RP)&lt;/span&gt; - Режим игры, где каждый игрок при регистрации выбирает личностные качества свойственные его персонажу и во время дальнейшего игрового процесса придерживается их. Личностные качества могут также меняться после каких-то событий в игровом процессе.\n&lt;span class=&quot;grey-text&quot;&gt;•&lt;/span&gt; Real Life setting &lt;span class=&quot;green-text&quot;&gt;(сокр. RL)&lt;/span&gt; - обусловленные рамки игры, в которых базируется весь игровой процесс. В нашем случае базируется на прототипе &quot;Реальной жизни&quot;.\n&lt;span class=&quot;grey-text&quot;&gt;•&lt;/span&gt; None RolePlay &lt;span class=&quot;green-text&quot;&gt;(сокр. nonRP)&lt;/span&gt; - Выполнение действий вне соответствии личностных качеств вашего персонажа.\n&lt;span class=&quot;grey-text&quot;&gt;•&lt;/span&gt; Unrealistic Behavior &lt;span class=&quot;green-text&quot;&gt;(сокр. UB)&lt;/span&gt; - Нереалистичное поведение внутри выбранного сеттинга.\n&lt;span class=&quot;grey-text&quot;&gt;•&lt;/span&gt; Зелёная зона &lt;span class=&quot;green-text&quot;&gt;(сокр. ЗЗ)&lt;/span&gt; - это место или территория, в которой запрещено совершить какое-либо преступление.\n&lt;span class=&quot;grey-text&quot;&gt;•&lt;/span&gt; Титульная территория &lt;span class=&quot;green-text&quot;&gt;(сокр. ТТ)&lt;/span&gt; - место которое является густонаселенной преступниками территорией.\n&lt;span class=&quot;grey-text&quot;&gt;•&lt;/span&gt; Проезд мимо &lt;span class=&quot;green-text&quot;&gt;(сокр. ПМ)&lt;/span&gt; - Мероприятие происходящее исключительно между бандами, с целью расправы над вражеской группировкой на их титульной территории.\n\n&lt;h5&gt;Общение:&lt;/h5&gt;\n&lt;span class=&quot;grey-text&quot;&gt;•&lt;/span&gt; In Character &lt;span class=&quot;green-text&quot;&gt;(сокр. IC)&lt;/span&gt; - Информация, относящаяся к RolePlay процессу. Произносимая или используемая непосредственно от лица игровых персонажей.\n&lt;span class=&quot;grey-text&quot;&gt;•&lt;/span&gt; Out Of Character &lt;span class=&quot;green-text&quot;&gt;(сокр. OOC)&lt;/span&gt; - Информация, не относящаяся к RolePlay процессу. Произносимая или используемая непосредственно от лица игрока.\n&lt;span class=&quot;grey-text&quot;&gt;•&lt;/span&gt; Metagаming &lt;span class=&quot;green-text&quot;&gt;(сокр. MG)&lt;/span&gt; - Использование OOC в IC. Когда ваш персонаж узнаёт информацию, которую никак не мог узнать доступными ему способами.\n\n&lt;h5&gt;Убийства:&lt;/h5&gt;\n&lt;span class=&quot;grey-text&quot;&gt;•&lt;/span&gt; Random Deathmatch &lt;span class=&quot;green-text&quot;&gt;(сокр. RDM)&lt;/span&gt; - Убийство / попытка убийства без основательной для этого IC причины.\n&lt;span class=&quot;grey-text&quot;&gt;•&lt;/span&gt; DriveBy &lt;span class=&quot;green-text&quot;&gt;(сокр. DB)&lt;/span&gt;  - Наезд транспортным средством на другого игрока с целью &quot;снять&quot; полоску хп (убить/оставить человека без сознания)\n&lt;span class=&quot;grey-text&quot;&gt;•&lt;/span&gt; Spawn Kill &lt;span class=&quot;green-text&quot;&gt;(сокр. SK)&lt;/span&gt; - Убийство / попытка убийства персонажей на месте их появления после их входа в игру (Respawn).\n&lt;span class=&quot;grey-text&quot;&gt;•&lt;/span&gt; Revenge Kill &lt;span class=&quot;green-text&quot;&gt;(сокр. RvK)&lt;/span&gt; - Убийство игрока по причине мести (сразу после того, как он убил вас).\n&lt;span class=&quot;grey-text&quot;&gt;•&lt;/span&gt; Repeat Kill &lt;span class=&quot;green-text&quot;&gt;(сокр. RK)&lt;/span&gt; - Намеренное убийство одного и того же игрока более одного раза.\n\n&lt;h5&gt;RolePlay команды:&lt;/h5&gt;\n/me - Описание действий вашего персонажа. (Пример: /me достаёт телефон и набирает номер. Carl Johnson достаёт телефон и набирает номер.)\n/do - Описание действий неодушевлённых предметов или явлений. Также используется для описания обстановки. (Пример: /do На столе лежит включённый телефон. (( На столе лежит включённый телефон. )) Carl Johnson)\n/try - Описание попытки действия вашего персонажа со случайным исходом. (Пример: /try попытался взломать замок. Carl Johnson попытался взломать замок. (Удачно))', 's3');
INSERT INTO `rules` VALUES (2, 'Общее', '&lt;h5&gt;Правила проекта APPI RolePlay&lt;/h5&gt;\r\nПравила проекта распространяются на всех зарегистрированных игроков без исключений.\r\nПри регистрации на серверах проекта, игрок ставя галочку в меню регистрации соглашается с соблюдением данных правил.\r\nЕсли против вас было совершено действие нарушающее правила сервера - это не даёт вам право нарушать правила в ответ.\r\n\r\n&lt;h5&gt;ГЛАВА I. Правила регистрации&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;1.1&lt;/span&gt; Игровой никнейм должен состоять из полного Имени и Фамилии (Пример: Sam Houser).\r\n&lt;span class=&quot;grey-text&quot;&gt;1.2&lt;/span&gt; Запрещено использование никнеймов содержащие символы, цифры, отличные от латинского алфавита.\r\n&lt;span class=&quot;grey-text&quot;&gt;1.3&lt;/span&gt; Запрещено использование сокращений в никнеймах.\r\n&lt;span class=&quot;grey-text&quot;&gt;1.4&lt;/span&gt; Запрещено умышленное использование никнеймов, схожими с никнеймами уже использующимся на сервере, в том числе и никнеймы Администрации проекта.\r\n&lt;span class=&quot;grey-text&quot;&gt;1.5&lt;/span&gt;. Запрещено использование никнеймов, содержащих нецензурную лексику или завуалированное оскорбление других игроков/администрации.\r\n\r\n&lt;h5&gt;ГЛАВА II. Администрация&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;2.1&lt;/span&gt; Администрация наказывает игроков только по жалобам в /report.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Нарушение правил в Зеленой зоне.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Криминальные мероприятия Pounder, Mule, Война за С4 и ночные грузы.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;2.2&lt;/span&gt; Перед телепортом на репорт, администратор обязан оповестить игрока об этом путем ответа. (+, лечу, наблюдаю).\r\n&lt;span class=&quot;grey-text&quot;&gt;2.3&lt;/span&gt; Запрещено снимать/заменять наказания, выданные другим администратором.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Снятие/замена наказания по просьбе администратора.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;2.4&lt;/span&gt; Запрещено выдавать наказания по доказательствам, которые предоставили в личные сообщения/сторонние ресурсы.\r\n&lt;span class=&quot;grey-text&quot;&gt;2.5&lt;/span&gt; Администраторы 1-3 (Game Engineering, Game Moderator) уровней обязаны хранить доказательства нарушений игроков в течении 24 часов.\r\n&lt;span class=&quot;grey-text&quot;&gt;2.6&lt;/span&gt; Запрещено спавнить транспорт в людных местах, не имея на то причины.\r\n&lt;span class=&quot;grey-text&quot;&gt;2.7&lt;/span&gt; Администратору запрещено разглашать информацию полученную из закрытых дискорд чатов/голосовых каналов.\r\n&lt;span class=&quot;grey-text&quot;&gt;2.8&lt;/span&gt; Запрещено хамское общение с игроками в IC/OOC.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Если администратор играет на не основном персонаже или у него выключена админка и он играет РП.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;2.9&lt;/span&gt; Запрещено угрожать наказанием игрокам.\r\n&lt;span class=&quot;grey-text&quot;&gt;2.10&lt;/span&gt; Запрещено выдавать игроку hp, armor, выписку из больницы, скины животных, воскрешение не имея на то причины.\r\n&lt;span class=&quot;grey-text&quot;&gt;2.11&lt;/span&gt; Жалоба на твинка рассматривается как жалоба на администратора в целом.\r\n&lt;span class=&quot;grey-text&quot;&gt;2.12&lt;/span&gt; Запрещено занимать руководящие должности во фракции.\r\n&lt;span class=&quot;grey-text&quot;&gt;2.13&lt;/span&gt; Администрации запрещено открыто вмешиваться в экономику сервера.\r\n&lt;span class=&quot;grey-text&quot;&gt;2.14&lt;/span&gt; Администрации запрещено иметь бизнесы.\r\n&lt;span class=&quot;grey-text&quot;&gt;2.15&lt;/span&gt; Запрещено препятствовать работе администрации сервера.\r\n\r\n&lt;h5&gt;ГЛАВА III. Правила пользования репортов и вопросом&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;3.1&lt;/span&gt; Запрещено использовать репорт/вопрос не по назначению.\r\n&lt;span class=&quot;grey-text&quot;&gt;3.2&lt;/span&gt; Обращение в M -&gt; Жалоба по форме: ID; Нарушение (99; DB).\r\n&lt;span class=&quot;grey-text&quot;&gt;3.3&lt;/span&gt; Обращение в M -&gt; Жалоба, по важным вопросам где требуется вмешательство Администрации. Пример: Не могу выйти из интерьера.\r\n&lt;span class=&quot;grey-text&quot;&gt;3.4&lt;/span&gt; Обращение в M -&gt; Вопрос с чётко поставленным вопросом (Где устроиться на работу? и пр.).\r\n&lt;span class=&quot;grey-text&quot;&gt;3.5&lt;/span&gt; Запрещено задавать вопросы по типу &quot;Алло Где Админы, Почему мне не отвечают, и другие&quot; Подобные вопросы будут расцениваться как оффтоп.\r\n&lt;span class=&quot;grey-text&quot;&gt;3.5.1&lt;/span&gt; Запрещено использовать Caps Lock при обращении в М -&gt; Жалоба и М -&gt; Вопрос. Подобные обращения и вопросы будут расцениваться как оффтоп.\r\n&lt;span class=&quot;grey-text&quot;&gt;3.6&lt;/span&gt; Запрещено использовать стрим в качестве доказательства нарушение третьих лиц без одобрения контент мейкера.\r\n&lt;span class=&quot;grey-text&quot;&gt;3.7&lt;/span&gt; Администратор в праве игнорировать обращения составленные не по форме.\r\n\r\n&lt;h5&gt;ГЛАВА IV. Общение&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;4.1&lt;/span&gt; Запрещено оскорбления личности игроков в OOC.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: Запрещено оскорблять игроков, которые ожидают окончание таймера для воскрешения.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;4.2&lt;/span&gt; Запрещено оскорбления близких и родных игрока в IC и OOC.\r\n&lt;span class=&quot;grey-text&quot;&gt;4.3&lt;/span&gt; Запрещено разжигание национальной, этнической, гендерной и религиозной розни в ООС и IC.\r\n&lt;span class=&quot;grey-text&quot;&gt;4.4&lt;/span&gt; Запрещено неуважительное отношение, оскорбления или клевета в сторону Администрации/Хелперов проекта.\r\n&lt;span class=&quot;grey-text&quot;&gt;4.5&lt;/span&gt; Запрещены однотипные нетематические сообщения в текстовом и голосовом чате.\r\n&lt;span class=&quot;grey-text&quot;&gt;4.6&lt;/span&gt; Запрещена намеренная дезинформация игроков в ООС.\r\n&lt;span class=&quot;grey-text&quot;&gt;4.7&lt;/span&gt; Запрещена реклама сторонних ресурсов.\r\n&lt;span class=&quot;grey-text&quot;&gt;4.8&lt;/span&gt; Запрещено использовать Воровской жаргон в ООС.\r\n&lt;span class=&quot;grey-text&quot;&gt;4.9&lt;/span&gt; Запрещено издавать громкие звуки мешающие игрокам.\r\n\r\n&lt;h5&gt;ГЛАВА V. Игровые аккаунты&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;5.1&lt;/span&gt; Запрещена передача/продажа/обмен учётных записей.\r\n&lt;span class=&quot;grey-text&quot;&gt;5.2&lt;/span&gt; Запрещена купля / продажа игровых ценностей за вне игровую валюту.\r\n&lt;span class=&quot;grey-text&quot;&gt;5.3&lt;/span&gt; Ответственность за безопасность учетной записи несет владелец аккаунта.\r\n&lt;span class=&quot;grey-text&quot;&gt;5.4&lt;/span&gt; Запрещены любые махинации и мошенничества с игровой валютой/имуществом вне IC.\r\n&lt;span class=&quot;grey-text&quot;&gt;5.4.1&lt;/span&gt; ООС договоры не имеют никакой силы и администрация не имеет права вмешиваться в решении споров между игроками\r\n&lt;span class=&quot;grey-text&quot;&gt;5.5&lt;/span&gt; Запрещено иметь более 1 бизнеса с учетом второстепенных аккаунтов.\r\n&lt;span class=&quot;grey-text&quot;&gt;5.6&lt;/span&gt; Запрещено дарить или получать подарки на сумму более $500,000.00 (в неделю), в ином случае это считаются продажей валюты.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: Подарки на сумму более $500.000 осуществляются только через IC договор в долг сроком не более 14 дней.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Покупка общего дома неофициальной организации. Владелец обязан вернуть вложенные в покупку средства только при условии продажи этого же имущества.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;5.7&lt;/span&gt; Если пароль от недвижимости/сейфа был выдан вне игровым методом, ответственность несет владелец имущества.\r\n&lt;span class=&quot;grey-text&quot;&gt;5.8&lt;/span&gt; Недвижимое и движимое имущество аккаунтов является неприкосновенным.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: Запрещено изымать имущество без согласия владельца (Транспорт/Дома/Бизнесы/Апартаменты/Квартиры/Склады/Экипированный (телефон/карта)&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;5.8.1&lt;/span&gt; Сотрудникам гос. структур запрещено вторгаться на склады.\r\n\r\n&lt;h5&gt;ГЛАВА VI. Игровой процесс&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;6.1&lt;/span&gt; Запрещен Random Deathmatch (сокр. RDM).\r\n&lt;span class=&quot;grey-text&quot;&gt;6.2&lt;/span&gt; Запрещен Drive By (сокр. DB).\r\n&lt;span class=&quot;grey-text&quot;&gt;6.3&lt;/span&gt; Запрещен Spawn Kill (сокр. SK).\r\n&lt;span class=&quot;grey-text&quot;&gt;6.4&lt;/span&gt; Запрещен Revenge Kill (сокр. RvK).\r\n&lt;span class=&quot;grey-text&quot;&gt;6.5&lt;/span&gt; Запрещен Repeat Kill (сокр. RK).\r\n&lt;span class=&quot;grey-text&quot;&gt;6.6&lt;/span&gt; Запрещено провоцирование других игроков на нарушение правил проекта.\r\n&lt;span class=&quot;grey-text&quot;&gt;6.7&lt;/span&gt; Запрещено использовать читы, хаки, трейнеры, скрипты и другие сторонние ПО, дающие преимущество.\r\n&lt;span class=&quot;grey-text&quot;&gt;6.8&lt;/span&gt; Запрещено использовать недочеты и ошибки мода, для получения выгоды и преимуществ. При нахождении багов, необходимо отписаться в соответствующем текстовом канале дискорд.\r\n&lt;span class=&quot;grey-text&quot;&gt;6.9&lt;/span&gt; Запрещено использовать аудио воспроизводящие программы в общественных местах.\r\n&lt;span class=&quot;grey-text&quot;&gt;6.10&lt;/span&gt; Ответственность за произошедшее во время отсутствия игрока(AFK) несет владелец аккаунта.\r\n&lt;span class=&quot;grey-text&quot;&gt;6.11&lt;/span&gt; Запрещено обходить систему Anti-AFK.\r\n&lt;span class=&quot;grey-text&quot;&gt;6.12&lt;/span&gt; Запрещено использовать электрошокер находясь в ТС.\r\n\r\n&lt;h5&gt;ГЛАВА VII. RolePlay процесс&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;7.1&lt;/span&gt; Запрещён Unrealistic Behaviour (сокр. UB)\r\n&lt;span class=&quot;grey-text&quot;&gt;7.2&lt;/span&gt; Запрещён None RolePlay (сокр. nonRP)\r\n&lt;span class=&quot;grey-text&quot;&gt;7.3&lt;/span&gt; Запрещено использование OOC информации в IC (сокр. MG).\r\n&lt;span class=&quot;grey-text&quot;&gt;7.4&lt;/span&gt; Запрещено как либо уходить от RP ситуаций (Отказ, выход и тд).\r\n&lt;span class=&quot;grey-text&quot;&gt;7.5&lt;/span&gt; Запрещено уходить в AFK более чем на 15 минут во время похищения, ограбления, задержания не уведомив остальных игроков.\r\n&lt;span class=&quot;grey-text&quot;&gt;7.6&lt;/span&gt; Запрещено приземляться/парковать воздушное ТС если в радиусе 10 метров присутствуют объекты/транспорт/препятствие.\r\n&lt;span class=&quot;grey-text&quot;&gt;7.7&lt;/span&gt; Запрещена любая форма проявления сексуального/насильственного характера.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение:] Если обе стороны выразили свое согласие в ООС чат, использование анимаций сексуального характера без соответствующих отыгровок.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;7.8&lt;/span&gt; Голосовым чатом или анимациями можно отыгрывать только команду /me\r\n\r\n&lt;h5&gt;ГЛАВА VIII. Отыгровки текстовых команд&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;8.1&lt;/span&gt; Запрещено неправильное использование команд /me /do /try.\r\n&lt;span class=&quot;grey-text&quot;&gt;8.2&lt;/span&gt; Команда /me разрешена только для описания действий своего персонажа (Прим: /me кивнул, /me хлопнул в ладоши и т.д.).\r\n&lt;span class=&quot;grey-text&quot;&gt;8.3&lt;/span&gt; Команда /do разрешена только для описания действий неподконтрольных игрокам персонажей и неодушевленного окружения (Прим: /do чайник вскипел, /do дверь приоткрыта и т.д.).\r\n&lt;span class=&quot;grey-text&quot;&gt;8.3.1&lt;/span&gt; Иногда команду /do можно использовать для наводящих вопросов для других участников RP процесса в рамках IC информации (Прим: /do есть ли с собой документы? /do что в сумке? и т.д.).\r\n&lt;span class=&quot;grey-text&quot;&gt;8.3.2&lt;/span&gt; Запрещено врать в /do.\r\n&lt;span class=&quot;grey-text&quot;&gt;8.4&lt;/span&gt; Команда /try разрешена только для описания попытки действия персонажа с неизвестным вытекающим, сервер сгенерирует и ответит вам, удачно ли сделали своё действие (Прим: /try попытался выбить дверь, /try закинул клочок бумаги в мусорную корзину и т.д.).\r\n&lt;span class=&quot;grey-text&quot;&gt;8.4.1&lt;/span&gt; Запрещено злоупотреблять командой /try в личных интересах или корыстных целях.\r\n&lt;span class=&quot;grey-text&quot;&gt;8.5&lt;/span&gt; Запрещено отыгрывать нереалистичные и не свойственные действия для вашего персонажа (Прим: /me поднял автомобиль мизинцем, /do с неба упал $1,000,000 и т.д.).\r\n\r\n&lt;h5&gt;ГЛАВА IX. Оформление IC договоров&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;9.1&lt;/span&gt; Договор необходимо оформлять в двухстороннем порядке (То есть, у каждого из участников должна быть 1 копия договора)\r\n&lt;span class=&quot;grey-text&quot;&gt;9.2&lt;/span&gt; Договор действителен, если есть хотя-бы одна копия у любой из сторон\r\n&lt;span class=&quot;grey-text&quot;&gt;9.3&lt;/span&gt; При оформлении договора необходимо указать CardID, Имя и Фамилию персонажа обеих сторон, поставить подпись обоих участников и обязательно указать предмет договора (Имущество, Деньги и так далее)\r\n&lt;span class=&quot;grey-text&quot;&gt;9.4&lt;/span&gt; При оформления IC договора на подселение, обязательно наличие условий 100% возврата денежных средств при выселения/продажи дома.\r\n&lt;span class=&quot;grey-text&quot;&gt;9.5&lt;/span&gt; Если обе копии договора были уничтожены, договор не имеет никакой силы и его не существует\r\n&lt;span class=&quot;grey-text&quot;&gt;9.6&lt;/span&gt; В случае несоблюдения одной из сторон договора, игрок имеет права обратиться к сотрудникам правительства или полиции, для того, чтобы было заведено дело\r\n&lt;span class=&quot;grey-text&quot;&gt;9.6.1&lt;/span&gt; Если дело было доказано, сотрудники, которые участвовали в расследовании или существенной помощи в этом дело, получают премию\r\n&lt;span class=&quot;grey-text&quot;&gt;9.6.2&lt;/span&gt; Если, сторона, которая нарушала договор, отказывается возмещать убытки, которые были доказаны с помощью IC процесса, администрация имеет права сделать это насильно\r\n&lt;span class=&quot;grey-text&quot;&gt;9.7&lt;/span&gt; Адвокаты могут выступать в роли защиты той или иной стороны, если есть лицензия юриста', 's3');
INSERT INTO `rules` VALUES (3, 'Гос. Структуры', '&lt;h5&gt;ГЛАВА X. Общее положение&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;10.1&lt;/span&gt; Запрещено сотрудникам государственных организаций эвакуировать ТС в личных целях.\r\n&lt;span class=&quot;grey-text&quot;&gt;10.2&lt;/span&gt; Запрещено брать предметы из государственных фракций в личных интересах (Только для служебных нужд).\r\n&lt;span class=&quot;grey-text&quot;&gt;10.3&lt;/span&gt; Сотрудники государственных организаций не могут эвакуировать транспортные средства без отыгрыша вызова эвакуатора и указания улицы и эвакуируемого ТС.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Сотрудники государственных организаций помогают очистить место от &quot;забагованные&quot; транспортных средств, которые не принадлежат к RP процессу&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;10.4&lt;/span&gt; Сотрудникам EMS запрещено использовать дефибриллятор без текстовой или голосовой отыгровки оказания ПМП.\r\n&lt;span class=&quot;grey-text&quot;&gt;10.5&lt;/span&gt; Сотрудникам силовых структур запрещено проводить задержания и обыск на и возле территории рынка и чёрного рынка.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Рейд, работа детективов/fib, уход на титульный район во время погони&lt;/span&gt;\r\n\r\n\r\n&lt;h5&gt;ГЛАВА XI. Силовые структуры&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;11.1&lt;/span&gt; Сотрудниками силовых структур являются все сотрудники BCSD, LSPD, USMC, FIB.\r\n&lt;span class=&quot;grey-text&quot;&gt;11.2&lt;/span&gt; Сотрудникам LSPD/BCSD/FIB запрещено выдавать розыск игрокам не идентифицировав их личность.\r\n&lt;span class=&quot;grey-text&quot;&gt;11.2.1&lt;/span&gt; Идентификация личности происходит через попытку найти документы у подозреваемого используя единожды команду /try(на одного подозреваемого, одна попытка вне зависимости от количества сотрудников LSPD/BCSD/USMC/FIB).\r\n&lt;span class=&quot;grey-text&quot;&gt;[Отыгровка]: /try нашёл документы у человека напротив. /do нашёл документы у человека с card-id ***.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;11.2.2&lt;/span&gt; Если документы не были найдены, то сотрудник LSPD/BCSD/FIB может сделать фотографию подозреваемого на свой смартфон и через /try пробить единожды через базу данных, необходимо находиться в служебном транспорте (на одного подозреваемого, одна попытка вне зависимости от количества сотрудников LSPD/BCSD/FIB).\r\n&lt;span class=&quot;grey-text&quot;&gt;11.2.3&lt;/span&gt; Если документы не были найдены, то сотрудник LSPD/BCSD/FIB может привезти задерживаемого в участок и пробить человека по отпечаткам пальцев.\r\n&lt;span class=&quot;grey-text&quot;&gt;11.3&lt;/span&gt; Запрещено сотрудникам гос. организаций вмешиваться в войну за территорию, войну за граффити.\r\n&lt;span class=&quot;grey-text&quot;&gt;11.4&lt;/span&gt; Сотрудникам силовых структур запрещено находиться на титульной территории банды.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Рейд, работа детективов/fib, уход на титульный район во время погони.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;11.5&lt;/span&gt; Сотрудникам силовых структур запрещено задерживать игрока который был убит в процессе задержания и появился в больнице.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Если на игрока заведено RP дело и до задержания было проведено расследование и собраны все необходимые доказательства для его задержания&lt;/span&gt;\r\n\r\n&lt;h5&gt;ГЛАВА XII. Рейды&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;12.1&lt;/span&gt; Одобрение рейда производиться только при получении сразу двух подписей Губернатора и Директора FIB .\r\n&lt;span class=&quot;grey-text&quot;&gt;12.2&lt;/span&gt; Главная задача рейда - Задержание определенных лиц, проверка на наличие нелегальных предметов.\r\n&lt;span class=&quot;grey-text&quot;&gt;12.3&lt;/span&gt; Минимальное количество участников от государственных организаций - 25 человек.\r\n&lt;span class=&quot;grey-text&quot;&gt;12.4&lt;/span&gt; Запрещено проводить рейд на одну банду чаще чем один раз в реальную неделю.\r\n&lt;span class=&quot;grey-text&quot;&gt;12.5&lt;/span&gt; Рейд разрешено проводить только под руководством FIB.', 's3');
INSERT INTO `rules` VALUES (4, 'Крайм. организации', '&lt;h5&gt;Глава XIII. Общее положение&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;13.1&lt;/span&gt;  Запрещено убивать/похищать/грабить игроков, устраивать теракты/захваты в Зелёной зоне.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Функциональное ограбление банкомата/магазина, применение оружия в целях самообороны, защита движимого и недвижимого имущества (территория личного дома/квартиры/склада или личный транспорт).&lt;/span&gt; \r\n&lt;span class=&quot;grey-text&quot;&gt;13.2&lt;/span&gt;  Запрещено убивать/похищать/грабить игроков в Лос-Сантосе, кроме района гетто\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Функциональное ограбление банкомата/магазина, применение оружия в целях самообороны, защита движимого и недвижимого имущества (территория личного дома/квартиры/склада или личный транспорт).&lt;/span&gt; \r\n&lt;span class=&quot;grey-text&quot;&gt;13.4&lt;/span&gt;  Запрещена провокация, убийство членов банд на их титульной территории.\r\n&lt;span class=&quot;grey-text&quot;&gt;13.6&lt;/span&gt;  Банды обязаны соблюдать закрепленный цвет одежды.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: Не менее 50% от всей одежды.&lt;/span&gt; \r\n&lt;span class=&quot;grey-text&quot;&gt;13.7&lt;/span&gt;  Запрещено похищать/грабить/убивать людей на территории спавна неофициальной организации.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Функциональное ограбление банкомата/магазина, применение оружия в целях самообороны, разгрузка груза (Speedo, Mule, Pounder, Brickade), защита движимого и недвижимого имущества (территория личного дома/квартиры/склада или личный транспорт).&lt;/span&gt; \r\n\r\n&lt;h5&gt;Глава XIV. Похищение и ограбление.&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;14.1&lt;/span&gt; Запрещено похищать/грабить не имея огнестрельного оружия.\r\n&lt;span class=&quot;grey-text&quot;&gt;14.2&lt;/span&gt; Запрещено убивать жертву без IC причины.\r\n&lt;span class=&quot;grey-text&quot;&gt;14.3&lt;/span&gt; Запрещено похищать/грабить/убивать сотрудников EMS при исполнении.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Сотрудника EMS можно убить если он не выполняет ваши требования под угрозой своей жизни.&lt;/span&gt; \r\n&lt;span class=&quot;grey-text&quot;&gt;14.4&lt;/span&gt; Запрещено вызывать сотрудников гос. структур для последующего ограбления.\r\n&lt;span class=&quot;grey-text&quot;&gt;14.5&lt;/span&gt; Ограбление игрока происходит только через функционал сервера.\r\n&lt;span class=&quot;grey-text&quot;&gt;14.6&lt;/span&gt; Запрещено похищать кого угодно с целью выкупа, кроме Лидеров и заместителей государственных структур.\r\n&lt;span class=&quot;grey-text&quot;&gt;14.6.1&lt;/span&gt; Максимальная сумма выкупа за Лидера-$200,000 , Заместителя-$100,000\r\n&lt;span class=&quot;grey-text&quot;&gt;14.7&lt;/span&gt; Запрещено похищать не уведомив сторону выкупа каким-либо IC способом.\r\n&lt;span class=&quot;grey-text&quot;&gt;14.8&lt;/span&gt; Запрещено похищать одного и того же лидера/заместителя чаще чем один раз в реальную неделю.\r\n&lt;span class=&quot;grey-text&quot;&gt;14.9&lt;/span&gt; Запрещено устраивать похищения по OOC и IC договоренности с целью получения выгоды.\r\n&lt;span class=&quot;grey-text&quot;&gt;14.10&lt;/span&gt; Запрещено брать переговорщика в заложники.\r\n&lt;span class=&quot;grey-text&quot;&gt;14.11&lt;/span&gt; Запрещено отказываться выполнять договоренности данные сотрудникам гос. организаций, если они выполнили требования похитителей.\r\n&lt;span class=&quot;grey-text&quot;&gt;14.12&lt;/span&gt; Похитителей должно быть в 2 раза больше чем жертв.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: Запрещено убивать игроков, с целью похищения.&lt;/span&gt; \r\n&lt;span class=&quot;grey-text&quot;&gt;14.13&lt;/span&gt; Грабителей должно быть в 2 раза больше чем жертв.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: Запрещено убивать игроков, с целью грабежа.&lt;/span&gt; \r\n&lt;span class=&quot;grey-text&quot;&gt;14.14&lt;/span&gt; Запрещено грабить/похищать/убивать работающих садовников, разнорабочих, водителей автобуса, почтальонов, фотографов, таксистов, механиков, перевозчиков грузов Ламара.\r\n&lt;span class=&quot;grey-text&quot;&gt;14.15&lt;/span&gt; Запрещено убивать/похищать/грабить игроков в интерьерах Автомастерских, Банков, Аптек, Клубов/Баров, Церкви, Парикмахерских, Тату салон, Магазинов (одежды, 24/7, рыбный, охотничий, ювелирный, оружейный, электроники).\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Функциональное ограбление банкомата/магазина, применение оружия в целях самообороны, защита движимого и недвижимого имущества (территория личного дома/квартиры/склада или личный транспорт).&lt;/span&gt; \r\n\r\n&lt;h5&gt;Глава XV. Проезд мимо&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;15.1&lt;/span&gt; Каждая банда может проводить один “проезд мимо” раз в реальные сутки. Организатором должен являться лидер или его заместитель.\r\n&lt;span class=&quot;grey-text&quot;&gt;15.2&lt;/span&gt; Минимальное количество транспорта - 2. Минимальное количество людей - 6.\r\n&lt;span class=&quot;grey-text&quot;&gt;15.3&lt;/span&gt; Максимальная скорость транспорта в колонне - 40 км/ч.\r\n&lt;span class=&quot;grey-text&quot;&gt;15.4&lt;/span&gt; Максимальное количество кругов вокруг территории - 2.\r\n&lt;span class=&quot;grey-text&quot;&gt;15.5&lt;/span&gt; Запрещено покидать транспорт.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Смерть водителя.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;15.6&lt;/span&gt; Запрещено проводить проезд мимо за 60 минут до войны за территорию.\r\n&lt;span class=&quot;grey-text&quot;&gt;15.7&lt;/span&gt; Во время “проезда мимо” правило SK (SpawnKill) не действует.\r\n\r\n&lt;h5&gt;Глава XVI. Война за территории банд&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;16.1&lt;/span&gt; Запрещено увольнять/принимать людей во фракцию во время войны за территорию.\r\n&lt;span class=&quot;grey-text&quot;&gt;16.2&lt;/span&gt; Запрещено находится в транспорте во время войны за территорию.\r\n&lt;span class=&quot;grey-text&quot;&gt;16.3&lt;/span&gt; Запрещено находится в интерьерах во время захвата.\r\n&lt;span class=&quot;grey-text&quot;&gt;16.4&lt;/span&gt; Запрещается бездействовать во время захвата территории.\r\n&lt;span class=&quot;grey-text&quot;&gt;16.5&lt;/span&gt; Запрещено использовать аптечки/наркотики вне укрытия.\r\n&lt;span class=&quot;grey-text&quot;&gt;16.6&lt;/span&gt; Допустимое количество участников капта с каждой стороны - от 5 до 20.\r\n&lt;span class=&quot;grey-text&quot;&gt;16.7&lt;/span&gt; Запрещено выходить из зоны деменшена, в котором происходит захват территории.\r\n&lt;span class=&quot;grey-text&quot;&gt;16.8&lt;/span&gt; Запрещено использовать транспортные средства в области войны за территорию\r\n&lt;span class=&quot;grey-text&quot;&gt;16.9&lt;/span&gt; Запрещено использование абсолютно любых анимаций.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: До его фактического завершения (когда на счётчике проигравшей стороны 0 игроков).&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;16.10&lt;/span&gt; Во время войны за территорию запрещено занимать крыши зданий, а также позиции, на которые невозможно попасть без посторонней помощи&lt;/span&gt; \r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Позиции, доступные с одного прыжка.&lt;/span&gt; \r\n&lt;span class=&quot;grey-text&quot;&gt;16.11&lt;/span&gt;  Каждый участник обязан иметь полную видеозапись захвата территории в течении 24 часов и быть готовым предоставить его по первому требованию администрации.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: Обязателен HUD и звук игры/войс чат дискорда или других приложений для общения.&lt;/span&gt; \r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: Видео должно быть качеством не ниже 480p.&lt;/span&gt; \r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: Видео должно быть записано от начала войны за территорию до его фактического завершения (когда на счётчике проигравшей стороны 0 игроков).&lt;/span&gt; \r\n&lt;span class=&quot;grey-text&quot;&gt;16.12&lt;/span&gt; Запрещено начинать стрельбу на территории захвата до момента фиксации хотя бы 1 участника обороны внутри территории.\r\n&lt;span class=&quot;grey-text&quot;&gt;16.13&lt;/span&gt; Запрещено на территории захвата до начала таймера ломать маппинг карты, который может дать преимущество той или иной стороне.\r\n&lt;span class=&quot;grey-text&quot;&gt;16.14&lt;/span&gt; Запрещено нападать на вражескую банду до начала захвата территории.\r\n&lt;span class=&quot;grey-text&quot;&gt;16.15&lt;/span&gt; Сторона атаки обязана занять территорию до начала захвата.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: Сторона обороны обязана войти в территорию после начала захвата.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;16.16&lt;/span&gt; Запрещен трансфер состава в любом виде.\r\n&lt;span class=&quot;grey-text&quot;&gt;16.17&lt;/span&gt; Разрешено объявлять войну за территории только на прилегающие территории.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: Захват территорий разрешён лишь по вертикальной и горизонтальной траектории.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;16.18&lt;/span&gt; Если у банды остается 1 главная улица, то банде разрешено объявлять лишь 1 атаку в день.\r\n&lt;span class=&quot;grey-text&quot;&gt;16.19&lt;/span&gt; Одна банда может провести только 4 атаки и 4 защиты за день.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: На одну банду можно провести максимум 2 атаки.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: Атакующая сторона обязана сообщить обороняющейся стороне об условиях и времени, минимум за 30 минут и максимум за 120 минут.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;16.20&lt;/span&gt; Капты разрешено проводить в Понедельник, Среду, Пятницу и Воскресенье.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Исключение]: Вторник, Четверг и Суббота - только по обоюдному согласию 2-х сторон.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание 1]: Сторона атаки может поставить условия на кол-во участников, наличие брони, на калибр оружия.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание 2]: Сторона защиты должна выполнять условия стороны атаки.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание 3]: Если у стороны обороны недостаточное кол-во человек, то она может явиться в меньшем количестве.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;16.21&lt;/span&gt; Запрещено появляться на “точке выхода” если у вас произошел вылет из игры.\r\n&lt;span class=&quot;grey-text&quot;&gt;16.22&lt;/span&gt; Обмен территориями разрешен только с одобрения главного куратора/зГА/ГА.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: до 3 раз в неделю.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;16.23&lt;/span&gt; Продажа/покупка территории разрешена только с одобрения главного куратора/зГА/ГА.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: до 3 раз в неделю.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;16.24&lt;/span&gt; Разрешается похитить главу вражеской банды с целью выкупа за территорию.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: до 2 раз в неделю.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;16.25&lt;/span&gt; Запрещено заходить в территорию после 200 секунд от начала таймера.\r\n&lt;span class=&quot;grey-text&quot;&gt;16.26&lt;/span&gt; Во время мероприятия запрещено занимать труднодоступные места, которые могут дать преимущество.\r\n&lt;span class=&quot;grey-text&quot;&gt;16.27&lt;/span&gt; Запрещено использовать шокеры и снайперские винтовки во время захвата территории.\r\n\r\n&lt;h5&gt;Глава XVII. Неофициальные организации.&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;17.1&lt;/span&gt; Запрещено убивать людей на территории Гетто без IC причины.\r\n&lt;span class=&quot;grey-text&quot;&gt;17.2&lt;/span&gt; Запрещена провокация, убийство членов банд на их титульной территории.\r\n\r\n&lt;h5&gt;Глава XVIII. Перевозка С4.&lt;/h5&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;18.1&lt;/span&gt; Война за С4 происходит только на территории электростанции (GPS - Интересные места - Электростанция).\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: Нападать и пытаться забрать груз с С4 запрещено вне территории электростанции.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;18.2&lt;/span&gt; Запрещено нападать на сотрудников гос. организаций на территории электростанции не ранее 19:20.\r\n&lt;span class=&quot;grey-text&quot;&gt;[Примечание]: Запрещена провокация до начала мероприятия с обеих сторон.&lt;/span&gt;\r\n&lt;span class=&quot;grey-text&quot;&gt;18.3&lt;/span&gt; После начала мероприятия в 19:20, если крайм не успевает ликвидировать всех гос. сотрудников до 19:40, то они проигрывают и будут обязаны отступить.\r\n&lt;span class=&quot;grey-text&quot;&gt;18.4&lt;/span&gt; Запрещено садиться за руль фургона с С4 во время перестрелки.\r\n&lt;span class=&quot;grey-text&quot;&gt;18.5&lt;/span&gt; Во время войны за С4 запрещено использовать любые транспортные средства на территории электростанции.\r\n&lt;span class=&quot;grey-text&quot;&gt;18.6&lt;/span&gt; Сотрудникам EMS запрещено приезжать и оказывать медицинскую помощь пострадавшим во время и после мероприятия.\r\n&lt;span class=&quot;grey-text&quot;&gt;18.7&lt;/span&gt; Запрещено занимать позиции на крышах построек.\r\n&lt;span class=&quot;grey-text&quot;&gt;18.8&lt;/span&gt; Запрещено создавать баррикады из транспортных средств.\r\n&lt;span class=&quot;grey-text&quot;&gt;18.9&lt;/span&gt; Запрещено возвращаться на Электростанцию, если вас убили.', 's3');
